(16, 'employee-status', 'Independent Contractor or Employee', 'Is someone working for your company an independent contractor or an employee? The difference matters. Find out with this free test!', 72),
(17, 'employer-status', 'Independent Contractor or Employee', 'Is someone working for your company an independent contractor or an employee? The difference matters. Find out with this free test!', 63),
(18, 'wills', 'Why Get a Will', 'Have you thought about getting a will but weren''t sure if you needed one? Find out why getting a will is important and can save your family money!', 66),
(19, 'daca', 'Deferred Action for Children Arrivals', 'The Deferred Action for Children Arrivals (DACA) is an immigration law that gives eligible youth temporary permission to stay in the U.S. for 2 years without fear of deportation. Find out if you''re eligible!', 65),
(20, 'why-get-a-will', 'Why Get a Will', 'Why Get a Will? A will is a document with instructions on how your property should be split up after you die. It also lets you name guardians for your children under 18. Without a will, the government decides how your property should be split and who is responsible for your kids. This can get complex and your property can lose a lot of its value in court. Therefore, the main reasons to get a will are to  1. Prevent the government from making decisions about your property and children, 2. Avoid court fees and save money. Dying without a will means you have no say in what happens to your property or children. Although there are default rules on what will happen, if you have specific instructions, or want to save your family money, it’s a good idea to get a will. If your finances are simple, you can make a will quickly online with companies such as LegalZoom. If you would like to create something more complicated, you may want to hire an attorney to help you.', 66),
(21, 'should-i-get-a-will', 'Should I Get a Will', 'Should I Get a Will? A will is a document with instructions on how your property should be split up after you die. It also lets you name guardians for your children under 18. Without a will, the government decides how your property should be split and who is responsible for your kids. This can get complex and your property can lose a lot of its value in court. Therefore, the main reasons to get a will are to  1. Prevent the government from making decisions about your property and children, 2. Avoid court fees and save money. Dying without a will means you have no say in what happens to your property or children. Although there are default rules on what will happen, if you have specific instructions, or want to save your family money, it’s a good idea to get a will. If your finances are simple, you can make a will quickly online with companies such as LegalZoom. If you would like to create something more complicated, you may want to hire an attorney to help you.', 68),
(22, 'how-do-i-get-a-restraining-order', 'Restraining Order', 'A restraining order can help protect you and your loved ones from people who want to intimidate and abuse you. Find out how to get a restraining order today.', 69),
(23, 'security-deposit-california', 'Security Deposit &mdash; California', 'Security Deposits in California. In California, landlords can deduct your security deposit for four reasons: 1) unpaid rent, 2) cleaning the rental, but only to make it as clean as it was when you moved in, 3) repairs of damages caused by you or your guests, other than normal wear and tear, 4) if the lease allows it, like lost keys.  Your security deposit cannot be used for damages that happened before you moved in. Under California law, your landlord has 21 days after you move out to return your deposit or tell you any deductions that were taken. If there are deductions, your landlord must give you an itemized statement describing the amount and reasons for the deductions. Any repairs or cleaning costs must be reasonable. Your landlord can’t deduct $1000 for a $100 job. To get your deposit back, first send a formal letter to your landlord stating reasons why you deserve it back. If this doesn’t work, you can try third-party mediation. If all else fails, you can try small claims court or superior court. A lawyer can help you out here.', 70),
(24, 'dui-texas', 'DUI &mdash; Texas', 'Charged with a DUI in Texas? Not sure what to do? Use our free guide!', 6),
(25, 'dui-florida', 'DUI &mdash; Florida', 'Charged with a DUI in Florida? Not sure what to do? Use our free guide!', 7),
(26, 'dui-pennsylvania', 'DUI &mdash; Pennsylvania', 'Charged with a DUI in Pennsylvania? Not sure what to do? Use our free guide!', 8),
(27, 'dui-arizona', 'DUI &mdash; Arizona', 'Charged with a DUI in Arizona? Not sure what to do? Use our free guide!', 10),
(28, 'bankruptcy', 'Can I Declare Bankruptcy?', 'Financial troubles keeping you down? Find out if you have the option to declare bankruptcy for relief.', 25),
