(37, 'sopa', 'SOPA', 'Want to know the law behind SOPA, PIPA, CISPA and other anti-piracy bills? Find the answers here.', 0),
(38, 'corporation-or-llc', 'Corporation or LLC?', 'If you''re thinking about forming a corporation or an LLC, find out which entity may be right for your business.', 2),
(39, 'when-to-incorporate', 'When to Incorporate', 'Thinking about incorporating your business, but not sure if it is time yet? Find out the answers with this quick, free guide.', 76),
(40, 'hiring-documents', 'Hiring Documents', 'Every business needs certain documents signed by their employees and contractors to keep their business protected. Find out which documents with this quick, free guide.', 77),
(41, 'intellectual-property', 'Intellectual Property', 'Got an invention you want to patent, work you want to copyright, a mark to trademark, or just wondering what it takes? Find the answers here.', 0),
