INSERT INTO `links` (`id`, `type`, `url`, `category`, `summary`, `title`, `votes`, `tags`, `slug`, `source`, `poster`, `date_created`, `location`, `views`) VALUES
(1, 'primary', 'http://www.ca1.uscourts.gov/pdf.opinions/10-2204P-01A.pdf', 34, 'DOMA is a federal law that defines marriage as the legal union between one man and one women. This law allows states the right to not recognize a same-sex marriage as valid.  ', 'Opinion of Case Finding DOMA Unconstitutional ', 32, 'same-sex marriage, doma, federal law, first circuit, unconstitutional', 'opinion-of-case-finding-doma-unconstitutional', '', 0, 0, '', 15),
(2, 'primary', 'http://en.wikipedia.org/wiki/Massachusetts_v._United_States_Department_of_Health_and_Human_Services', 34, 'The First Circuit Court of Appeals found that DOMA''s definition of marriage was unconstitutional because the States have traditionally held the power to define marriage, not the federal government. The Supreme Court will probably hear the case soon to ultimately decide DOMA''s fate. ', 'Court Rules DOMA Unconstitutional', 91, 'same-sex marriage, doma, federal law, first circuit, unconstitutional ', 'court-rules-doma-unconstitutional', '', 0, 0, '', 30),
(3, 'primary', 'http://www.law.cornell.edu/uscode/text/1/7', 34, 'Section 3 of DOMA defines marriage as the legal union between one man and one women. The word "spouse" refers only to a person of the opposite sex who is a husband or a wife. ', 'What the Federal Government Defines as Marriage', 87, 'same-sex marriage, doma, federal law, section 3, marriage defintion', 'what-the-federal-government-defines-as-marriage', '', 0, 0, '', 28),
(4, 'primary', 'http://www.law.cornell.edu/uscode/text/28/1738C', 34, 'Section 2 of DOMA states that States are not required to recognize another States'' same-sex marriage laws.', 'Section 2 of DOMA', 45, 'same-sex marriage, doma, federal law, section 2, supremacy clause', 'section-2-of-doma', '', 0, 0, '', 14),
(5, 'secondary', 'http://en.wikipedia.org/wiki/Defense_of_Marriage_Act', 34, 'The Defense of Marriage Act (DOMA) is a federal law that defines marriage as the legal union between one man and one women. It was signed into law in 1996 by President Bill Clinton. Recently the First Circuit found that DOMA is unconstitutional, sparking national debate on the issue of gay rights.', 'Learn more about DOMA', 81, 'same-sex marriage, doma, federal law, Clinton ', 'learn-more-about-doma', '', 0, 0, '', 19),
(6, 'primary', 'http://caselaw.lp.findlaw.com/data/constitution/amendment10/', 34, 'The 10th Amendment directly from the US Constitution. Powers that are not delegated in the Constitution, nor prohibited by the states are reserved to the states. ', 'Tenth Amendment of the US Constitution', 37, 'same-sex marriage, federalism, constitution, tenth amendment  ', 'tenth-amendment-of-the-us-constitution', '', 0, 0, '', 15),
(7, 'primary', 'http://en.wikipedia.org/wiki/Tenth_Amendment_to_the_United_States_Constitution', 34, 'The Tenth Amendment states the Constitution''s principle of federalism, which delagates powers not granted to the federal government to the States or people. ', 'Learn more about the 10th Amendment', 55, 'same-sex marriage, federalism, constitution, tenth amendment', 'learn-more-about-the-10th-amendment', '', 0, 0, '', 16),
(8, 'primary', 'http://law-dictionary.clearpointlaw.com/f/federalism_Aut.aspx', 1, 'Federalism is a system of government where state governments and the federal government share power. The United States is an example of a federal government.  ', 'Quick Definition of Federalism', 74, '', 'quick-definition-of-federalism', '', 0, 0, '', 2),
(9, 'primary', 'http://rightdirection.com/2011/05/05/federalism-explained/', 1, 'Federalism divides power between the federal government and States. This gives States greater freedom to define and create different laws. Federalism works because states are given discretion in defining laws tailored to their own political, economic, and social situation. Since the early 1800s, the power of the national government has been broadly expanded. This has led to a trend in which large national policies have been favored over small state delegation. ', 'Federalism Explained ', 50, '', 'federalism-explained', '', 0, 0, '', 0),
(141, 'photo', 'http://www.plantingempowerment.com/storage/thumbnails/6628851-17520211-thumbnail.jpg?__SQUARESPACE_CACHEVERSION=1333726618592', 1, 'On April 5, 2012, Obama signed into law the Jumpstart Our Business Startups (JOBS) Act. The bill, among other things, enable startups to raise equity financing for their businesses through crowdfunding platforms. ', 'Jobs Act', 98, 'jobs act, crowdfunding', 'jobs-act', '', 0, 0, '', 2),
(10, 'primary', 'http://en.wikipedia.org/wiki/Federalism_in_the_United_States', 34, 'Federalism defines the relationship between state governments and the federal government. Certain powers are reserved for the states, whereas others are controlled by the federal government. Some powers are shared. States have traditionally held the exclusive power to define marriage. Thus, DOMA''s definition of marriage may be unconstitutional because it is a state power, not a federal power. ', 'Learn more about Federalism', 62, 'same-sex marriage, federalism ', 'learn-more-about-federalism', '', 0, 0, '', 17),
(11, 'primary', 'http://usgovinfo.about.com/od/rightsandfreedoms/a/federalism.htm', 34, 'The federal government and state governments have certain exclusive and shared powers. Some exclusive federal government powers include the power to print money, declare war, establish an army and navy, and regulate commerce between the states. Some exclusive state powers include the power to issue licenses, conduct elections, and provide for public health and safety. Some shared powers include setting up courts, creating and collecting taxes, and building highways. ', 'Exclusive Powers of State Governments', 78, 'same-sex marriage, federalism, states'' rights ', 'exclusive-powers-of-state-governments', '', 0, 0, '', 36),
(12, 'primary', 'http://www.law.cornell.edu/supct/html/historics/USSC_CR_0017_0316_ZS.html', 1, 'This landmark decision reinforced the concept that the Constitution of the U.S. is the supreme law of the land. The case establishes that the Constitution grants congress implied powers for implementing the enumerated powers that Congress is given. Furthermore, a state''s action may not impede valid constitutional exercises of power by the federal government. ', 'Landmark Case Establishing Federalism', 24, '', 'landmark-case-establishing-federalism', '', 0, 0, '', 0),
(13, 'primary', 'http://en.wikipedia.org/wiki/Same-sex_marriage_in_California', 34, 'California use to grant same-sex marriages licenses starting in June 16, 2008. However due to the passage of Proposition 8, same-sex marriage licenses were discontinued in November 5, 2008.', 'Learn More About Gay Marriage in California', 53, 'same-sex marriage, california, prop 8', 'learn-more-about-gay-marriage-in-california', '', 0, 0, '', 17),
(14, 'primary', 'http://en.wikipedia.org/wiki/California_Proposition_8', 34, 'Proposition 8 was ballot passed in the November 2008 election. It added an amendement to the California Constitution, which provides that "only marriage between a man and a woman is valid or recognized in California."', 'Learn more about Proposition 8', 64, 'same-sex marriage, california, prop 8,', 'learn-more-about-proposition-8', '', 0, 0, '', 20),
(16, 'primary', 'http://law.onecle.com/california/constitution/article_1/7.5.html', 34, 'Article 1, Section 7.5 of the California Constitution states that California only recognizes marriage between a man and a woman. ', 'Legal Definition of Marriage in California', 68, 'same-sex marriage, california, california constitution, marriage definition', 'legal-definition-of-marriage-in-california', '', 0, 0, '', 20),
(22, 'primary', 'http://statesthatallowgaymarriage.com/', 34, 'The status of same-sex marriage varies in different states. This is because states have traditionally reserved the right to define marriage. Click on a state for a detailed summary of that State''s same-sex marriage laws. ', 'Same-sex Marriage Facts For Every State', 79, 'same-sex marriage, states, legal status ', 'same-sex-marriage-facts-for-every-state', '', 0, 0, '', 20),
(18, 'primary', 'http://www.law.cornell.edu/constitution/amendmentxiv/', 1, 'The Fourteenth Amendment provides protection to all American citizens and ensure their rights in due process and equal protection in relation to race or ethnic identity. Notably, the amendment contains a section on citizenship being granted to individuals who are born in the U.S. but have parents that are not.', 'Fourteenth Amendment of the US Constitution', 35, '', 'fourteenth-amendment-of-the-us-constitution', '', 0, 0, '', 0),
(19, 'primary', 'http://en.wikipedia.org/wiki/Fourteenth_Amendment_to_the_United_States_Constitution', 34, 'The Fourteenth Amendment is composed of several clauses including Due Process, Equal Protection, and Citizenship. Due Process refers to an individual''s procedural and substantive rights. Equal Protection refers to laws disallowing segregated treatment or individuals based on ethnicity or race. Citizenship rights enumerate the types of rights that individuals in the U.S. have. \n', 'Learn more about the 14th Amendment', 56, 'same-sex marriage, constitution, fourteenth amendment, equal protection ', 'learn-more-about-the-14th-amendment', '', 0, 0, '', 16),
(20, 'primary', 'http://en.wikipedia.org/wiki/Same-sex_marriage_status_in_the_United_States_by_state', 34, 'As of July 10, 2012, same-sex marriage will be legal in Vermont, New Hampshire, Massachusetts, Connecticut, New York, Washington D.C., Iowa, and Washington. ', 'Which States Allow Same Sex Marriage?', 92, 'same-sex marriage, states, legal status ', 'which-states-allow-same-sex-marriage', '', 0, 0, '', 31),
(21, 'primary', 'http://www.ca9.uscourts.gov/datastore/general/2012/02/07/1016696com.pdf', 34, 'The Ninth Circuit Court of Appeals ruled that Proposition 8 was unconstitutional because it''s sole purpose was to deny the right of marriage to gay couples, thereby violating the Fourteenth Amendment.', 'Opinion of Case Finding Prop 8 Unconstitutional ', 16, 'same-sex marriage, california, ninth circuit, prop 8, unconstitutional, fourteenth amendment', 'opinion-of-case-finding-prop-8-unconstitutional', '', 0, 0, '', 20),
(23, 'news', 'http://www.huffingtonpost.com/2012/07/11/pelosi-house-dems-doma-repeal_n_1665621.html?utm_hp_ref=politics&ir=Politics', 1, 'Led by Minority Leader Nancy Pelosi (D-Calif.), 132 House Democrats filed a brief in the Ninth Circuit Court of Appeals on Tuesday arguing that the Defense of Marriage Act (DOMA) is discriminatory and unconstitutional. In the brief, which was filed in the case of Golinski v. U.S. Office of Personnel Management, the members of Congress argued that DOMA "lacks a rational relationship to any legitimate federal purpose and accordingly is unconstitutional."', 'Nancy Pelosi And House Democrats File Brief Supporting DOMA Repeal In California Court', 23, 'doma, federal law, repeal, democracts', 'nancy-pelosi-and-house-democrats-file-brief-supporting-doma-repeal-in-california-court', '', 0, 0, '', 5),
(24, 'photo', 'http://statesthatallowgaymarriage.com/wp-content/themes/Gay%20Marriage/images/garymap.gif', 34, 'As of June 2012, eight states will recognize same-sex marriages and a total of six states (plus the District of Columbia) will recognize some form of same-sex civil unions or domestic partnerships.', 'States That Allow Gay Marriage', 103, 'same-sex marriage, states, legal status ', 'states-that-allow-gay-marriage', '', 0, 0, '', 5),
(62, 'secondary', 'http://startuplawyer.com/incorporation/the-when-to-incorporate-decision-matrix', 38, 'Incorporate when you are serious about making your startup a business.  You might want to incorporate when you are working full-time on the start up, hiring employees, seeking seed or venture capital, are high-risk for a lawsuit, granting stock options, and have more than 1 founder. Check out the following decision matrix for a quantitative approach. ', 'When To Incorporate', 73, 'corporation, entity', 'when-to-incorporate', '', 0, 0, '', 18),
(490, 'secondary', 'http://www.law.cornell.edu/wex/child_custody', 9, 'Parents that have children together while married have joint ownership over their child. Courts often try to serve the best interests of the child in determining custody. This includes taking into account the child''s opinion and his or her relationship with either parent, relatives, and communities. There are a variety of factors that may influence a court''s decision, and state law can vary. However, child custody judgment is very discretionary in general, as there are many intangible factors to consider.', 'Child Custody Overview', 2, '', 'child-custody-overview', '', 0, 0, '', 6),
(44, 'primary', 'http://www.supremecourt.gov/opinions/11pdf/11-393c3a2.pdf', 35, 'National Federation of Independent Business v. Sebelius (2012). Supreme Court rules that individual mandate is constitutional under the taxation clause of the US Constitution', 'Individual Mandate is Constitutional!', 41, 'healthcare reform, supreme court, individual mandate, taxing power', 'individual-mandate-is-constitutional', '', 0, 0, '', 8),
(38, 'secondary', 'http://en.wikipedia.org/wiki/Individual_mandate', 35, 'The individual mandate is a provision in the Affordable Care Act (2010). It imposes a penalty on individuals required to have health insurance coverage. The law will come into effect in 2014 has generated substantial controversy. However, the Supreme Court has ruled that the provision is constitutional under the ''taxing power'' designated to Congress by the Constitution. ', 'Learn More About the Individual Mandate', 47, 'healthcare reform, individual mandate, taxing power, health insurance', 'learn-more-about-the-individual-mandate', '', 0, 0, '', 7),
(40, 'secondary', 'http://en.wikipedia.org/wiki/Patient_Protection_and_Affordable_Care_Act', 35, 'Summary', 'Long Summary of Patient Protection and Affordable Care Act (2010)', 63, 'healthcare reform, affordable care act, obamacare', 'long-summary-of-patient-protection-and-affordable-care-act-2010', '', 0, 0, '', 15),
(41, 'secondary', 'http://www.kff.org/healthreform/upload/8023-R.pdf', 35, 'The Affordable Care Act (2010), also known as Obamacare, contains many provisions on healthcare reform including: an individual mandate requiring most individuals to have health insurance, employer requirements, new regulations to private insurance providers, an expansion of Medicaid, and Health Benefit Exchanges. ', 'Obamacare Basics', 93, 'healthcare reform, affordable care act, obamacare, medicaid', 'obamacare-basics', '', 0, 0, '', 42),
(42, 'secondary', 'http://www.gpo.gov/fdsys/pkg/PLAW-111publ148/pdf/PLAW-111publ148.pdf', 35, 'Patient Protection and Affordable Care Act. This is commonly referred to as "Obamacare." This act seeks to increase the number of Americans that are insured and reduce the cost of health care in the nation. The Supreme Court has upheld the constitutionality of this act in the case of National Federation of Independent Business v. Sebelius.', 'The Law: Patient Protection and Affordable Care Act (2010)', 21, 'healthcare reform, affordable care act, obamacare, health insurance', 'the-law-patient-protection-and-affordable-care-act-2010', '', 0, 0, '', 15),
(43, 'secondary', 'http://www.healthcare.gov/law/timeline/index.html', 35, 'The Affordable Care Act will be implemented in phases over the next three years. One big event coming up is that in 2014 a tax will be imposed on individuals without healthcare coverage. Check out this cool timeline to see when and what changes are being implemented. ', 'Obamacare: Cool Time Line', 84, 'healthcare reform, affordable care act, obamacare, timeline, ', 'obamacare-cool-time-line', '', 0, 0, '', 22),
(487, 'primary', 'http://www.law.cornell.edu/uscode/text/26/5000A', 35, 'Read the Individual Mandate in the Affordable Care Act 26 USC Section 5000A', 'Individual Mandate Law', 23, '', 'individual-mandate-law', '', 0, 0, '', 4),
(488, 'secondary', 'http://en.wikipedia.org/wiki/Individual_mandate', 35, 'Individual Mandate - The Individual Mandate is a clause in the Patient Protection and Affordable Care Act (2010) that imposes a "tax" on persons who do not purchase health insurance. It''s purpose is to induce action (have everyone buy health insurance). ', 'What is the Individual Mandate?', 72, '', 'what-is-the-individual-mandate', '', 0, 0, '', 4),
(46, 'secondary', 'http://en.wikipedia.org/wiki/Taxing_and_Spending_Clause', 35, 'The Taxing and Spending Clause of the Constitution gives the federal government the power to lay and collect taxes. In June 2012, The Supreme Court used this clause to validate the constitutionality of the individual mandate part of Obamacare. It reasoned that the penalty imposed by the act is a tax, and therefore legitimate. ', 'Taxing Power of Congress', 48, 'healthcare reform, taxing power, constitution', 'taxing-power-of-congress', '', 0, 0, '', 16),
(47, 'primary', 'http://www.law.cornell.edu/constitution/articlei#section8', 35, 'Congress has the power to lay and collect taxes, duties, imports, and excises, to pay the debts and provide for the common defense and general welfare of the US. Congress'' powers in regards to monetary affairs of the nation are enumerated within the taxing and clause of the Constitution. ', 'Taxing and Spending in the Constitution', 66, 'healthcare reform, taxing power, constitution', 'taxing-and-spending-in-the-constitution', '', 0, 0, '', 20),
(48, 'news', 'http://www.tax.com/taxcom/features.nsf/Articles/1A096E99F74042BC8525766D005D5147?OpenDocument', 35, 'Featured Articles As if healthcare reform weren''t complex enough, a growing chorus of legal commentators is raising alarms that the tax provisions of the mammoth healthcare bills that have cleared the House and the Senate Finance Committee would violate the Constitution. It''s a debate that played out (without resolution) in 1993-1994 during the Clinton administration''s foray into healthcare reform.', 'Healthcare Reform Tax Constitutionality a Hot Topic', 44, 'healthcare reform, taxing power, constitution, debate', 'healthcare-reform-tax-constitutionality-a-hot-topic', '', 0, 0, '', 20),
(49, 'secondary', 'http://www.hrsa.gov/womensguidelines/', 35, 'The Affordable Care Act expand prevention coverage for women covering services such as HPV testing, mammograms, screenings, prenatal care, and other services. These will be covered with no cost sharing for the new health plan.', 'Obamacare: Preventative Healthcare for Women', 69, 'healthcare reform, women, obamacare', 'obamacare-preventative-healthcare-for-women', '', 0, 0, '', 22),
(50, 'news', 'http://politicalticker.blogs.cnn.com/2012/07/09/perry-texas-will-stand-against-obamacare/', 35, '(CNN) - Texas Gov. Rick Perry announced Monday the Lone Star State will not execute major parts of the Affordable Care Act, the controversial federal health care law recently upheld by the Supreme Court.', 'Perry: Texas will stand against ''Obamacare''', 81, 'healthcare reform, texas, perry, obamacare', 'perry-texas-will-stand-against-obamacare', '', 0, 0, '', 23),
(51, 'news', 'http://politicalticker.blogs.cnn.com/2012/07/09/perry-texas-will-stand-against-obamacare/', 35, '(CNN) - Texas Gov. Rick Perry announced Monday the Lone Star State will not execute major parts of the Affordable Care Act, the controversial federal health care law recently upheld by the Supreme Court.', 'Perry: Texas will stand against ''Obamacare''', 72, 'healthcare reform, texas, perry, obamacare', 'perry-texas-will-stand-against-obamacare2', '', 0, 0, '', 17),
(52, 'news', 'http://www.cnn.com/2012/07/10/politics/house-health-care/', 35, 'Washington (CNN) -- House Republicans launched an all-out assault Tuesday against President Barack Obama''s signature health care reform law, holding a series of committee hearings and other events ahead of a planned vote Wednesday on repealing the measure.', 'House debate on health care repeal: Boss Hogg or Groundhog Day? - CNN.com', 61, 'healthcare reform, texas, perry, obamacare', 'house-debate-on-health-care-repeal-boss-hogg-or-groundhog-day-cnncom', '', 0, 0, '', 15),
(53, 'news', 'http://www.washingtonpost.com/blogs/she-the-people/post/rick-perry-upholds-the-right-of-texans-to-have-the-worst-health-care-in-the-country/2012/07/10/gJQAblcTaW_blog.html', 35, 'Posted at 11:45 AM ET, 07/10/2012 DALLAS - Texas has the sovereign right to keep the very worst health care in the country, Gov. Rick Perry insisted on Monday.', 'Rick Perry upholds the right of Texans to have the worst health care in the country', 42, 'healthcare reform, texas, perry, obamacare', 'rick-perry-upholds-the-right-of-texans-to-have-the-worst-health-care-in-the-country', '', 0, 0, '', 16),
(54, 'news', 'http://www.nytimes.com/2012/07/10/us/politics/perry-says-texas-rejects-health-law-intrusions.html?_r=1', 35, 'HOUSTON - Gov. Rick Perry of Texas told federal officials on Monday that the state had no intention of expanding Medicaid or establishing a health insurance exchange, two major provisions of President Obama''s health care overhaul.', 'Perry Says Texas Rejects Health Law ''Intrusions''', 51, 'healthcare reform, texas, perry, obamacare', 'perry-says-texas-rejects-health-law-intrusions', '', 0, 0, '', 15),
(56, 'secondary', 'http://nhfreedomtomarry.org/resources/doma-explained/', 34, 'The Defense of Marriage Act (DOMA) is a federal law signed by President Bill Clinton in 1996. Section 2 of the law  defines marriage as the legal union between one man and one woman. Section 3 says that States do not have to recognize same-sex marriage laws of another State. Under the Supremacy Clause of the Constitution, States usually have to recognize and respect another State''s laws. However, DOMA says this is not necessary in the case of same-sex marriage. The law has generated controversy and at least one court has found DOMA unconstitutional. ', 'What is DOMA?', 89, 'same-sex marriage, doma, federal law, Clinton ', 'what-is-doma', '', 0, 0, '', 24),
(57, 'primary', 'http://www.article-3.com/doma-challenge-unites-gay-rights-and-states-rights-97967', 1, 'The Defense of Marriage Act, or DOMA, is a 1996 law that defines marriage as the legal union of one man and one woman. Sixteen years later, the question (as with the recent healthcare battle) is whether this federal law is constitutional or not -- more specifically, whether the federal government has the right to interfere with the workings of state governments.', 'DOMA Challenge Unites Gay Rights and States'' Rights', 57, 'doma, federal law, federalism, states'' rights', 'doma-challenge-unites-gay-rights-and-states-rights', '', 0, 0, '', 2),
(58, 'news', 'http://www.huffingtonpost.com/nigel-barber/gay-marriage-young-people_b_1659360.html', 34, 'If you want to know what the future holds, talk to young people. On social issues, young American adults today are far more liberal than their parents. The majority support gay marriage (50 percent in favor versus 36 percent against with the remainder undecided.)', 'Is the Debate on Gay Marriage Effectively Over?', 84, 'same-sex marriage, debate, liberal, support', 'is-the-debate-on-gay-marriage-effectively-over', '', 0, 0, '', 24),
(60, 'news', 'http://www.washingtonblade.com/2012/07/11/romney-stresses-same-sex-marriage-opposition-in-naacp-speech/', 34, 'Presumptive Republican presidential nominee Mitt Romney stressed during a speech at the National Association for the Advancement of Colored People''s annual convention in Houston on Wednesday that he would represent Americans of "every race, creed and sexual orientation" if elected. The former Massachusetts governor also stressed his opposition to nuptials for gays and lesbians.', 'Romney stresses same-sex marriage opposition in NAACP speech', 77, 'same-sex marriage, romney, opposition, NAACP', 'romney-stresses-same-sex-marriage-opposition-in-naacp-speech', '', 0, 0, '', 19),
(59, 'news', 'http://www.upi.com/Top_News/US/2012/07/11/Gay-marriage-referendum-on-ballot-in-Maryland/UPI-95111342038537/?spt=hts&or=4', 34, 'ANNAPOLIS, Md., July 11 (UPI) -- Maryland voters will be able to decide in November if the state''s new law legalizing same-sex marriage will stand. The state Board of Elections announced Tuesday the Maryland Marriage Alliance, which opposes the law, had gathered enough valid signatures for certification, The Baltimore Sun reported.', 'Gay marriage referendum on ballot in Maryland', 26, 'same-sex marriage, Maryland, ballot, referendum ', 'gay-marriage-referendum-on-ballot-in-maryland', '', 0, 0, '', 12),
(61, 'news', 'http://www.care2.com/causes/facebook-gay-marriage-icons-provoke-russian-ban-campaign.html', 34, 'Conservative religious groups in Russia are campaigning to ban Facebook and return the nation to its criminalization of homosexuality after Facebook created new icons so users could show they are in a same-sex marriage. The campaign was launched in Saratov and several other Russian regions - including St Petersburg, Novosibirsk and Arkhangelsk - where gay propaganda is banned by law.', 'Anti-Gay Russians Boycott Facebook', 49, 'same-sex marriage, boycott, facebook, russian', 'anti-gay-russians-boycott-facebook', '', 0, 0, '', 18),
(63, 'secondary', 'http://startuplawyer.com/incorporation/what-is-four-years-with-a-one-year-cliff', 38, 'Four Years with a One Year Cliff is the typical vesting schedule for startup founders’ stock. The one year cliff means that none of the founder''s shares will vest until after one year. After the cliff, shares gradually vest. After 4 years from issuance, all shares vest. ', 'What is Four Years With a One Year Cliff', 54, 'corporation, entity, founders, stock ', 'what-is-four-years-with-a-one-year-cliff', '', 0, 0, '', 21),
(64, 'primary', 'http://www.law.cornell.edu/uscode/text/26/83', 38, 'If stock vests overtime, each vesting milestone is a taxable event for the founder. The amount taxed is the difference between the fair market value of the stock vesting and the original purchase price of that stock. However, to avoid this potentially disastrous tax consequence, a founder should make an 83(b) which prevents this. Section 83 in Title 26, Chapter 1 of the United States Code codifies this. ', '83(b) Election: 26 USC § 83(b)', 14, 'corporation, entity, tax, founders, stock ', '83b-election-26-usc-83b', '', 0, 0, '', 30),
(65, 'secondary', 'http://startuplawyer.com/incorporation/the-83b-election-for-startup-founders', 38, 'If stock vests overtime, each vesting milestone is a taxable event for the founder. The amount taxed is the difference between the fair market value of the stock vesting and the original purchase price of that stock. However, to avoid this potentially disastrous tax consequence, a founder should make an 83(b) which prevents this. ', 'Avoid Disastrous Tax Consequences: 83(b) Election', 78, 'corporation, entity, tax, founders, stock ', 'avoid-disastrous-tax-consequences-83b-election', '', 0, 0, '', 30),
(66, 'primary', 'http://delcode.delaware.gov/title8/c001/sc03/index.shtml', 38, 'Title 8, § 131 requires every Delaware corporation  to maintain a registered agent in Delaware. The registered agent can be an individual, corporation, or another entity. ', 'DE Registered Agent Law', 7, 'corporation, entity, delaware, registered agent', 'de-registered-agent-law', '', 0, 0, '', 25),
(67, 'secondary', 'http://startuplawyer.com/incorporation/what-is-a-registered-agent', 38, 'A registered agent is someone, either a company or an individual, that a corporation appoints to receive official notices. Corporations must have a registered agent. This agent must be available during normal business hours and be located within the relevant state that they''re registered in. If you fail to update your address or other contact information as a registered agent, the secretary of state might become the registered agent. ', 'What is a Registered Agent?', 38, 'corporation, entity, registered agent, llc', 'what-is-a-registered-agent', '', 0, 0, '', 24),
(68, 'primary', 'https://delecorp.delaware.gov/tin/EntitySearch.jsp', 38, 'Search a name and entity type to see if it is available in Delaware. If it is, you will be able to register that name. ', 'Is Your Startup''s Name Available in Delaware', 77, 'corporation, llc, entity, name search, delaware', 'is-your-startups-name-available-in-delaware', '', 0, 0, '', 32),
(69, 'secondary', 'http://startuplawyer.com/incorporation/top-5-reasons-to-incorporate-in-delaware', 38, 'Delaware has flexible laws, a well established court for business issues, and relatively cheap fees. For these reasons, over 50% of U.S. publicly traded corporations and 60% of Fortune 500 companies are incorporated in Delaware. ', 'Top 5 Reasons to Incorporate in Delaware', 95, 'corporation, delaware, entity', 'top-5-reasons-to-incorporate-in-delaware', '', 0, 0, '', 56),
(70, 'document', 'http://www.docracy.com/5393/certificate-of-incorporation', 38, 'A certificate of incorporation (COI) is a legal document relating to the formation of a company. It contains a corporation''s articles of incorporation, which are the primary rules governing the management. This is an example of a COI.', 'Example Certificate of Incorporation', 21, 'corporation, entity, document, certificate of incorporation', 'example-certificate-of-incorporation', '', 0, 0, '', 24),
(71, 'document', 'http://www.docracy.com/61/restated-articles-of-incorporation', 38, 'A certificate of incorporation (COI) is a legal document relating to the formation of a company. It contains a corporation''s articles of incorporation, which are the primary rules governing the management. If the COI is amended, it must be refiled with the state. This is an example of an amended and restated COI.  ', 'Example Amended and Restated Certificate of Incorporation', 19, 'corporation, entity, document, certificate of incorporation', 'example-amended-and-restated-certificate-of-incorporation', '', 0, 0, '', 24),
(72, 'secondary', 'http://www.nolo.com/legal-encyclopedia/corporation-basics-29867.html', 38, 'Corporations provide limited liability, which means \nthat creditors of the company can''t go after personal assets of members. However, corporate owners face double taxation because corporate income is taxed separately from personal income. Furthermore, corporations must follow certain formalities to retain its corporate status. ', 'Corporation Basics', 107, 'corporation, entity, limited liability, tax', 'corporation-basics', '', 0, 0, '', 117),
(73, 'secondary', 'http://www.nolo.com/legal-encyclopedia/corporations-vs-llcs-29025.html', 38, 'A LLC might be better for small businesses that prefer a simple and flexible management structure. A corporation might be preferable for businesses that expects to have multiple investors, provide extensive fringe benefits to owners, or offer stock options to employees. ', 'Corporations vs. LLCs', 90, 'corporation, s-corporation, llc, entity', 'corporations-vs-llcs', '', 0, 0, '', 45),
(74, 'secondary', 'http://startuplawyer.com/incorporation/a-primer-on-llcs', 38, 'A limited liability company (LLC) is a type of legal entity that provides limited liability to its members. Limited liability means that creditors of the company can''t go after personal assets of any members. Members of a LLC can operate their business with a flexible management structure. This is outlined by the operating agreement made between the LLC''s members and the LCC. Furthermore, a LCC is a pass through tax entity, which means that the company''s income is "passed through" to the members, and then taxed. This avoids the problem of double taxation that is typical of corporations. ', 'Quick Overview on LLCs', 99, 'llc, entity, limited liability, tax, management', 'quick-overview-on-llcs', '', 0, 0, '', 94),
(75, 'secondary', 'http://www.nolo.com/legal-encyclopedia/llc-basics-30163.html', 38, 'A limited liability company (LLC) is a type of legal entity that provided limited liability to its members. Limited liability means that creditors of the company can''t go after personal assets of any member. Members of a LLC can operate their business with a flexible management structure. Furthermore, a LCC is a pass through tax entity, which means that the company''s income is "passed through" to the members, and then taxed. This avoids the problem of double taxation that is typical of corporations.', 'LLC Basics', 70, 'llc, entity, limited liability, tax, management', 'llc-basics', '', 0, 0, '', 29),
(76, 'secondary', 'http://www.irs.gov/businesses/small/article/0,,id=98277,00.html', 38, 'An LLC is a business structure allowed by state statute. However, the federal government does not recognize it as a separate classification for federal tax purposes. An LLC business entity must file a corporation, partnership or sole proprietorship tax return.', 'LLCs and IRS Classification', 33, 'llc, tax, entity', 'llcs-and-irs-classification', '', 0, 0, '', 24),
(77, 'secondary', 'http://www.nolo.com/legal-encyclopedia/key-advantages-llc.html', 38, 'LLCs have flexibility, limited liability, pass-through taxation, and less administrative paperwork.  Most states allow single member or multiple member LLCs that can create their own operating agreements. Like most legal entities, LLCs protect members from liability, which prevents creditors of the company from pursuing personal assets of any member. Further, a LCC avoids double taxation because all income is passed through to the members and then taxed. ', 'Key Advantages of an LLC', 95, 'llc, tax, management, entity', 'key-advantages-of-an-llc', '', 0, 0, '', 65),
(78, 'secondary', 'http://mashable.com/2010/08/02/legal-structure-startup/', 38, 'Information on LLC, S-Corporation, and C-Corporation.', 'HOW TO: Legally Structure your Startup', 74, 'llc, corporation, s-corporation, entity', 'how-to-legally-structure-your-startup', '', 0, 0, '', 31),
(79, 'secondary', 'https://www.upcounsel.com/Public/Project/4ee287a3be61490db444739b', 38, 'Investors tend to prefer a Delaware Corporation. If the corporation is not incorporated in Delaware, it is advisable to form the corporation in your home state. If you plan on primarily compensating investors through cash disbursements then you should consider forming an LLC. Note that a corporate structure is far more suited for business developers that plan to pay employees, advisors, and contractors with equity ownership. Ultimately determining what type of business to form will depend on the pay structure of the corporation and the type of inventory/assets that will be held.', 'Choose A Legal Entity For Your Business', 72, 'llc, corporation, s-corporation, entity', 'choose-a-legal-entity-for-your-business', '', 0, 0, '', 28),
(80, 'secondary', 'http://startuplawyer.com/incorporation/how-many-shares-should-a-startup-company-authorize-at-incorporation', 38, 'Although the numbers of shares to issue at incorporation is somewhat arbitrary, some people like to have a larger absolute number of stock options. This can be enticing to certain individuals.', 'How Many Shares Should a Startup Company Authorize at Incoportation?', 57, 'stock, corporation, entity', 'how-many-shares-should-a-startup-company-authorize-at-incoportation', '', 0, 0, '', 39),
(81, 'secondary', 'http://startuplawyer.com/incorporation/par-value-for-a-startup-companys-stock', 38, 'Par value is the minimum price that a corporation can issue its shares. Many stocks have a par value of $1. It is recommended that a stock''s par value should be set at $0.0001 to as low as $0.00001. Thus, when a startup issues 7,000,000 shares at $0.0001 value, the founders pay $700.', 'Par Value for a Startup Company''s Stock', 43, 'stock, corporation, entity, par value', 'par-value-for-a-startup-companys-stock', '', 0, 0, '', 27),
(82, 'secondary', 'http://startuplawyer.com/preferred-stock/what-is-preferred-stock', 2, 'Preferred stock provides certain economic rights such as liquidation preference, anti-dilution protection, and conversion rights. These stocks are commonly issued when a startup undergoes a large financing, such as a venture capital fund. Common and preferred stock differ in that common stock typically gets a lower valuation for the purposes of stock option grants or share issuances to the corporation''s employees.  ', 'What is Preferred Stock?', 71, 'stock, preferred stock, investors', 'what-is-preferred-stock', '', 0, 0, '', 18),
(83, 'secondary', 'http://www.investopedia.com/ask/answers/182.asp#axzz20AIxv9Ov', 2, 'Preferred stockholders have two advantages over common stockholders. First, they have a greater claim to a company''s assets and earnings. When dividends are distributed, preferred stockholders must be paid before common stock holders. Second, they generally receive greater dividends than common stock holders. Dividends for preferred stock are paid at regular intervals. However, this is not necessarily the case for common stock. Due to this, preferred stocks typically don''t fluctuate as often as common stock.', 'What is the difference between preferred stock and common stock?', 83, 'stock, preferred stock, common stock', 'what-is-the-difference-between-preferred-stock-and-common-stock', '', 0, 0, '', 29),
(84, 'secondary', 'http://startuplawyer.com/stock-options/what-is-an-option-pool', 2, 'An option pool is an amount of common stock that''s reserved for future issuances to employees, directors, advisers, and consultants. Unused portions of the option pool is included in the fully-diluted capitalization of the start-up, but the same unused portion isn''t included in the outstanding share count upon an acquisition or distribution. ', 'What is an Option Pool?', 45, 'stock, stock options', 'what-is-an-option-pool', '', 0, 0, '', 17),
(85, 'secondary', 'http://www.investopedia.com/university/mergers/', 2, 'A merger is a when two or more companies combine to make one new company. There are several types of mergers including horizontal (companies in direct competition), vertical (supplier and buyer companies), and a conglomeration (two companies that have no common business areas). An acquisition is when one company takes over another, destroying that original company. Mergers and acquisitions are done in order to create synergies and economies of scale, expand operations, and cut costs. Synergies and economies of scale are enhanced cost efficiencies, such as staff reductions, acquiring new technology, and having greater purchasing power.\n', 'Merger and Acquisition Introduction', 41, 'M&A', 'merger-and-acquisition-introduction', '', 0, 0, '', 12),
(86, 'secondary', 'http://business-law.lawyers.com/buying-selling-businesses/Business-Basics-of-Mergers-and-Acquisitions.html', 2, 'A merger is when two or more businesses join together to create a new business. Each business''s debts and liabilities are combined, as well as any real estate, and become part of the new business. An acquisition is when one business buys or takes over another business. The buying company remains intact in an acquisition. ', 'Business Basics of Mergers and Acquisitions', 88, 'M&A', 'business-basics-of-mergers-and-acquisitions', '', 0, 0, '', 38),
(87, 'document', 'https://www.docracy.com/3835/assignment-of-copyright', 41, 'When a employee or contractor produces work, he or she owns the property rights to that work. A assignment of a copyright agreement is used to transfer those rights to the company. The agreement  contains a description of the types of rights that an owner has and which will be transferred. This is a generic document that can be tailored.', 'Assignment of Copyright', 49, 'ip, copyright, ip assignment, document', 'assignment-of-copyright', '', 0, 0, '', 22),
(88, 'secondary', 'http://www.iplawforstartups.com/why-copyright-assignments-can-be-critical-for-startups/', 41, 'Copyright assignments are important because you want to be the owner of copyrighted worked done by independent contractors for your business. Otherwise, the contractor will be the copyright owner and you will need permission to use the work. This is especially important if you paid for the work, such as a logo or website design. ', 'Why Copyright Assignments Can Be Critical for Your Company', 81, 'ip, copyright, ip assignment', 'why-copyright-assignments-can-be-critical-for-your-company', '', 0, 0, '', 40),
(89, 'secondary', 'http://www.iplawforstartups.com/does-copyright-law-protect-apis-google-and-oracle-want-to-know/', 41, 'A recent case between Google and Oracle has sparked debate as to whether or not API''s should be protected. API''s are a set of instructions that allows software components to talk to one another. Since copyrights do not protect all written expression, API''s could be considered merely methods or operation or interface access buttons. ', 'Does Copyright Law Protect APIs? ', 65, 'ip, copyright, api, google', 'does-copyright-law-protect-apis', '', 0, 0, '', 21),
(90, 'primary', 'http://www.law.cornell.edu/uscode/text/17/chapter-1', 41, 'Title 17, Chapter 1 of the United States Code contains the laws on copyright. For example, 17 § 102 states that the following can be copyrighted: literary works, musical works, dramatic works, sound recordings, motion pictures, graphics, etc. You can explore the different sections here. ', 'Definition of Copyright', 12, 'ip, copyright, definition', 'definition-of-copyright', '', 0, 0, '', 21),
(91, 'primary', 'http://www.law.cornell.edu/uscode/text/17/107', 41, 'The fair use exception allows for the limited use of copyrighted materials without permission from the rights holder. It serves as a perfect defense to claims of copyright infringement based on a four-factor balancing test codified in 17 U.S.C. 106A.  Under this statute, the purpose of use may include, but is not limited to “criticism, comment, news reporting, teaching (including multiple copies for classroom use), scholarship, or research.”', 'Fair Use Exception', 35, 'ip, copyright, fair use', 'fair-use-exception', '', 0, 0, '', 21),
(93, 'secondary', 'http://www.uspto.gov/patents/resources/general_info_concerning_patents.jsp#heading-2', 41, 'A patent is a grant by a government that gives a creator of an invention the sole right to make, use, and sell that invention for a period of time. The grant also gives the creator the right to exclude other from making, using, offering for sale, or selling the invention. In the US, patent grants usually last for 20 years.  The following things can be patented: a process, machine, manufacture, and composition of matter.  One exception is that the use of special nuclear material or atomic energy in an atomic weapon cannot be patented. Patents must also be "new" and "useful." A "useful" item refers to an invention or process that serves a beneficial purpose and operates/performs in the way that it was designed. “New” means that the invention is not described in a printed publication or patented by others in the US or a foreign country. If neither of these are met, then a patent probably cannot be obtained.', 'What is a Patent?', 80, 'ip, patent', 'what-is-a-patent', '', 0, 0, '', 20),
(94, 'news', 'http://techcrunch.com/2012/06/21/do-patents-really-matter-to-startups-new-data-reveals-shifting-habits/', 41, 'Arguments about the value of patents have heated up over the past few years. Software patents in particular have come under increasing scrutiny from thought leaders in the start-up ecosystem, yet later-stage companies like Facebook continue to pay huge sums to acquire patent portfolios. Just how much attention are start-ups paying to patents?', 'Do Patents Really Matter To Startups?', 59, 'ip, patent, investors', 'do-patents-really-matter-to-startups', '', 0, 0, '', 24),
(95, 'secondary', 'http://blog.upcounsel.com/should-i-get-a-patent-for-startups-and-young-companies/', 41, 'There are several things to consider before applying for a patent including: whether the idea is patentable, is there already a patent out there for the idea, if the idea is better protected with a trade secret, and if it is the right time to get a patent. Timing is very important because you want to make sure that the product will not change before reaching consumers. Otherwise, a lot of money can be wasted filing the patent. ', 'Should I Get A Patent?', 79, 'ip, patent, register', 'should-i-get-a-patent', '', 0, 0, '', 20),
(96, 'news', 'http://techcrunch.com/2012/04/15/why-startups-should-pay-attention-to-skyrocketing-patent-prices/', 41, 'As large companies increasingly look to protect their revenue streams through IP risk mitigation, startups with strong patent holdings will become increasingly valuable because they provide an opportunity to remove dual potential threats to the potential acquirer''s revenue stream -- as a competitor and as a patent threat.', 'Why Startups Should Pay Attention To Skyrocketing Patent Prices', 50, 'ip, patent', 'why-startups-should-pay-attention-to-skyrocketing-patent-prices', '', 0, 0, '', 21),
(97, 'secondary', 'http://www.trademarkia.com/', 41, 'A trademark is a distinctive sign or indicator that is used to help consumers identify and distinguish products or services of a specific business. A trademark is usually a word, phrase, name, symbol, logo, design, image or combination of the above. Use trademarkia to preform a free search to see if a trademark is available.', 'Free Trademark Search Online', 94, 'ip, trademark, name search', 'free-trademark-search-online', '', 0, 0, '', 64),
(98, 'primary', 'http://www.law.cornell.edu/uscode/text/15/1052', 41, 'Title 15, Chapter 22 of the United States Code contains the laws on trademarks. You can explore the different sections here. ', 'Law on Registering a Trademark', 15, 'ip, trademark, register', 'law-on-registering-a-trademark', '', 0, 0, '', 18),
(99, 'primary', 'http://www.thomasfirm.com/trademarks.html', 41, 'A trademark is a distinctive sign or indicator that is used to help consumers identify and distinguish products or services of a specific business or person. A trademark is usually a word, phrase, name, symbol, logo, design, image or combination of the above. The main purpose of a trademark is to identify a business as the source of specific goods or services. You are not required to register a trademark and can establish rights over that mark based on legitimate use. ', 'What is a Trademark?', 87, 'ip, patent, trademark, name search', 'what-is-a-trademark', '', 0, 0, '', 38),
(100, 'primary', 'http://www.uspto.gov/trademarks/index.jsp', 41, 'Before registering a Trademark it is important to know: 1) the mark you want to register; 2) the goods and/or services in connection to the mark; and 3) whether you are filing based on existing use of the mark or intention to use the mark.  Knowing this will make your search of the existing USPTO database of registered trademarks simpler.   ', 'Trademark Basics', 47, 'ip, trademark, register', 'trademark-basics', '', 0, 0, '', 19),
(102, 'news', 'http://techcrunch.com/2012/06/01/whoshere-vs-wnm-live/', 41, 'So here''s a story that hopefully will be an eye-opener for entrepreneurs and startups, while providing a painful peek into trademark harassment and the importance of due diligence. It goes a little something like this: About two years ago, software engineer Brian Hamachek decided to build an app first on Windows Mobile (how some horror stories have been known to begin), then on Windows Phone, that enables location-based chat -- and calling.', 'Startups Vs. Startups: App Developer Gets Sued By Lightbank-Backed WhosHere', 25, 'ip, trademark, whoshere, litigation, apps', 'startups-vs-startups-app-developer-gets-sued-by-lightbank-backed-whoshere', '', 0, 0, '', 21),
(103, 'news', 'http://online.wsj.com/article/SB10001424052702304070304577395953754702524.html?KEYWORDS=startup+copyright', 41, 'Venture capitalists, angel investors and start-up lawyers these days tend to be obsessed with "intellectual property," or IP. And for good reason: In the information economy, the core assets of a new venture are likely to be talented people, the IP they create, and little else.', '5 ''IP'' Mistakes Start-ups Should Avoid', 99, 'ip, trademark, patent, copyright', '5-ip-mistakes-start-ups-should-avoid', '', 0, 0, '', 83),
(104, 'document', 'http://www.docracy.com/1/generic-nda', 40, 'A Non-disclosure Agreement is a contract between two parties that restricts the sharing of confidential materials to others. It is necessary if a company is sharing confidential information to another person, such as an employee or contractor, and wants that person not to disclose the information to others. Here is an example of a generic NDA that can be tailored to fit the needs of a business.  ', 'Generic NDA that can be Tailored', 68, 'document, nda, ip', 'generic-nda-that-can-be-tailored', '', 0, 0, '', 30),
(105, 'document', 'https://www.docracy.com/6479/short-nda-for-internet-startup', 40, 'A Non-disclosure agreement (NDA) is a contract between two parties that outlines confidential information which cannot be shared or disclosed to others. It typically protects non-public business information. NDAs are important to make sure a person does not disclose confidential information, such as trade secrets. This is a short sample NDA for an internet startup that can be tailored. ', 'Short NDA for Internet Startup', 88, 'document, nda, ip', 'short-nda-for-internet-startup', '', 0, 0, '', 50);
INSERT INTO `links` (`id`, `type`, `url`, `category`, `summary`, `title`, `votes`, `tags`, `slug`, `source`, `poster`, `date_created`, `location`, `views`) VALUES
(106, 'secondary', 'http://www.investopedia.com/terms/n/nda.asp#axzz20jirrd3v', 40, 'A Non-disclosure agreement (NDA) is an agreement between two parties that outlines confidential information that cannot be shared or disclosed to others. It is necessary if a company is sharing confidential information to another person, such as an employee, and wants that person not to disclose the information to others. ', 'What is an NDA?', 97, 'nda', 'what-is-an-nda', '', 0, 0, '', 56),
(107, 'secondary', 'http://www.ehow.com/how_4456521_write-nondisclosure-agreement.html', 40, 'A non-disclosure agreement (NDA) is a contract where the signer agrees to not disclose proprietary or confidential information about a business. The best way to write an NDA is to determine the worst case scenario and tailor the NDA to prevent that situation from occurring. It is important to define what confidential information you do not want disclosed.', 'How to Write an NDA', 63, 'nda, document', 'how-to-write-an-nda', '', 0, 0, '', 25),
(108, 'document', 'http://contracts.onecle.com/type/21.shtml', 40, 'A Non-compete is a contract used to stop a person (usually an employee) from pursuing a similar profession or trade in competition against a company. This is important because upon termination the employee might begin working for a competitor or start a business that is in direct competition with the original company, and use knowledge gained from that original company to his or her advantage. Here are examples of non-compete agreements that can be tailored to fit your needs.     ', 'Example Non-compete Agreements', 35, 'document, non-compete', 'example-non-compete-agreements', '', 0, 0, '', 16),
(109, 'secondary', 'http://www.ehow.com/how_4486945_write-noncompete-agreement.html', 40, 'A Non-compete is a contract used to stop a person (usually an employee) from pursuing a similar profession or trade in competition against a company. In writing a Non-compete Agreement it is important to define what the employee or contractor can or cannot do. It is also a good idea to include a non-consulting clause and a penalty clause in case the agreement is broken. Check out examples to help you write your non-compete. ', 'How to Write a Non-compete Agreement', 48, 'non-compete', 'how-to-write-a-non-compete-agreement', '', 0, 0, '', 11),
(110, 'document', 'http://www.docracy.com/48/technology-assignment-agreement', 41, 'A Technology Assignment Agreement or IP Assignment Agreement transfers IP rights to your company with respect to work produced by an employee or contractor. Otherwise, the employee or contractor will be the copyright holder and you will need permission to use the work. Therefore, it''s important to make sure you have these documents. Here is an example of a Technology Assignment Agreement. ', 'Technology Assignment Agreement', 21, 'ip, document, ip assignment', 'technology-assignment-agreement', '', 0, 0, '', 24),
(111, 'document', 'http://www.docracy.com/6480/short-ip-assignment-agreement-for-internet-startup', 41, 'When an employee or contractor produces work, he or she holds the intellectual property rights to the work. However, an IP Agreement transfers those rights to the company, thereby allowing the company to use the work in whichever way it pleases. Here is an example of an IP Assignment Agreement that can be tailored.', 'IP Assignment Agreement', 78, 'ip, document, ip assignment', 'ip-assignment-agreement', '', 0, 0, '', 32),
(112, 'secondary', 'http://www.baercrossey.com/892/startup-killer', 40, 'Investors typically dislike to invest in a company that doesn''t have exclusive ownership of its IP. For this reason, it is important to have IP Assignment and Non-disclosure Agreements (NDA) from your employees and contractors. An IP Assignment Agreement transfers to the company IP rights to work product created by the employee or contractor. A NDA is used to make sure that the employee or contractor does not disclose confidential information to third parties about any non-public business information. Both are important to protect a company''s ip rights. ', 'Startup Killer: Not Getting Confidentiality/IP Assignment Agreements From Employees', 90, 'ip, ip assignment, nda', 'startup-killer-not-getting-confidentialityip-assignment-agreements-from-employees', '', 0, 0, '', 45),
(113, 'document', 'http://www.docracy.com/42/docracy-terms-of-service-1-', 40, 'Terms of Service are rules which a user must agree to abide by in order to use a service. Commonly, Terms of Service will have rules in which visitors have to follow. Different types of websites will have different kinds of Terms of Service. This is an example of Terms of Service for Docracy.', 'Terms of Service for Your Website', 47, 'document, terms of service, website', 'terms-of-service-for-your-website', '', 0, 0, '', 21),
(114, 'secondary', 'http://en.wikipedia.org/wiki/Terms_of_service', 2, 'Terms of Use are rules that a user must agree to follow in order to use a service. A disclaimer is often found within a Terms of Use. Websites that require a high level of community trust or handle transactions involving money tend to have carefully designed terms of service. Most organization will restrict a user''s access to the service if that person violates the Terms of Use.', 'Terms of Service Overview', 60, 'terms of service', 'terms-of-service-overview', '', 0, 0, '', 15),
(115, 'secondary', 'http://curiosity.discovery.com/question/terms-service-agreement-important', 2, 'Terms of Use lay out the rules people should know to navigate your website. It helps protect the website from legal claims. The terms should inform visitors that information can change without notice and as an owner of the website you set the rules.  ', 'Why is a Terms of Service Important', 29, 'terms of service', 'why-is-a-terms-of-service-important', '', 0, 0, '', 14),
(116, 'document', 'http://www.docracy.com/25/wordpress-privacy-policy-', 40, 'A privacy policy is used to inform visitors what type of information will be collected from them. This legal document discloses some or all of the ways a party gathers, uses, discloses, and manages a customer or client''s data. This is a sample of WordPress.org''s privacy policy and contains the common issues that privacy policies should contain.  ', 'Privacy Policy', 36, 'privacy policy, document, website', 'privacy-policy', '', 0, 0, '', 20),
(117, 'secondary', 'http://www.privacytrust.org/guidance/privacy_policy.html', 2, 'A privacy policy is one of the most important documents on any website because it details your company''s views and procedures on the information collected from visitors. Although a privacy policy is technically a legal document, great effort should be made to craft a document that is both accurate and easy to understand. It''s probably not a good idea to have obscure or hidden clauses.', 'Why is a  Privacy Policy Important?', 33, 'privacy policy', 'why-is-a-privacy-policy-important', '', 0, 0, '', 15),
(118, 'secondary', 'http://www.markwelchblog.com/2010/11/10/why-is-a-privacy-policy-important/', 2, 'Websites that do not have a privacy policy are seen as less professional and not as trustworthy. Consumers constantly evaluate the types of websites they visit. A reputable or trustworthy website will often have a "privacy policy," "about us," and "contact us" section.  ', 'Why Is a Privacy Policy Important?', 56, 'privacy policy, website', 'why-is-a-privacy-policy-important2', '', 0, 0, '', 20),
(119, 'secondary', 'http://blog.upcounsel.com/hiring-interns/', 33, 'There are federal requirements that must be followed in order to legally use unpaid interns. This includes: 1) the internship is similar to training given in an educational environment; 2) the internship is for the benefit of the intern; 3) the intern does not replace regular employees and works under close supervision; 4) the employer does not receive any immediate advantage from the intern and is occasionally slowed down by the intern; 5) the intern is not entitled to a job at the end of the internship; and 6) the employer and intern understand that the intern is not entitled to wages. California has additional requirements.', 'The Basics Of Hiring Interns For Your Startup', 94, 'interns, employment', 'the-basics-of-hiring-interns-for-your-startup', '', 0, 0, '', 54),
(120, 'secondary', 'http://www.dol.gov/whd/regs/compliance/whdfs71.htm', 33, 'Six criteria must be met in order to legally hire an unpaid intern. To determine whether or not the internship is legal depends on the type of program offered to the intern. Ultimately, as long as the program benefits the intern it will conform the the Fair Labor Act. ', 'Before You Hire an Intern, Make Sure you Meet the Following Conditions', 52, 'interns, employment', 'before-you-hire-an-intern-make-sure-you-meet-the-following-conditions', '', 0, 0, '', 18),
(121, 'news', 'http://techcrunch.com/2012/06/10/startup-act-2-0-great-for-foreign-graduate-students-but-not-foreign-tech-entrepreneurs/', 36, 'When it comes to U.S. visas, company founders are among the most discriminated folks. Unlike employees, they cannot get a work visa (called H1-B) – or any other long-term visa.', 'Startup Act 2.0: Great For Foreign Graduate Students, But Not Foreign Tech Entrepreneurs', 20, 'immigration', 'startup-act-20-great-for-foreign-graduate-students-but-not-foreign-tech-entrepreneurs', '', 0, 0, '', 13),
(122, 'news', 'http://techcrunch.com/2012/03/16/crowdfundingstartups/', 2, 'Last week, the U.S. House of Representatives passed the JOBS Act, a bipartisan bill aimed at supporting small businesses by making it easier for them to access capital. A key feature of the bill enables crowdfunding, the process by which small companies raise growth capital from a large number of individual investors.', 'How The JOBS Act Could Change Startup Investing Forever', 44, 'jobs act, investors', 'how-the-jobs-act-could-change-startup-investing-forever', '', 0, 0, '', 17),
(123, 'news', 'http://www.forbes.com/sites/theyec/2012/07/13/10-common-pitfalls-of-new-entrepreneurs-and-how-to-avoid-them/', 40, 'Starting a business is pretty tricky for the uninitiated, and what you don''t know can be disastrous. Most small business fail within the first five years, but that''s often because of easily avoidable mistakes. If you''re planning to start a new business, especially one that''s service-based, here are some pointers to help you avoid some of the most common startup pitfalls: Use a contract.', '10 Common Pitfalls of New Entrepreneurs - and How to Avoid Them', 94, 'employment, tax, document', '10-common-pitfalls-of-new-entrepreneurs-and-how-to-avoid-them', '', 0, 0, '', 74),
(124, 'secondary', 'https://www.upcounsel.com/Public/Overview/4f6a8156be61497c3c59c585', 40, 'When you add an advisor to your company, it is important to follow several steps: execute a mutual non-disclosure agreement, decide how much equity you will give the advisor, execute an advisory agreement, decide whether to compensate the advisor with options or restricted stock. You can negotiate the exact terms between you and the advisor. ', 'How to Add an Advisor', 64, 'advisor, nda, document', 'how-to-add-an-advisor', '', 0, 0, '', 32),
(125, 'primary', 'http://www.law.cornell.edu/constitution/articlei#section8', 36, 'The federal government has reserved the right to regulate immigration, although it is not explicitly mentioned in the Constitution. The power is an extension of its explicit right to establish the rules of naturalization. Naturalization Clause: Article I Â§ 8 Clause 4.    ', 'The Federal Government Regulates Immigration: Not States', 33, 'immigration, constitution', 'the-federal-government-regulates-immigration-not-states', '', 0, 0, '', 17),
(126, 'primary', 'http://supreme.justia.com/cases/federal/us/426/88/case.html', 36, 'In Hampton v. Mow Sun Wong, the Supreme Court found that the power of the federal government to establish a uniform Rule of Naturalization implies the federal power to regulate immigration. This ruling granted greater leeway for the federal government than what the states had.', 'Case That Affirmed the Federal Government''s Right to Regulate Immigration ', 12, 'immigration, federal', 'case-that-affirmed-the-federal-governments-right-to-regulate-immigration', '', 0, 0, '', 21),
(127, 'primary', 'http://www.dhs.gov/xlibrary/assets/s1-exercising-prosecutorial-discretion-individuals-who-came-to-us-as-children.pdf', 36, 'The Secretary of Homeland Security, Janet Napolitano, wrote a memo outlining the department''s new policy to not prosecute illegal aliens who were brought into this county as children. In order to qualify, the person must have 1) entered the US under the age of sixteen, 2) has continuously lived in the US for at least five years, 3) is currently in school, graduated high school, or obtained a general education development certificate, 4) has not been convicted of serious or multiple crimes, and 5) is not above the age of thirty. The department is allowed to do this because it has discretion in prosecuting immigrants.', 'Obama: Illegal Children Will Not be Deported', 83, 'immigration, obama', 'obama-illegal-children-will-not-be-deported', '', 0, 0, '', 25),
(128, 'secondary', 'http://dreamact.info/', 36, 'The DREAM Act (Development, Relief, and Education for Alien Minors, is a bill that provides conditional permanent residency to certain illegal individuals. The individuals must have arrived in the US as minors, have lived in the US continuously for five years, and graduate from high school. The bill was first introduced in 2001 and has yet to pass.', 'What is the DREAM Act?', 71, 'immigration, dream act', 'what-is-the-dream-act', '', 0, 0, '', 18),
(129, 'secondary', 'http://www.youtube.com/watch?v=MXnqhG2h9QA', 36, 'Around 20% of illegal immigrants are under the age of 18. The DREAM Act seeks to provide young immigrants U.S. residency to those that 1. entered the country before the age of 16; 2. have an American high school diploma or GED; 3. are 35 years or younger; 4. have no criminal record. Those that are eligible are allowed to complete a 2-year degree or serve for 2 years in the military. This program will result in an annual fiscal contribution of $9,200 per person.  ', 'A Dream Act Infographic', 60, 'immigration, dream act', 'a-dream-act-infographic', '', 0, 0, '', 25),
(130, 'photo', 'http://www.stokelybaksh.com/wp-content/uploads/2011/08/state_legislations_CL.jpg', 36, 'In the past couple years, several states, including Arizona and Alabama, have taken anti-illegal immigration measures. Such bills have been challenged under constitutional and civil rights protections. In 2012, the Supreme Court struck down several provisions of Arizona''s controversial immigration law because they violated the Supremacy Clause of the Constitution. However, the status of illegal immigrants remain uncertain under the Obama administration. ', 'Immigration Reform', 95, 'immigration, states', 'immigration-reform', '', 0, 0, '', 0),
(131, 'primary', 'http://www.azdatapages.com/sb1070.html', 36, 'SB 1070 was a legislative act enacted by the state of Arizona. This act was considered one of the broadest and strictest anti-immigration acts in recent U.S. History. The law required all aliens over the age of 14 to register with the U.S. government and be in possession of these registration documents at all times. The legislation is said to encourage racial profiling due to the broad and arbitrary powers that the state police force are given. The Supreme Court later struck down three of the main provisions in the act in the case, Arizona v. United States.', 'Arizona''s Controversial Immigration Law', 45, 'immigration, arizona', 'arizonas-controversial-immigration-law', '', 0, 0, '', 17),
(132, 'secondary', 'http://en.wikipedia.org/wiki/Arizona_SB_1070', 36, 'Arizona SB 1070 is an anti-illegal immigration bill signed into law in 2012. It has received national attention for its strict regulations and encouragement of racial profiling. Some of its provisions include: an alien must carry required documents at all time and the police can investigate a person''s immigration status during a legal stop. In June 2012, the Supreme Court struck down some of the bill''s provisions as unconstitutional.   ', 'Overview of Arizona''s Controversial Immigration Law', 85, 'immigration, arizona', 'overview-of-arizonas-controversial-immigration-law', '', 0, 0, '', 22),
(133, 'primary', 'http://www.supremecourt.gov/opinions/11pdf/11-182b5e1.pdf', 36, 'The Supreme Court ruled that it was unconstitutional for Arizona to pass laws that: 1. required legal immigrants to carry registration documents at all times; 2. have state police arrest any individual on suspicion of being an illegal immigrant; 3. disallow an illegal immigrant to search for a job (or to hold one) in the state. The Supreme Court, however, upheld the policy that allowed Arizona state police to investigate the immigration status of individuals that were stopped, detained, or arrested as long as there was reasonable suspicion that the individual was in America illegally. ', 'Arizona''s Immigration Law Ruled Unconstitutional', 64, 'immigration, arizona, supreme court, unconstitutional', 'arizonas-immigration-law-ruled-unconstitutional', '', 0, 0, '', 17),
(134, 'secondary', 'http://en.wikipedia.org/wiki/Arizona_v._United_States', 36, 'In Arizona v. United States (2012), the Supreme Court ruled that some provisions of Arizona''s anti-illegal immigration (Arizona SB 1070) bill were unconstitutional under the theory of federal preemption. The federal government has the authority to regulate immigration. However, Arizona passed regulations that conflicted with federal law. Thus, those regulations were found to be invalid. The three provisions struck down were: 1) requiring immigrants to carry legal documents at all times; 2) allowing police to arrest any person for suspicion of being an illegal immigrant; and 3) making it a crime for an illegal immigrant to search for a job. ', 'The Supreme Court Case That Invalided Arizona''s Immigration Law', 78, 'immigration, arizona, supreme court, unconstitutional', 'the-supreme-court-case-that-invalided-arizonas-immigration-law', '', 0, 0, '', 20),
(135, 'primary', 'http://latindispatch.com/2011/06/09/text-of-alabama-immigration-law-hb-56/', 36, 'Alabama recently enacted a statute that requires public schools to check the immigration status of students, criminalize citizens that give rides to illegal immigrants, requires employers to use E-Verify to check potential employee''s status, and instruct police to check the immigration status of anyone they stop if that person is suspected of being an undocumented immigrant. ', 'Alabama''s Controversial Immigration Law', 43, 'immigration, alabama', 'alabamas-controversial-immigration-law', '', 0, 0, '', 22),
(136, 'secondary', 'http://en.wikipedia.org/wiki/Alabama_HB_56', 36, 'Alabama HB 56 is an anti-immigration bill, signed into law on June 2011. Some of its provisions include: allowing officers to attempt to investigate a person''s immigration status midst any legal stop, requiring public schools to ascertain the immigration status of students, and prohibiting landlords from renting property to illegal aliens. These regulations are stricter than Arizona''s anti-immigration bill, which received national attention in summer 2012. ', 'Overview of Alabama''s Controversial Immigration Law', 95, 'immigration, alabama', 'overview-of-alabamas-controversial-immigration-law', '', 0, 0, '', 36),
(137, 'primary', 'http://caselaw.lp.findlaw.com/data/constitution/article06/', 36, 'Federal laws may invalidate conflicting State laws. This is laid down in the Supremacy Clause of the Constitution and is called federal premption. In the case of immigration laws...', 'Supremacy Clause and Immigration', 41, 'immigration, supremacy clause, constitution', 'supremacy-clause-and-immigration', '', 0, 0, '', 18),
(138, 'secondary', 'http://www.immigrationworksusa.org/index.php?p=192', 36, 'Federal preemption is a legal term used to describe a situation where a federal law invalidates a State law. This  usually happens when there is a State law that conflicts with a federal law. Federal preemption is derived from the Supremacy Clause in the Constitution, which declares that federal law is the supreme law of the land. ', 'Federal Preemption Invalidates State Immigration Laws', 87, 'immigration, federal preemption', 'federal-preemption-invalidates-state-immigration-laws', '', 0, 0, '', 25),
(139, 'secondary', 'http://legal-dictionary.thefreedictionary.com/Supremacy+Clause', 36, 'The Supremacy Clause ensures that the laws and articles of the U.S. Constitution is the supreme law of the land. Chief Justice John Marshall discussed the concept of federal supremacy in the landmark case McCulloch v. Maryland. Essentially, though state legislatures are free to enact and enforce laws, each state much be aware and conscious of federal laws and potential conflicts that may occur.', 'What is the Supremacy Clause?', 39, 'immigration, supremacy clause', 'what-is-the-supremacy-clause', '', 0, 0, '', 16),
(140, 'photo', 'http://3.bp.blogspot.com/_N_aDa0MnjQE/S9jnIqCWQwI/AAAAAAAAAGI/Z7wZ_LLlB2c/s1600/transparency-1.jpg', 35, 'In 2010, Obama signed into law the Patient Protection and Affordable Care Act, also known as Obamacare. The law is meant to provide incentives for people to secure health benefits. One controversial section of the bill is the individual mandate, which imposes a penalty on persons who do not purchase health insurance. However, the Supreme Court has ruled that the mandate is constitutional under Congress''s designated taxing power. ', 'Healthcare Reform', 101, 'healthcare reform, obamacare', 'healthcare-reform', '', 0, 0, '', 3),
(142, 'photo', 'http://images.onlineuniversity.net.s3.amazonaws.com/new-student-loan-deal.jpg', 1, 'In 2010, Obama signed into law the Health Care and Education Reconciliation Act of 2010, which included a number of loan reforms for students. Its provisions included: an increase in Pell Grant awards, loan forgiveness after 20 years (previously 25), a cap on repayments at 10% (previously 15%), and increasing funding.', 'Education Reform', 73, 'education, student loans', 'education-reform', '', 0, 0, '', 0),
(143, 'photo', 'http://sociable.co/wp-content/uploads/2011/12/SOPA-business-infographic-488x2761.png', 37, 'The Stop Online Piracy Act (SOPA) is a bill that expands the rights of law enforcement to fight illegal sharing of copyrighted materials. One big concern over this legislation centers over the possibility that it can cause serious complications instead of solutions. The government could essentially have the power to censor larges portions of popular public websites.', 'SOPA', 88, 'sopa, business, innovation', 'sopa', '', 0, 0, '', 5),
(292, 'news', 'http://www.buzzfeed.com/chrisgeidner/federal-trial-court-in-connecticut-strikes-down-do', 1, 'U.S. District Court Judge Vanessa L. Bryant today held in a federal case in Connecticut that Section 3 of the Defense of Marriage Act - the federal definition of marriage - is unconstitutional. Bryant, in a case brought by Gay & Lesbian Advocates & Defenders, follows several other federal judges over the past two years to have reached the same conclusion.', 'Federal Trial Court In Connecticut Strikes Down DOMA''s Marriage Definition', 100, 'doma, unconstitutional', 'federal-trial-court-in-connecticut-strikes-down-domas-marriage-definition', '', 0, 0, '', 30),
(145, 'news', 'http://www.huffingtonpost.com/2012/06/28/obamacare-women-supreme-court-contraception-pregnancy_n_1634480.html', 35, 'WASHINGTON -- Although the requirement that contraception be covered by employers'' health care plans was not an issue addressed by the Supreme Court on Thursday, the measure has become one of the most controversial aspects of the Affordable Care Act.', 'Obamacare Ruling Is ''Major Victory'' For Women', 75, 'healthcare reform, women, obamacare', 'obamacare-ruling-is-major-victory-for-women', '', 0, 0, '', 17),
(146, 'secondary', 'http://inventors.about.com/od/trademarks/a/register.htm', 41, 'You are not required to register a trademark and can establish rights over that mark based on legitimate use. However, the benefits of having a registered trademark include: constructive notice nationwide of the trademark owner''s claim, additional evidence of the ownership of the trademark, jurisdiction of federal courts may be invoked, and registration can be used as a basis for obtaining registration in other countries.', 'Why You Should Register a Trademark', 83, 'ip, trademark, register', 'why-you-should-register-a-trademark', '', 0, 0, '', 30),
(147, 'secondary', 'https://www.google.com/?tbm=pts&hl=en', 41, 'With Google Patents, you can search the full text of the U.S. patent corpus. The search engine covers the entire collection of issued patents and millions of patent application made available by the USPTO, from patents issued in the 1790s through the present.', 'Search for Patent', 75, 'ip, patent, name search', 'search-for-patent', '', 0, 0, '', 21),
(148, 'news', 'http://walkercorporatelaw.com/entrepreneurship/issuing-stock-options-ten-tips-for-entrepreneurs/', 2, 'Stock options should be issued ASAP. This is so that employees can profit from any increase in revenue. Moreover, a company should establish a realistic vesting schedule. This will incentivize the employees to remain with the company to help grow the business.', 'Issuing Stock Options: Ten Tips For Entrepreneurs', 38, 'tax, stock, stock options, employment', 'issuing-stock-options-ten-tips-for-entrepreneurs', '', 0, 0, '', 17),
(149, 'news', 'http://money.msn.com/auto-insurance/7-ways-to-talk-your-way-out-of-a-ticket', 3, 'Cities and counties are in huge budget deficits. They need more revenue to make up for lavish spendings and high cost. Reasonable or not, there is no excuses any more. It used to be about education, warnings, and reasonable fine.', '7 ways to talk your way out of a ticket', 41, 'traffic', '7-ways-to-talk-your-way-out-of-a-ticket', 'Msn', 0, 1343079037, '', 28),
(150, 'news', 'http://www.executivetravelmagazine.com/articles/best-and-worst-states-for-traffic-tickets', 3, 'Where are you most (and least) likely to get traffic tickets? Don''t put that pedal down until you read this list. Last spring, cops clocked a car on a rural road outside Charlotte, N.C., doing 128 mph in a 45 mph zone. The offender was NASCAR racer Kyle Busch, who apparently forgot he wasn''t at work.', 'Best & Worst States for Traffic Tickets', 54, 'traffic', 'best-worst-states-for-traffic-tickets', 'Executivetravelmagazine', 0, 1343079644, '', 31),
(151, 'Secondary', 'http://www.canorml.org/history.html', 5, 'NULL', 'Historical Information | California NORML', 0, '', 'historical-information-california-norml', 'Canorml', 0, 1343084988, '', 0),
(152, 'Secondary', 'http://www.canorml.org/camp.html', 5, 'CAMP Eradicates 4.3 Million Plants - More Than State''s Annual Consumption October 30, 2010 - California''s CAMP (Campaign Against Marijuana Planting) marijuana eradication reported 4,320,314 plant seizures in 2010, slightly less than last year''s all-time record of 4,463,917.Read more.', 'CAMP (Campaign Against Marijuana Planting) | California NORML', 0, '', 'camp-campaign-against-marijuana-planting-california-norml', 'Canorml', 0, 1343084988, '', 0),
(153, 'Secondary', 'http://www.canorml.org/costs/federal_medical_marijuana_prisoners_and_cases', 5, 'LAST UPDATED: 7/17/2012 Pending Cases in California and Elsewhere In Prison Sentenced or Case Terminated Died Pending Prosecution Raided by DEA (partial list) Current California Defendants and Prisoners: * = currently incarcerated Pending Cases in California and Elsewhere 7/17/2012 - Federal agents raided a medical marijuana dispensary in unincorporated Lake Elsinore, for the second time in three months.', 'Federal Medical Marijuana Prisoners and Cases | California NORML', 0, '', 'federal-medical-marijuana-prisoners-and-cases-california-norml', 'Canorml', 0, 1343084988, '', 0),
(154, 'Secondary', 'http://canorml.org/background/CA_legalization2.html', 5, 'Marijuana Legalization Could Yield California Taxpayers Over $1.2 Billion Per YearAdditional Spinoff Benefits Up To $12 -$18 Billion While California struggles to address the state''s swelling budget deficit, the legalization of marijuana looms as an attractive way of raising revenue for the state.', 'Benefits of Marijuana Legalization in California | California NORML', 0, '', 'benefits-of-marijuana-legalization-in-california-california-norml', 'Canorml', 0, 1343084988, '', 0),
(155, 'Secondary', 'http://www.canorml.org/arrestsprisoners.html', 5, 'Marijuana Arrests Decline in California in 2010 September 14, 2011 - California reported a moderate decline in marijuana arrests in 2010, according to the latest figures from the Criminal Justice Statistics Center.', 'California Arrest and Prisoner Data | California NORML', 0, '', 'california-arrest-and-prisoner-data-california-norml', 'Canorml', 0, 1343084988, '', 0),
(156, 'Secondary', 'http://www.canorml.org/costs.html', 5, 'Marijuana prohibition is costly, not only in the amount spent on law enforcement and prisons, but also in the lost revenue from taxing a legally regulated market, as well as the loss of jobs, payroll taxes, etc.', 'Costs of Prohibition | California NORML', 0, '', 'costs-of-prohibition-california-norml', 'Canorml', 0, 1343084988, '', 0),
(157, 'Secondary', 'http://www.canorml.org/paincomplaints.html', 5, 'UPDATE: July 19, 2010 - The Veterans Health Administration has made it known that it will allow use of medical marijuana by VA patients on opiod therapy. This is good news for the many chronic pain patients who have been told that they must give up', 'Pain Doctors Discriminate Against Medical Marijuana Patients | California NORML', 0, '', 'pain-doctors-discriminate-against-medical-marijuana-patients-california-norml', 'Canorml', 0, 1343084988, '', 0),
(158, 'Secondary', 'http://www.canorml.org/health/student.html', 5, 'CALIFORNIA SURVEY SHOWS STUDENT MARIJUANA USE STABLE, PRESCRIPTION DRUG USE HIGH Jan 30, 2009 -- The newly released biennial Attorney General''s Survey of Student Drug Use in California shows that marijuana use among 7th. 9th and 11th graders remained stable during 2007-8, but reports an "alarming rate" of prescription drug abuse.', 'Student/Youth Usage Studies | California NORML', 0, '', 'studentyouth-usage-studies-california-norml', 'Canorml', 0, 1343084988, '', 0),
(159, 'Secondary', 'http://canorml.org/news/ringtest.html', 5, 'Cal NORML Release - Sep 21, 2011 California NORML and Project CBD release the results of the first "Ring Test" to assess the accuracy of analytical laboratories Mixed findings show strengths and problems among analytic testing services In the winter of 2010/11, California NORML and Project CBD initiated a "Ring Test" to assess the accuracy of analytical cannabis testing laboratories that have recently emerged to serve medical marijuana collectives, breeders, growers and patients.', 'How Accurate Is Cannabis Potency Testing? | California NORML', 0, '', 'how-accurate-is-cannabis-potency-testing-california-norml', 'Canorml', 0, 1343084988, '', 0),
(160, 'Secondary', 'http://canorml.org/news/cbcsurvey2011.html', 5, 'Cal. NORML Estimates 750,000 - 1,125,000 Medical Marijuana Patients in California Retail Medical Market is $1.5 - $4.5 Billion Per Year May 31st, 2011. California NORML estimates that there are now over 750,000 medical marijuana users in the state, or 2% of the population, according to the most recent data.', 'Medical Marijuana Patient Population in CA | California NORML', 0, '', 'medical-marijuana-patient-population-in-ca-california-norml', 'Canorml', 0, 1343084988, '', 0),
(161, 'Secondary', 'http://www.canorml.org/bizorgs.html', 5, 'Accounting and Business Development Liana Limited - Experienced support in business development for the medical cannabis industry. Accounting, human resources, permit applications, business plans, public relations and more. Consultants MarijuanaTech.com (213) 435-7794 Technology Support for Medical Marijuana Collectives.', 'Business and NonProfit Listings | California NORML', 0, '', 'business-and-nonprofit-listings-california-norml', 'Canorml', 0, 1343084988, '', 0),
(162, 'Secondary', 'http://www.canorml.org/medical-marijuana/local-growing-limits-in-California', 5, 'UPDATED 7/20/2012 2/20/2012 - California NORML has filed an appeal to a judge''s ruling in a lawsuit against Tehama county''s ordinance, a test case for the rest of the state. Read more. Explanation of SB420 Cultivation Guidelines Localities NOT listed below adhere to CA state default guidelines, which are: 6 mature OR 12 immature plants and 8 oz.', 'Local Medical Marijuana Cultivation & Possession Guidelines in California | California NORML', 0, '', 'local-medical-marijuana-cultivation-possession-guidelines-in-california-california-norml', 'Canorml', 0, 1343084988, '', 0),
(163, 'Secondary', 'http://www.canorml.org/prop/listings.html', 5, 'The Original The Most Respected The Most Cost-Effective California NORML maintains a weblist of dispensaries and a delivery services page. We are the originator of these lists, the most respected and cost-effective on the web. Three million visitors come to CalNORML.org yearly for information they can trust about medical marijuana, and our collective listings get over 500,000 page views yearly.', 'How to List on CaNORML''s Collective and Delivery Service Pages | California NORML', 0, '', 'how-to-list-on-canormls-collective-and-delivery-service-pages-california-norml', 'Canorml', 0, 1343084988, '', 0),
(164, 'Secondary', 'http://listings.canorml.org/medical-marijuana-doctors-in-California/list.lasso', 5, 'The licensed California physicians searchable on this page are available for consultation as medical cannabis specialists. Patients should have a documented medical record of diagnosis and treatment or a physician referral. Medical marijuana patients should begin by consulting with their own physicians about medical use of cannabis.', 'NULL', 0, '', 'null', 'Canorml', 0, 1343084988, '', 0),
(165, 'Secondary', 'http://www.legislature.ca.gov/legislators_and_districts/legislators/your_legislator.html', 5, 'The portal site for the California State Legislature--State Senate and Assembly. Look up your state representative and search our legislation database.', 'California State Legislature-Your Legislator', 0, '', 'california-state-legislature-your-legislator', 'Ca', 0, 1343084988, '', 0),
(166, 'Secondary', 'http://canorml.org/medical-marijuana/California-collectives-and-dispensaries-guide', 5, 'The Collectives on these pages are California NORML supporters. Cannabis Delivery Services are listed here. Northern California North Coast Arcata, Clearlake, Corte Madera, Cotati, Fort Bragg, Guerneville, Kelseyville, Lower Lake, Lucerne, Middletown, Napa, Santa Rosa, Sebastopol, Ukiah Central Valley to Redding Anderson, Chico, Colfax, Dunsmuir, Marysville, Shasta, Redding, Rocklin, San Andreas, Stockton, Tahoe, Tracy, Yuba Sacramento Area Auburn, Orangevale, Sacramento, Shingle Springs San Francisco (S.F.)', 'Medical Marijuana Collectives and Dispensary Guide to California | California NORML', 0, '', 'medical-marijuana-collectives-and-dispensary-guide-to-california-california-norml', 'Canorml', 0, 1343084988, '', 0),
(167, 'Secondary', 'http://www.canorml.org/background/CA_legalization2.html', 5, 'Marijuana Legalization Could Yield California Taxpayers Over $1.2 Billion Per YearAdditional Spinoff Benefits Up To $12 -$18 Billion While California struggles to address the state''s swelling budget deficit, the legalization of marijuana looms as an attractive way of raising revenue for the state.', 'Benefits of Marijuana Legalization in California | California NORML', 0, '', 'benefits-of-marijuana-legalization-in-california-california-norml2', 'Canorml', 0, 1343084988, '', 0),
(168, 'Secondary', 'https://www.wepay.com/stores/982287', 5, 'California NORML is a non-profit, membership organization dedicated to reforming California''s marijuana laws. Established in 1972, our mission is to establish the right of adults to use cannabis legally. We are the only state organization devoted specifically to marijuana reform. We publish a newsletter, lobby lawmakers, sponsor events, offer legal, educational, and consumer health advice, and sponsor scientific research.', 'CalNORML Store', 0, '', 'calnorml-store', 'Wepay', 0, 1343084988, '', 0),
(169, 'Secondary', 'http://www.canorml.org/staff.html', 5, 'CalNORML Director Dale Gieringer, Ph.D. dale@canorml.org Dale Gieringer has been the state coordinator of California NORML (National Organization for the Reform of Marijuana Laws) since 1987. He is also Vice-Chairman of the national NORML board of directors, director of the California Drug Policy Forum (DPFCA) and treasurer of the Oakland Civil Liberties Alliance (OCLA).', 'Our Staff | California NORML', 0, '', 'our-staff-california-norml', 'Canorml', 0, 1343084988, '', 0),
(170, 'Secondary', 'http://norml.org/laws/item/new-york-penalties-2?category_id=876', 5, 'Marijuana and its synthetic "equivalents" are considered Schedule I hallucinogenic substances under New York Public Health Law. Synthetic equivalents include resinous extracts and derivatives with similar chemical properties. See: New York Pub. Health §3306(d)(13) New York Pub. Health §3306(d)(21) Possession for Personal Use For a first offender, possession of up to 25 grams of marijuana is punishable by a fine of $100.', 'New York Penalties', 0, '', 'new-york-penalties', 'Norml', 0, 1343086139, '', 0),
(171, 'Primary', 'http://norml.org/laws/item/pennsylvania-penalties-2?category_id=882', 5, 'Marijuana is a Schedule I drug. See: Pennsylvania Consolidated Statutes Possession Possession of 30g or less is a misdemeanor punishable by 30 days in jail and a $500 fine. Possession of more than 30g is a misdemeanor with a maximum penalty of one year in jail and a $5,000 fine.', 'Pennsylvania Penalties', 0, '', 'pennsylvania-penalties', 'Norml', 0, 1343086169, '', 0),
(172, 'Secondary', 'http://norml.org/laws/item/texas-penalties-2?category_id=888', 5, 'Possession Possession of 2 ounces or less of marijuana is a Class B misdemeanor, punishable by up to 180 days imprisonment and a fine not to exceed $2,000. Possession of between 2 and 4 ounces of marijuana is a Class A misdemeanor, punishable by imprisonment of up to 1 year and a fine not to exceed $4,000.', 'Texas Penalties', 0, '', 'texas-penalties', 'Norml', 0, 1343086200, '', 0),
(173, 'Secondary', 'http://norml.org/laws/item/illinois-penalties?category_id=857', 5, 'Possession for Personal Use Possession of less than 2.5 grams of marijuana is a Class C misdemeanor, punishable by a jail term of up to 30 days. Possession of between 2.5 - 10 grams of marijuana is a Class B misdemeanor, punishable by up to 6 months imprisonment.', 'Illinois Penalties', 0, '', 'illinois-penalties', 'Norml', 0, 1343086217, '', 0),
(174, 'Secondary', 'http://norml.org/laws/item/massachusetts-penalties-2?category_id=865', 5, 'Marijuana is a class D controlled substance under the Massachusett''s Controlled Substances Act. Possession for Personal Use Possession of 1 ounce or less of marijuana is decriminalized and is punishable as a civil offense. If the offender is over the age of 18 they must pay a fine of $100.', 'Massachusetts Penalties', 0, '', 'massachusetts-penalties', 'Norml', 0, 1343086233, '', 0),
(175, 'Secondary', 'http://www.shouselaw.com/marijuana-possession-sale.html', 5, 'Marijuana Possession for the Purpose of Sale in California It''s very common in Southern California to be falsely accused of violating California Health and Safety Code 11359, which makes it a felony crime to possess marijuana with the intent to sell it. Police often mistake innocent evidence or simple marijuana possession for a marijuana sale waiting to happen.', 'Possession of Marijuana for Sale | CA Health & Safety Code 11359', 0, '', 'possession-of-marijuana-for-sale-ca-health-safety-code-11359', 'Shouselaw', 0, 1343086347, '', 0),
(176, 'Secondary', 'http://www.mcsocal.com/medical-marijuana-legal-guide', 5, '© Americans For Safe Access Table of Contents Becoming A Patient How to become a medical marijuana patient in the state of California Registration Fee Eligible medical conditions: "Serious Medical Condition" Written Certification Must be Provided to Prove Eligibility Finding a Doctor Renewal Applications Personal Records Limitations and Protections under Initiative Possession and Growing Limitations Consumption of Medical Marijuana Paraphernalia associated with medical use Access to Medical Marijuana Growing/Dispensing Collectives and Cooperatives Caregivers Employment Reciprocity Law Enforcement Confidentiality I.', 'Medical Marijuana Legal Guide | MCSocal', 0, '', 'medical-marijuana-legal-guide-mcsocal', 'Mcsocal', 0, 1343086409, '', 0),
(177, 'primary', 'http://www.sdcourt.ca.gov/portal/page?_pageid=55,1424500&_dad=portal&_schema=PORTAL', 6, 'Back to Top Rental Income Garnishment If the judgment debtor owns rental property, you may garnish the rents paid by the current tenants. The procedure is the same as wage garnishment, except you instruct the Sheriff''s Department to do a rent garnishment instead of a wage garnishment.', 'How to Collect Judgment', 1, '', 'how-to-collect-judgment', 'Ca', 0, 1343086525, '', 14),
(178, 'Primary', 'http://www.sdcourt.ca.gov/portal/page?_pageid=55,1424410&_dad=portal&_schema=PORTAL&a=1#1', 6, 'Small Claims Frequently Asked Questions 1. Who can file a claim? 2. Where can I file a claim? 3. Does the court provide an interpreter? 4. Does the court provide a small claims advisor? 5. What are the rules about designating a defendant? 6. How does the defendant find out about the lawsuit?', 'Small Claims FAQs', 0, '', 'small-claims-faqs', 'Ca', 0, 1343087565, '', 15),
(179, 'Secondary', 'http://www.sandiegotriallaw.com/blog/handling-your-own-case-in-small-claims-court/', 6, 'If you have a dispute over money with a person or business, you may be considering filing a small claims court lawsuit. In San Diego Small Claims Court, an individual may file a claim against a person or business for up to $7,500.00. Businesses may file claims for up to $5,000.00.', 'Handling Your Own Case in Small Claims Court | San Diego Trial Law', 0, '', 'handling-your-own-case-in-small-claims-court-san-diego-trial-law', 'Sandiegotriallaw', 0, 1343088209, '', 12),
(180, 'Primary', 'http://www.sdcourt.ca.gov/pls/portal/docs/PAGE/SDCOURT/GENERALINFORMATION/FORMS/SMALLCLAIMSFORMS/PKT019.PDF', 6, '[PDF] How to File a Small Claims Case', 'Small Claims Packet - How to File a Small Claims Case', 0, '', 'small-claims-packet-how-to-file-a-small-claims-case', 'Ca', 0, 1343088952, '', 13),
(181, 'Primary', 'http://www.courts.ca.gov/sc100info.pdf', 6, '[PDF] SC-100-INFO', 'Information for the Plaintiff (Small Claims)', 0, '', 'information-for-the-plaintiff-small-claims', 'Ca', 0, 1343089249, '', 14),
(182, 'Primary', 'http://www.sdcourt.ca.gov/pls/portal/docs/PAGE/SDCOURT/GENERALINFORMATION/FORMS/SMALLCLAIMSFORMS/SC024.PDF', 6, '[PDF] SC-024', 'Zip Code List - Small Claims ', 0, '', 'zip-code-list-small-claims', 'Ca', 0, 1343089301, '', 14),
(183, 'Primary', 'http://www.sdcourt.ca.gov/pls/portal/docs/PAGE/SDCOURT/GENERALINFORMATION/FORMS/SMALLCLAIMSFORMS/SC023.PDF', 6, '[PDF] SC-023', 'How to File a Small Claims Case (SC-023)', 0, '', 'how-to-file-a-small-claims-case-sc-023', 'Ca', 0, 1343089043, '', 12),
(184, 'Primary', 'http://www.sdcourt.ca.gov/pls/portal/docs/PAGE/SDCOURT/GENERALINFORMATION/FORMS/SMALLCLAIMSFORMS/SC100.PDF', 6, '[PDF] SC-100', 'Plaintiff''s Claim and Order to Go to Small Claims Court (Small Claims) ', 0, '', 'plaintiffs-claim-and-order-to-go-to-small-claims-court-small-claims', 'Ca', 0, 1343089327, '', 13),
(185, 'Primary', 'http://www.sdcourt.ca.gov/pls/portal/docs/PAGE/SDCOURT/GENERALINFORMATION/FORMS/SMALLCLAIMSFORMS/SC-100A_FILLABLE.PDF', 6, '[PDF] SC-100A', 'Other Plaintiffs and Defendants ', 0, '', 'other-plaintiffs-and-defendants', 'Ca', 0, 1343089353, '', 14),
(186, 'Primary', 'http://www.courts.ca.gov/sc104b.pdf', 6, '[PDF] SC-104B', 'What is "Proof of Service"? (Small Claims) ', 0, '', 'what-is-proof-of-service-small-claims', 'Ca', 0, 1343089376, '', 13),
(187, 'Primary', 'http://www.sdcourt.ca.gov/pls/portal/docs/PAGE/SDCOURT/GENERALINFORMATION/FORMS/SMALLCLAIMSFORMS/SC104C.PDF', 6, '[PDF] SC-104C', 'How to Serve a Business or Public Entity (Small Claims) ', 0, '', 'how-to-serve-a-business-or-public-entity-small-claims', 'Ca', 0, 1343089415, '', 13),
(188, 'Primary', 'http://www.courts.ca.gov/sc104.pdf', 6, '[PDF] SC-104', 'Proof of Service (Small Claims) ', 0, '', 'proof-of-service-small-claims', 'Ca', 0, 1343089446, '', 13),
(189, 'Primary', 'http://www.sdcourt.ca.gov/pls/portal/docs/PAGE/SDCOURT/GENERALINFORMATION/FORMS/SMALLCLAIMSFORMS/SC026.PDF', 6, '[PDF] SC-026', 'Notice to Party(ies) Filing Small Claims Action ', 0, '', 'notice-to-partyies-filing-small-claims-action', 'Ca', 0, 1343089468, '', 12),
(190, 'Primary', 'http://www.sdcourt.ca.gov/pls/portal/docs/PAGE/SDCOURT/GENERALINFORMATION/FORMS/SMALLCLAIMSFORMS/SC044.PDF', 6, '[PDF] SC-044', 'Request for Dismissal - Small Claims', 0, '', 'request-for-dismissal-small-claims', 'Ca', 0, 1343089490, '', 12),
(191, 'Primary', 'http://www.sdcourt.ca.gov/portal/page?_pageid=55,1424466&_dad=portal&_schema=PORTAL', 6, 'San Diego Small Claims Forms', 'Small Claims Forms', 0, '', 'small-claims-forms', 'Ca', 0, 1343089538, '', 12),
(192, 'secondary', 'http://dui.drivinglaws.org/california.php', 4, 'Penalties are determined by a number of circumstances including prior convictions, speeding, minor passengers, BAC level, and injury. For a first DUI offense in California, a person may face 4 days to 6 months in jail, a fine between $1400 to $2600, and a license suspension between 30 days to 10 months. ', 'DUI Penalties', 103, 'penalties, priors, refusal', 'dui-penalties', '', 0, 0, 'California', 112),
(193, 'secondary', 'http://www.kandblaw.com/penalty_chart.html', 4, 'In California, any DUI convictions in the past 10 years counts as a prior DUI. Having prior DUIs will increase penalties for the current DUI charge. For example, a second DUI typically carries mandatory jail time of 96 hours, a two year license suspension (can be reduced to one), and a fine between $1800 and $2800.  ', 'DUI Penalties Chart', 97, 'penalties, priors', 'dui-penalties-chart', '', 0, 0, 'California', 46),
(194, 'primary', 'http://dmv.ca.gov/pubs/vctop/d06/vc12500.htm', 4, 'Driving without a valid license in California is a misdemeanor and a fine may be imposed. In California, a person must have a valid license to drive.  ', 'Driving Without a License', 21, 'license, misdemeanor, penalties', 'driving-without-a-license', '', 0, 0, 'California', 45),
(195, 'primary', 'http://www.shouselaw.com/article-suspended-license.html', 4, 'Driving with a suspended or revoked license is a misdemeanor and jail time or fines may be imposed. ', 'Driving on a Suspended or Revoked License', 56, 'penalties, license, misdemeanor', 'driving-on-a-suspended-or-revoked-license', '', 0, 0, 'California', 21),
(196, 'primary', 'http://www.dmv.ca.gov/pubs/vctop/d11_5/vc23572.htm', 4, 'Driving with a passenger under the age of 14 is a serious issue and a 48 hour jail sentence may be imposed, regardless of whether or not probation is granted. Prosecutors may choose to file child endangerment charges as well. ', 'DUI with Child in the Car', 38, 'penalties, child passenger', 'dui-with-child-in-the-car', '', 0, 0, 'California', 17),
(197, 'primary', 'http://www.shouselaw.com/dui-withchild.html', 4, 'If you had a minor under 14 in the car at the time you were arrested for DUI, you may face enhanced penalties. It does not matter whether you were driving safely or had a low level of intoxication. For a first offense, you may face an additional 48 hours of jail time. For a second offense, you may face an additional 10 days in jail. ', 'DUI & enhanced penalty for passenger under 14 ', 60, 'penalties, child passenger', 'dui-enhanced-penalty-for-passenger-under-14', '', 0, 0, 'California', 20),
(198, 'secondary', 'http://blog.duicentral.com/2012/05/16/the-child-endangerment-enhancements/', 4, 'If you have a passenger under the age of 14 in the car at the time of your DUI arrest, you may be additionally charged with DUI with a minor passenger. A conviction will bring an additional 48 hours of jail time. ', 'The Child Endangerment Enhancements', 68, 'penalties, child passenger', 'the-child-endangerment-enhancements', '', 0, 0, 'California', 19),
(199, 'primary', 'http://scocal.stanford.edu/opinion/ingersoll-v-palmer-30801', 4, 'In Ingersoll v. Palmer (1987) the California Supreme Court ruled that DUI checkpoints must use neutral formulas, such as stopping every 5th car. This formula must be determined before installing the checkpoint. Police cannot stop cars at random. ', 'DUI Checkpoints Must be Neutral ', 18, 'checkpoints, constitution', 'dui-checkpoints-must-be-neutral', '', 0, 0, 'California', 16),
(200, 'secondary', 'http://voices.yahoo.com/requirements-sobriety-checkpoints-96573.html?cat=17', 4, 'According to the Supreme Court, DUI checkpoints are constitutional. However, they must follow certain guidelines. For example, a specific pattern or formula for stopping cars must be used. Police cannot stop cars at random. Furthermore, police must adequately inform drivers that the checkpoint will be in place. Most departments issue statements detailing when and where they plan on having the checkpoint.', 'DUI Checkpoint Requirements', 74, 'checkpoints', 'dui-checkpoint-requirements', '', 0, 0, '', 31);
INSERT INTO `links` (`id`, `type`, `url`, `category`, `summary`, `title`, `votes`, `tags`, `slug`, `source`, `poster`, `date_created`, `location`, `views`) VALUES
(201, 'secondary', 'http://www.shouselaw.com/dui-checkpoint.html', 4, 'There are several ways to fight a DUI arrest stemming from a checkpoint including: there was no adequate warning for the upcoming checkpoint, there was no way to avoid the checkpoint, and the supervising officers were not present at the checkpoint. Although checkpoints are constitutional, they must follow regulations and guidelines. ', 'How to Fight a DUI Checkpoint Arrest', 74, 'checkpoints', 'how-to-fight-a-dui-checkpoint-arrest', '', 0, 0, 'California', 32),
(202, 'primary', 'http://people.howstuffworks.com/profiling2.htm', 4, 'Police must have probable cause before pulling over a car. An officer has probable when there is a reasonable, articulable suspicion that a law has been broken. In most instances, breaking a traffic law will give rise to probable cause. Any evidence found as a result of an illegal stop may be thrown out of court. This is under the fruit of the poisonous tree doctrine.', 'Were you Pulled Over Legally?', 42, 'probable cause, driving, evidence, police misconduct, constitution', 'were-you-pulled-over-legally', '', 0, 0, '', 20),
(210, 'primary', 'http://www.dmv.ca.gov/pubs/vctop/d11_5/vc23582.htm', 4, 'Driving recklessly over the speed limit may trigger an additional 60 day jail sentence. Reckless driving is driving that will probably injure someone and you are aware of that risk. The enhancement may apply if you were driving 30 mph over the speed limit on a freeway or 20 mph over the speed limit on any other road.', 'Speeding Penalty Enhancement ', 23, 'speeding, penalties', 'speeding-penalty-enhancement', '', 0, 0, 'California', 18),
(204, 'secondary', 'http://www.ehow.com/about_6110737_probable-cause-stop-vehicle.html', 4, 'The Fourth Amendment requires probable cause to pull over a vehicle. This means that the police need a reason to pull over a car, and can''t do so randomly. Any traffic violation is usually enough. Also, if the police officer already knows that the individuals in a car are the suspects in a crime, then he can pull the car over as well. ', 'Probable Cause to Stop a Car', 22, 'probable cause, driving, constitution, police misconduct', 'probable-cause-to-stop-a-car', '', 0, 0, '', 25),
(205, 'secondary', 'http://www.shouselaw.com/probable-cause.html', 4, 'The Fourth Amendment of the Constitution prohibits unreasonable searches and seizures. This means that an officer can''t stop you for no reason. The officer must provide "specific articulable facts," or probable cause, that a crime is or was taking place before he or she can pull over a vehicle. Further, before making a DUI arrest, the police must show that they had probable cause to arrest you. This can be established by showing that you had driving and physical symptoms commonly seen in drunk individuals. Any evidence found as a result of an illegal stop or arrest may be thrown out of court under the fruit of the poisonous tree doctrine.', 'Was your Arrest Legal?', 69, 'probable cause, driving, arrest, evidence', 'was-your-arrest-legal', '', 0, 0, '', 29),
(206, 'secondary', 'http://caselaw.lp.findlaw.com/data/constitution/amendment04/', 4, 'The Fourth Amendment of the US Constitution protects people from unreasonable searches and seizures. Depending on the circumstances, police need a warrant, probable cause, or reasonable suspicion, to search or detain a person. Any evidence found as a result of the violation of the fourth amendment may be thrown out of court. ', 'No Unreasonable Searches or Seizures', 14, 'probable cause, constitution, evidence, police misconduct', 'no-unreasonable-searches-or-seizures', '', 0, 0, '', 18),
(207, 'secondary', 'http://en.wikipedia.org/wiki/Fruit_of_the_poisonous_tree', 4, 'Any evidence obtained from an illegal arrest or stop in violation of the fourth amendment, may get thrown out of court under the fruit of the poisonous tree doctrine. This is to discourage law enforcement from violating people''s rights. ', 'Evidence from Illegal Arrests Get Thrown Out', 33, 'evidence, constitution, police misconduct', 'evidence-from-illegal-arrests-get-thrown-out', '', 0, 0, '', 17),
(208, 'secondary', 'http://www.law.cornell.edu/wex/fruit_of_the_poisonous_tree', 4, 'Under the fruit of the poisonous tree doctrine, evidence gathered through illegal means will be excluded from court. The rule is used to discourage police from engaging in misconduct and violating people''s rights. In DUI cases, sometimes officers make illegal stops or arrests. In such instances, a person''s breathlyzer results may be excluded. ', 'Police Misconduct Helps Your Case', 43, 'evidence, constitution, police misconduct', 'police-misconduct-helps-your-case', '', 0, 0, '', 22),
(209, 'primary', 'http://supreme.justia.com/cases/federal/us/251/385/case.html', 4, 'In Silverthorne Lumber Co., Inc. v. United States (1920), the Supreme Court Ruled that illegal seized evidence and it''s derivatives were not admissible in court. ', 'Fruit of the Poisonous Tree Case', 7, 'evidence, constitution, police misconduct', 'fruit-of-the-poisonous-tree-case', '', 0, 0, '', 24),
(211, 'secondary', 'http://www.shouselaw.com/dui-speed.html', 4, 'Driving recklessly over the speed limit may trigger an additional 60 day jail sentence. Reckless driving is driving that will probably injure someone and you are aware of that risk. The enhancement may apply if you were driving 30 mph over the speed limit on a freeway or 20 mph over the speed limit on any other road.', 'Were you Speeding?', 63, 'penalties, speeding', 'were-you-speeding', '', 0, 0, 'California', 32),
(212, 'primary', 'http://www.dmv.ca.gov/pubs/vctop/d11/vc23153.htm', 4, 'A DUI causing injury is a serious crime and harsher penalties may be imposed. ', 'DUI Causing Injury', 11, 'penalties, injury', 'dui-causing-injury', '', 0, 0, 'California', 17),
(213, 'secondary', 'http://www.fredthia.com/felony-dui', 4, 'A DUI is typically a misdemeanor charge. However, it may be upgraded to a felony in the following situations: fourth DUI within 10 years, a DUI with injury, or a DUI with death. A DUI with injury is a wobbler, which the prosecutor can charge it as a felony or misdemeanor. Felonies typically carry harsher penalties than misdemeanors, including possible jail time and large fines.', 'Is your DUI a Felony?', 70, 'injury, felony', 'is-your-dui-a-felony', '', 0, 0, 'California', 21),
(214, 'secondary', 'http://www.shouselaw.com/dui-injuries.html', 4, 'If you caused an accident and injured somebody, you may be charged with DUI causing injury. This charge is a a "wobbler," which means that it may be prosecuted as either a misdemeanor or as a felony depending on some factors including how many people were hurt and how badly the injuries were. A felony DUI with injury may impose two to six years of jail time and a fine between $1000 to $5000. ', 'DUI Accidents and Injury', 64, 'penalties, injury, felony, misdemeanor', 'dui-accidents-and-injury', '', 0, 0, 'California', 32),
(215, 'primary', 'http://www.lawyerdup.com/2010/12/california-dui-pas-refusal-system-makes.html', 4, 'In People v. Jackson (2010), the California court of appeals found that there is no penalty for refusing to take a handheld breathalyzer before arrest. The mini-breathalyzer is used as an evidence gathering device to establish probable cause for a DUI arrest. Thus, you have a right to refuse it. ', 'Refusing the Hand-held Breathlyzer', 9, 'breath test, evidence, refusal', 'refusing-the-hand-held-breathlyzer', '', 0, 0, 'California', 20),
(216, 'primary', 'http://leginfo.ca.gov/cgi-bin/displaycode?section=veh&group=23001-24000&file=23610-23614', 4, 'There is no legal obligation to take the handheld breathalyzer test and the police must advise you of this right. The handheld breathalyzer is a tool used to gather evidence needed to make a DUI arrest. However, it''s result cannot be used in court and you will not be penalized for refusing. ', 'Were you Given a Handheld Breathalyzer?', 59, 'breath test, evidence', 'were-you-given-a-handheld-breathalyzer', '', 0, 0, 'California', 21),
(217, 'primary', 'http://www.dmv.ca.gov/pubs/vctop/d06/vc13353.htm', 4, 'Automatic penalties may be imposed for refusing a chemical test, such as a 1 year license suspension for the first conviction. This is because implied consent laws demand that you submit to testing or face the consequences.', 'Chemical Test Refusal', 56, 'penalties, refusal, license, breath test, blood test ', 'chemical-test-refusal', '', 0, 0, 'California', 25),
(218, 'primary', 'http://www.dmv.ca.gov/pubs/vctop/d11_5/vc23612.htm', 4, 'When you drive a vehicle, you give your implied consent to be chemical tested if suspected of a DUI. Failure to do so will result in automatic penalties. ', 'Implied Consent Laws', 48, 'refusal, breath test , blood test, implied consent', 'implied-consent-laws', '', 0, 0, 'California', 45),
(219, 'secondary', 'http://www.shouselaw.com/chemical-test-refusal.html', 4, 'Automatic penalties may be imposed for refusing a chemical test, such as a 1 year license suspension for the first conviction. This is because implied consent laws demand that you submit to testing or face the consequences. When you drive a vehicle, you are agreeing to these laws. ', 'Did you Refuse the Breathlyzer', 90, 'refusal, license, breath test ', 'did-you-refuse-the-breathlyzer', '', 0, 0, 'California', 53),
(220, 'secondary', 'http://dui.drivinglaws.org/resources/dui-refusal-blood-breath-urine-test/california.htm', 4, 'By driving a car, you agree to take a breath or blood test if you are arrested for a DUI. You have a choice between a blood or breath test and you can''t be forced to take one over the other. ', 'Overview on Implied Consent Laws and Refusing ', 63, 'penalties, refusal, license, breath test, blood test ', 'overview-on-implied-consent-laws-and-refusing', '', 0, 0, 'California', 24),
(221, 'secondary', 'http://blog.duicentral.com/2012/02/19/burping-your-way-to-freedom/', 4, 'There are a number of things that can cause an inaccurate breath test including burping and vomiting 15 minutes before taking the test. This is because the breathalyzer assumes it is only measuring breath alcohol and not mouth alcohol. However, burping or vomiting introduces small amounts of mouth alcohol that will be picked up by the machine, resulting in an overly high BAC reading. ', 'Burping your way to freedom?', 95, 'breath test, inaccurate', 'burping-your-way-to-freedom', '', 0, 0, '', 59),
(222, 'secondary', 'http://www.drugdetection.net/PDF%20documents/Title%2017%20California%20Code%20of%20Regulations%20Jan%202006.pdf', 4, 'Under the law, an officer must observe you for 15 minutes before administering a breathalyzer. See section 1219.3 for more information.', 'Did you Burp 15 Minutes Before the Breathalyzer?', 81, 'breath test, inaccurate', 'did-you-burp-15-minutes-before-the-breathalyzer', '', 0, 0, 'California', 47),
(223, 'secondary', 'http://www.shouselaw.com/gerd.html', 4, 'Medical conditions that will lead to an inaccurate BAC result on a breathlyzer: GERD, Acid Reflux, and Heartburn.', 'GERD, Acid Reflex, and Heartburn Mess Up Breathalyzer', 46, 'breath test, inaccurate', 'gerd-acid-reflex-and-heartburn-mess-up-breathalyzer', '', 0, 0, '', 21),
(224, 'secondary', 'http://en.wikipedia.org/wiki/Arizona_SB_1070', 36, 'Arizona SB 1070 was a legislative act that provided the state law enforcement officers broad powers in checking an individual''s immigration status. Core provisions in the act were found unconstitutional and struck down by the Supreme Court of the U.S. Critics to the legislation note that provisions, such as allowing police to demand immigration papers based on "reasonable suspicion" encouraged racial profiling of citizens.', 'Arizona SB 1070', 46, 'immigration, arizona, supreme court, unconstitutional', 'arizona-sb-1070', '', 0, 0, '', 20),
(225, 'secondary', 'What is a rising BAC defense?', 4, 'Prosecutors will often try to estimate a person''s BAC at the time of driving to prove that the person''s BAC was above the legal limit. All too often, they will estimate a higher BAC at the time of driving than when a person took the chemical test, because they assume that the person''s body was burning off alcohol between the time period of arrest and testing. However, this assumption is clearly false if the person had a drink shortly before being arrested and tested, because the person''s body was still absorbing that drink. ', 'What is the Rising BAC Defense?', 62, 'defenses, bac, rising bac defense', 'what-is-the-rising-bac-defense', '', 0, 0, '', 21),
(226, 'secondary', 'http://www.freeadvice.com/law/criminal-law/drunk_driving/rising_bac_defense.htm', 4, 'It is unlawful to have an excessive blood-alcohol concentration (BAC) at the time of driving -- not at the time of being tested. Since it takes between 45 minutes and 3 hours for alcohol to be absorbed into the system, an individual''s BAC may continue to rise for some time after he is stopped and arrested.', 'Rising BAC Defense', 36, 'defenses, bac, rising bac defense', 'rising-bac-defense', '', 0, 0, '', 17),
(227, 'secondary', 'http://www.dmv.ca.gov/pubs/vctop/d11_5/vc23578.htm', 4, 'A BAC of 0.15% or greater may result in increased penalties.', 'Was your BAC 0.15% or Higher?', 84, 'penalties, bac', 'was-your-bac-015-or-higher', '', 0, 0, 'California', 54),
(228, 'secondary', 'http://www.dui-california.com/caldmv.html', 4, 'You have 10 days from the date of arrest to request a DMV hearing in order to fight a possible license suspension. ', 'You Have 10 Days to Request a DMV Hearing', 90, 'license, dmv', 'you-have-10-days-to-request-a-dmv-hearing', '', 0, 0, 'California', 40),
(229, 'primary', 'http://www.dmv.ca.gov/pubs/vctop/d06/vc13353_2.htm', 4, 'You have 10 days from the date of arrest to request a DMV hearing in order to fight a possible license suspension. ', '10 Days to Request a DMV Hearing', 25, 'license, dmv', '10-days-to-request-a-dmv-hearing', '', 0, 0, 'California', 17),
(230, 'primary', 'http://www.fredthia.com/underage-duis', 4, 'California has a zero-tolerance policy towards underage drinking and driving.  If a driver under the age of 21 has .01% or more BAC in their system, then he or she can be subjected to criminal and DMV penalties, depending on their blood alcohol level. ', 'Under 21 DUI', 72, 'penalties, under 21', 'under-21-dui', '', 0, 0, 'California', 64),
(231, 'primary', 'http://www.dmv.ca.gov/pubs/vctop/d11/vc23140.htm', 4, '"It is unlawful for a person under the age of 21 years who has 0.05 percent or more, by weight, of alcohol in his or her blood to drive a vehicle."', 'The Law: Under 21 DUI', 12, 'penalties, under 21', 'the-law-under-21-dui', '', 0, 0, 'California', 23),
(232, 'news', 'http://www.entrepreneur.com/article/217464', 2, 'Three tips to help you avoid tax troubles down the road. 1) Hire a tax pro and bookkeeper - in addition to paying income tax, you also have to pay self-employment tax. Your tax pro can help you minimize expenses. 2) choose a legal entity - different entities have different tax consequences and it''s important to choose what is right for your business. 3) Make estimated tax payments - because you taxes are being withheld from your paychecks, you have to do it yourself. ', 'Tax Basics for Startups', 67, 'tax', 'tax-basics-for-startups', '', 0, 0, '', 19),
(233, 'primary', 'http://ladot.lacity.org/tf_Parking_regulations.htm', 3, 'The following general provisions of law apply whether or not there are signs or curb markings present. For example: parking is prohibited in front of a driveway. Click to see more. ', 'General Parking Laws That Always Apply', 85, 'parking', 'general-parking-laws-that-always-apply', '', 0, 0, 'Los Angeles', 33),
(234, 'primary', 'http://ladot.lacity.org/tf_Colored_Curb_Zones.htm', 3, 'In LA there are red, yellow, white, green, blue curb zones. Red curb zones indicate that drivers are not allowed to stop or park in that area. Yellow curb zones are for commercial districts and are used commonly for loading or unloading freight. Cars are not allowed to park for more than 30 minutes on a yellow curb. White curb zones are for passenger loading, these zones are limited to 5 minutes of parking. Green curb zones are for short-term parking. Green curbs are commonly found for convenience stores or other businesses that require only 15 minutes of parking. Blue curb zones are reserved for those that are disabled. Blue curb zones require a handicap placard. ', 'Color Curb Zones', 71, 'parking, colored curbs', 'color-curb-zones', '', 0, 0, 'Los Angeles', 27),
(235, 'primary', 'http://ladot.lacity.org/tf_Parking_Restrictions.htm', 3, 'There are several different types of parking signs including time limit, no parking, no stopping, street cleaning, preferential parking, and disabled zones. No Parking means you can drop off and pick up passengers for up to 5 minutes or perform commercial loading for up to 30 minutes. No Stopping means you cannot stop your car there at all. Preferential parking restricts parking to certain time period, unless you have a residential permit. ', 'Different Kinds of Parking Signs', 71, 'parking, signs', 'different-kinds-of-parking-signs', '', 0, 0, 'Los Angeles', 30),
(236, 'news', 'http://articles.glendalenewspress.com/2012-07-04/the818now/tn-gnp-cashstrapped-la-raises-parking-fines-for-6th-time-in-7-years-20120704_1_parking-fines-city-parking-tickets-parking-proposal', 3, 'Los Angeles is once again raising fines for parking violations an additional $5, for the sixth time in seven years. The City Council voted unanimously for the fine increases, which will apply to the 2.5 million city parking tickets issued annually and are expected to generate an extra $8.4 million in the next year for the city''s general fund budget, which pays for basic services such as police and firefighters.', 'Cash-strapped L.A. raises parking fines for 6th time in 7 years', 85, 'parking, fines', 'cash-strapped-la-raises-parking-fines-for-6th-time-in-7-years', '', 0, 0, 'Los Angeles', 31),
(237, 'news', 'http://blogs.laweekly.com/informer/2012/07/can_you_be_ticketed_at_broken_parking_meters_california_la.php', 3, 'Here in Los Angeles, city officials will do everything within their power to indirectly tax us for driving (even though driving is often the only way to traverse the sprawl, and dreams for a full L.A. subway system probably won''t be realized for another half-century).', 'You Can No Longer Be Ticketed at Broken Parking Meters in California -- But L.A. Is Expected to Opt Out of State Policy', 73, 'parking, meters', 'you-can-no-longer-be-ticketed-at-broken-parking-meters-in-california-but-la-is-expected-to-opt-out-of-state-policy', '', 0, 0, 'Los Angeles', 26),
(238, 'news', 'http://www.huffingtonpost.com/2012/07/03/la-parking-ticket-increase_n_1648024.html', 3, 'The Los Angeles City Council has approved a $5 increase on parking tickets Tuesday. The fee hike is LA''s sixth parking ticket increase in seven years. Officials hope the increased revenue will make a dent in the city''s $238 million budget deficit. Here are the ticket fines for some of the most common parking violations.', 'Parking Ticket Fines Are Going Up AGAIN', 91, 'parking, fines', 'parking-ticket-fines-are-going-up-again', '', 0, 0, 'Los Angeles', 35),
(239, 'primary', 'http://www.sandiego.gov/parking/enforcement/rules.shtml', 3, 'In San Diego parking meter and time restrictions imposed do not apply on Sundays and major U.S. holidays. Standard DMV regulations, such as prohibited parking in an intersection, apply in San Diego. Additionally, it is unlawful for a driver to drive between vehicles comprising a funeral procession. Click "View Source" for detailed information on San Diego driving regulations.', 'General Parking Rules', 20, 'parking', 'general-parking-rules', '', 0, 0, 'San Diego', 12),
(240, 'primary', 'http://docs.sandiego.gov/municode/MuniCodeChapter08/Ch08Art06Division00.pdf', 3, 'Parking meters have certain time and date restrictions. During major holidays, such as President''s Day or Christmas the restrictions do not apply. Click "view source" for a detailed listing of San Diego''s parking laws.', 'Parking Code', 44, 'parking', 'parking-code', '', 0, 0, 'San Diego', 13),
(241, 'primary', 'http://www.amlegal.com/nxt/gateway.dll?f=templates&fn=default.htm&vid=amlegal:lamc_ca', 3, 'The city of Los Angeles has a separate municipal code for drivers to follow. Click "view source" to check Chapter VIII of the Municipal Code for the Traffic Code.', 'The Traffic Code: Los Angeles', 53, 'parking, traffic', 'the-traffic-code-los-angeles', '', 0, 0, 'Los Angeles', 23),
(242, 'primary', 'https://pci.etimspayments.com/pbw/include/la/input.jsp', 3, 'Drivers are able to pay for their parking tickets online. The ticket number and driver''s information are required. Click to be redirected to the website where you can pay.', 'Pay your Parking Ticket Here', 20, 'parking, fines, pay ticket', 'pay-your-parking-ticket-here', '', 0, 0, 'Los Angeles', 25),
(243, 'primary', 'https://step1.caledoncard.com/tickets/sandiego.html', 3, 'Drivers in San Diego can pay for their traffic tickets online. Be sure to have your traffic ticket number, driver''s license information, and either a debit or credit card. Click to be redirected to the online application.', 'Pay your Parking Ticket Online', 21, 'parking, fines, pay ticket', 'pay-your-parking-ticket-online', '', 0, 0, 'San Diego', 14),
(244, 'primary', 'http://ladot.lacity.org/tf_contesting_citation.htm', 3, 'Contesting a parking ticket has a three-stage review process. The first stage is an Initial Review request. You have 21 days from the date of the ticket to request an initial review. The second stage is the Administrative Hearing. Individuals that are dissatisfied with the Initial Review result may further contest the ticket by requesting an Administrative Hearing. You must pay in advance all fines or money owed on a ticket and request the Administrative Hearing within 21 days from the date of the initial decision. The third step is Appealing the Administrative Hearing. This only occurs if an individual is dissatisfied with the findings for the first two hearings. This appeal must be requested within 30 days from the date of the Administrative Hearing Examiner''s decision.', 'How to Fight Your Parking Ticket', 92, 'parking, appeal', 'how-to-fight-your-parking-ticket', '', 0, 0, 'Los Angeles', 49),
(245, 'secondary', 'http://www.lotustalk.com/forums/f106/how-fight-parking-ticket-los-angeles-67203/', 3, 'This is an example letter someone wrote to fight a parking ticket because the sign was covered by tree branches and leafs. ', 'Example Letter Fighting Parking Ticket', 86, 'parking, appeal', 'example-letter-fighting-parking-ticket', '', 0, 0, 'Los Angeles', 54),
(246, 'primary', 'https://pci.etimspayments.com/pbw/include/la/complaintform.jsp?complainttype=6', 3, 'Traffic violators are allowed to fight their parking tickets online. You can use the sample letter for your "Citizen''s Statement", which is your side of the story. Be sure to have the citation issue date, violation number, and other relevant personal information ready. ', 'Fight Your Ticket Online', 91, 'parking, appeal', 'fight-your-ticket-online', '', 0, 0, 'Los Angeles', 44),
(247, 'primary', 'https://wmq.etimspayments.com/pbw/include/santamonica/revform.jsp', 3, 'Drivers in Santa Monica can file a request online to contest a parking citation. This request for review must be filed within 21 days of the citation issue date or 14 days from the reminder notice. Click "view source" to be directed to the Santa Monica request form.', 'Santa Monica: Fight Your Ticket Online', 82, 'parking, appeal, santa monica', 'santa-monica-fight-your-ticket-online', '', 0, 0, 'Los Angeles', 34),
(248, 'primary', 'http://www.sandiego.gov/parking/citations/appeal/index.shtml', 3, 'In San Diego, there are 3 levels of appeal an individual can pursue. The first level is an Administrative Review, this review will determine if the citation was validly issued. The request for review must be received within 21 days from the date the citation was issued. Note, drivers are able to submit a request online as well. The second level is an Administrative Hearing. This occurs when an individual''s appeal was denied. During this time, all fees due on the citation must be deposited. The third level is a Superior Court Appeal, at this time the Superior Court will require a Civil Court Filing. Once a decision has been given, no further appeal is allowed. \n', 'How to Fight Your Parking Ticket', 91, 'parking, appeal', 'how-to-fight-your-parking-ticket2', '', 0, 0, 'San Diego', 19),
(249, 'primary', 'http://www.sandiego.gov/parking/citations/adminreviewform.shtml', 3, 'San Diego drivers can file a request online to contest a parking violation. Click "view source" to be directed to the San Diego online application for Administrative Review. ', 'Fight Your Ticket Online', 89, 'parking, appeal', 'fight-your-ticket-online2', '', 0, 0, 'San Diego', 17),
(250, 'primary', 'http://www.sandiego.gov/parking/citations/appeal/adminreview.shtml', 3, 'A common way to fight a ticket is to request an Administrative Review. During this review, drivers often will submit photos or other evidence to show that they either 1. were not parking in the wrong area; 2. the parking sign was unreadable or 3. they had the applicable permit, but the parking officer did not notice it.', 'Common Ways to Fight a Ticket', 90, 'parking, appeal', 'common-ways-to-fight-a-ticket', '', 0, 0, 'San Diego', 21),
(251, 'primary', 'https://www.docracy.com/6481/letter-of-appeal-for-parking-ticket', 3, 'When fighting a parking ticket, be sure to include the citation number, date and time of the citation, and location. Be sure to include photographs or other forms of evidence to strengthen your claim. Click "view source" for a sample letter that can be tailored to fight your parking ticket.', 'Sample Letter Template to Fight Your Parking Ticket', 91, 'parking, appeal, letter', 'sample-letter-template-to-fight-your-parking-ticket', '', 0, 0, '', 102),
(252, 'primary', 'http://www.sanjoseca.gov/transportation/onstreet_regulations.htm', 3, 'Common parking violations in San Jose include meter violations (letting the meter time expire) and parking in a street cleaning/construction area. Drivers can also be cited for disregarding signs and parking during restricted times, in a residential permit only area, or parking on the street for more than 72 continuous hours. ', 'List of Common Parking Violations', 32, 'parking', 'list-of-common-parking-violations', '', 0, 0, 'San Jose', 15),
(253, 'primary', 'http://sanjose.amlegal.com/nxt/gateway.dll/California/sanjose_ca/sanjosemunicipalcode?f=templates$fn=default.htm$3.0$vid=amlegal:sanjose_ca', 3, 'San Jose''s parking regulations are similar to most municipalities. Drivers are required to follow all road and pedestrian signs and cannot arbitrarily park their cars. Click "view source" to see all the relevant statutes drivers must follow while in San Jose.  ', 'Parking Code', 25, 'parking', 'parking-code2', '', 0, 0, 'San Jose', 16),
(254, 'secondary', 'http://www.sfmta.com/cms/penf/indxpkenf.htm#tips', 41, 'The following tips are for parking legally within San Francisco. While driving in San Francisco, drivers should never leave their vehicle parked for more than 72 hours. Furthermore, they should be conscious of parking signs and permit required signs. Never block driveways and crosswalks. For more tips, click "view source" and click on the colored links for elaborations.', 'Tips for Parking', 46, 'parking, tips', 'tips-for-parking', '', 0, 0, 'San Francisco', 17),
(255, 'primary', 'http://www.amlegal.com/nxt/gateway.dll/California/transportation/transportationcode?f=templates$fn=default.htm$3.0$vid=amlegal:sanfrancisco_ca$sync=1', 3, 'San Francisco has specific traffic codes that all drivers must follow. Similar to most municipalities, drivers in San Francisco are required to obey all posted signs and regulations. For detailed rules and regulations click "view source" and click on the "transportation" link.', 'Traffic Code', 23, 'parking, traffic', 'traffic-code', '', 0, 0, 'San Francisco', 17),
(256, 'primary', 'http://www.amlegal.com/nxt/gateway.dll/California/transportation/divisionii/article300finesandfees?f=templates$fn=altmain-nf.htm$3.0#JD_302', 3, 'San Francisco has listings on the amount of fine each type of parking violation is given. Common citations, such as parking during street cleaning ($63 fine) or parking in a red zone ($97 fine) range between $55 to $110. Standard DMV penalties, such as an expired license registration, are used and apply in San Francisco.', 'List of Traffic Penalties and Fines', 90, 'parking, traffic, fines', 'list-of-traffic-penalties-and-fines', '', 0, 0, 'San Francisco', 21),
(257, 'primary', 'https://www.pticket.com/scripts/Autobahn.exe/Execute?Application=pTicket&Program=REPORT-query_citation&parmAGENCY_STATE=CA&parmAGENCY_LOC=SANJOSE&DSI=0', 3, 'San Jose drivers are able to pay for their parking tickets online. Be sure to have your citation number, driver''s license, and credit or debit card number available. Click to be directed to the online pay form.', 'Pay your Parking Ticket Here', 25, 'parking, fines, pay ticket', 'pay-your-parking-ticket-here', '', 0, 0, 'San Jose', 0),
(258, 'primary', 'https://wmq.etimspayments.com/pbw/include/sanfrancisco/main.jsp', 3, 'San Francisco parking citations can be paid online. Individuals will need either a debit or credit card. There is a $2.50 service charge to use this system. Vehicles that have been towed or booted are ineligible for this system and must directly pay at the SFMTA Customer Service Center.', 'Pay your Parking Ticket Here', 24, 'parking, fines, pay ticket', 'pay-your-parking-ticket-here', '', 0, 0, 'San Francisco', 0),
(259, 'primary', 'http://www.sanjoseca.gov/transportation/forms/parkingappeal.pdf', 3, 'For San Jose drivers, mail in this form in order to contest a traffic or parking violation. Be sure to have information such as ticket number, driver''s license and payment information ready. Click to be redirected to the form.', 'Use this Form to Fight your Ticket', 72, 'parking, appeal', 'use-this-form-to-fight-your-ticket', '', 0, 0, 'San Jose', 14),
(260, 'primary', 'http://www.sanjoseca.gov/transportation/compliance_citations.htm', 3, 'San Jose drivers are able to pay for a citation online or through the mail. To contest a citation, the request must be made by writing, telephone, or in person at the Office of Parking Violations. Be prepared to explain why the citation is either invalid or should be dismissed. Also, be sure to bring all documentation to support your request.', 'How to Fight Your Parking Ticket', 94, 'parking, appeal', 'how-to-fight-your-parking-ticket3', '', 0, 0, 'San Jose', 23),
(261, 'primary', 'http://www.sfmta.com/cms/penf/13441.html#protest', 3, 'To fight a parking ticket in San Francisco, drivers should first seek an Administrative Review. If the driver receives a denial of the review, they should then seek an Administrative Hearing. Click for information on deadlines and where to request a hearing date.', 'How to Fight Your Parking Ticket', 92, 'parking, appeal', 'how-to-fight-your-parking-ticket4', '', 0, 0, 'San Francisco', 24),
(263, 'secondary', 'http://www.nolo.com/legal-encyclopedia/free-books/beat-ticket-book/chapter2-1.html', 3, 'Determine what you have been charged with, find the law online, review the law, and determine if you can fight your ticket. ', 'How to Research Traffic Laws', 80, 'parking, traffic, speeding', 'how-to-research-traffic-laws', '', 0, 0, '', 32),
(264, 'secondary', 'http://www.nolo.com/legal-encyclopedia/free-books/beat-ticket-book/chapter5-3.html', 3, 'A presumed speed limit means that you''re allowed to go over the posted speed limit as long as you were driving safely.', 'How Presumed Speed Limit Can Help You Fight Your Speeding Ticket', 74, 'speeding', 'how-presumed-speed-limit-can-help-you-fight-your-speeding-ticket', '', 0, 0, '', 29),
(286, 'secondary', 'http://startuplawyer.com/convertible-notes/the-basics-of-convertible-debt-financing', 2, 'Convertible debt financing is a loan to a startup that can later be converted to equity (shares). It is typically converted during the startup''s next funding round, such as a Series A. The note holder usually gets a discount for the shares, compared to those investing in the next funding round.', 'What is a Convertible Note?', 84, 'convertible note, financing', 'what-is-a-convertible-note', '', 0, 0, '', 27),
(266, 'primary', 'http://codes.lp.findlaw.com/nycode/VAT/VII/30/1180', 3, 'In New York, the basic speed law limits drivers from driving in excess of 55 miles an hour. This speed limit changes based on whether the driver is in a school zone, construction site, or during an emergency situation.', 'Basic Speeding Law', 56, 'speeding', 'basic-speeding-law', '', 0, 0, 'New York City', 18),
(267, 'primary', 'http://www.nytrafficticket.com/blog/index.php/2011/04/08/how-much-does-a-new-york-speeding-ticket-cost/', 3, 'Drivers found speeding in New York can be cited anywhere between $45 to $600 per ticket. These amounts depend on how many miles per hour over the speed limit the driver was found driving in. Every fine includes a $70 additional New York State surcharge. In rare circumstances, a judge may impose a jail term for speeding tickets.   ', 'Speeding Ticket Fines', 57, 'speeding, fines', 'speeding-ticket-fines', '', 0, 0, 'New York City', 20),
(268, 'primary', 'http://a841-dotvweb01.nyc.gov/ParkingRegs/ViewController/LocationValidation.aspx', 3, 'Different streets in New York have different regulations for parking. The Department of Transportation in New York has a working map of parking regulations. Click "view source" to find out the parking rules of any street in New York City.', 'Parking Rules by Street', 79, 'parking', 'parking-rules-by-street', '', 0, 0, 'New York City', 17),
(269, 'primary', 'http://nycdot.info/dotmap/', 3, 'An interactive map with parking rules of any street in New York City. This map has listings for street conditions, parking signs, and resurfacing projects. Click to interact and find out what driving conditions are like for your destination.', 'Parking Rules Map', 69, 'parking', 'parking-rules-map', '', 0, 0, 'New York City', 17),
(270, 'primary', 'http://www.nyc.gov/html/dof/html/parking/park_tickets_violations.shtml', 3, 'In New York traffic or parking fines range from $50 to $115 per violation. Common New York violations include, driving through a red light, idling your vehicle in a restricted area, or blocking an intersection. Click "view source" for a detailed list of violations and associated fines.', 'Parking Violation Rules, Fines, and Codes', 64, 'parking, fines', 'parking-violation-rules-fines-and-codes', '', 0, 0, 'New York City', 15),
(271, 'primary', 'http://www.nyc.gov/html/dot/html/motorist/prkintro.shtml#regs', 3, 'If a T-intersection does not have any traffic signals, all-way stop signs or crosswalk markings, then it''s alright to park on the edges of the intersection. A curb cut is the part of a sidewalk that has been lowered or cut so that pedestrians have an easier time walking across the street.', 'General Parking Information', 67, 'parking', 'general-parking-information', '', 0, 0, 'New York City', 20),
(272, 'secondary', 'http://parkitnyc.com/parking-nyc/nyc-parking-tickets/no-standing-ticket-nyc/', 3, 'No Parking means you can drop off and pick up people and personal property. No Standing means you can drop off and pick up people only. No Stopping means you can''t stop at all.', 'The Difference Between No Parking, No Standing, and No Stopping Signs', 89, 'parking, signs', 'the-difference-between-no-parking-no-standing-and-no-stopping-signs', '', 0, 0, 'New York City', 20),
(273, 'news', 'http://newyork.cbslocal.com/2012/07/13/drivers-in-west-new-york-frustrated-by-tickets-for-improper-parking/', 3, 'CBS 2''s Christine Sloan went to the West New York Parking Authority to get its side. The director wasn''t in, but on the phone said a ticket for barely going over the white line is little over the top. News, Sports, Weather, Traffic and the Best of NY', 'Drivers In West New York Frustrated By Tickets For ''Improper Parking''', 45, 'parking, ', 'drivers-in-west-new-york-frustrated-by-tickets-for-improper-parking', '', 0, 0, 'New York City', 17),
(274, 'news', 'http://www.thenewspaper.com/news/38/3825.asp', 3, 'A new legislation was passed for New York city drivers involving electronic parking meters. In the past, a parking officer could issue a citation even if the driver was in the process of walking to the meter to pay the meter. This new law allows drivers in New York to automatically beat a parking ticket, without an appeals process, by attending a hearing and submitting evidence of the citation being within 5 minutes of parking the car. ', 'New York Protects Drivers from Electronic Parking Meters', 30, 'parking, meters', 'new-york-protects-drivers-from-electronic-parking-meters', '', 0, 0, 'New York City', 16),
(275, 'news', 'http://www.ibtimes.com/articles/361569/20120710/new-york-city-parking-street-gps-lots.htm', 3, 'It''s common knowledge that parking in City is a miserable experience. Finding spots can be frustrating, parking is expensive, street-side parking notices are inscrutable, and more often than not, when you do find a space, you have to move your car again the next day because of street cleaning, the Independence Day parade or because the NYPD claims you''re in front of a fire hydrant.', 'Tiger Traps And Weird Signs: The Pain Of Parking In New York', 41, 'parking, signs', 'tiger-traps-and-weird-signs-the-pain-of-parking-in-new-york', '', 0, 0, 'New York City', 14),
(276, 'news', 'http://newyork.cbslocal.com/2012/06/25/nyc-booting-pilot-program-begins-targeting-ticket-scofflaws-in-brooklyn/', 3, 'The city is testing out the boot program for the next three to six months with the hope that it will be more convenient for everyone. But some already want to give the boot to the boot, calling it unfair for drivers.', 'NYC Booting Pilot Program Begins Targeting Ticket Scofflaws In Brooklyn', 18, 'parking, booting', 'nyc-booting-pilot-program-begins-targeting-ticket-scofflaws-in-brooklyn', '', 0, 0, 'New York City', 15),
(277, 'primary', 'http://www.nyc.gov/html/dof/html/parking/park_red_light.shtml', 3, 'Camera violations include running through a red light or driving/parking/standing in a bus lane. Vehicles filmed will receive their ticket in the mail approximately 30 days after the violation. Violators can pay the fines or appeal the citation online. Click and scroll to the bottom for more information on options violators have. ', 'Camera Violations', 71, 'red light, traffic', 'camera-violations', '', 0, 0, 'New York City', 20),
(278, 'secondary', 'http://parkitnyc.com/driving-nyc/nyc-traffic-ticket/nyc-traffic-violations/', 3, 'Traffic violations in New York can range from $50 to $100 per ticket. These tickets have different points that can directly affect the cost of insurance. For example: going through a red light ($50, 2 points), cell phone ticket ($130, 2 points), blocking intersection ($115, 2 points), idling in a restricted area ($115, 2 points), etc. Click "view source" for a list of common traffic tickets and their fines.', 'Common Traffic Tickets & Fines', 65, 'traffic, fines', 'common-traffic-tickets-fines', '', 0, 0, 'New York City', 21),
(279, 'primary', 'http://nycserv.nyc.gov/NYCServWeb/NYCSERVMain', 3, 'New York drivers are able to pay for their parking tickets online. Be sure to have your ticket number and other relevant information ready. Drivers are also able to request a hearing to appeal certain tickets. Click "view source" and navigate the site using Search -or- Pay For: Parking, red light, bus lane camera violation online payment system.', 'Pay Your Parking Ticket Here', 23, 'parking, fines, pay ticket', 'pay-your-parking-ticket-here', '', 0, 0, 'New York City', 0),
(280, 'primary', 'https://transact.dmv.ny.gov/pleadnpay/', 3, 'You may be eligible to pay your traffic ticket online if you see the words "Traffic Violations Bureau" at the bottom. ', 'Pay Your Traffic Ticket Here', 26, 'traffic, fines, pay ticket', 'pay-your-traffic-ticket-here', '', 0, 0, 'New York City', 15),
(281, 'primary', 'http://www.nyc.gov/html/dof/html/parking/park_tickets_dispute.shtml', 3, 'Persons who wish to fight a ticket should request a hearing within 30 days of receiving the ticket. These individuals are also eligible for paying the tickets online. Click "view source" to be redirected to the New York City parking website. ', 'How to Fight Your Parking Ticket', 94, 'parking, appeal', 'how-to-fight-your-parking-ticket5', '', 0, 0, 'New York City', 26),
(282, 'primary', 'http://nycserv.nyc.gov/NYCServWeb/NYCSERVMain', 3, 'New York drivers can request a hearing for parking ticket violations online. Be sure to have your ticket number ready. Click on Request Hearing For: Parking/Red Light/Bus Lane Camera Violations. ', 'Fight Your Parking Ticket Online', 90, 'parking, appeal', 'fight-your-parking-ticket-online', '', 0, 0, 'New York City', 16),
(283, 'primary', 'http://www.nyc.gov/html/dof/html/parking/park_tickets_appeal.shtml', 3, 'To request an appeal, file an Appeal Application within 30 days of the Administrative Law Judge''s hearing decision. Both these applications are available online via the "view source" button.', 'Appeal a Hearing Desicsion', 81, 'parking, appeal', 'appeal-a-hearing-desicsion', '', 0, 0, 'New York City', 22),
(284, 'news', 'http://www.nydailynews.com/new-york/late-fees-city-drivers-appealing-tickets-article-1.1111059', 3, 'City drivers are no longer on the hook to pay parking fines and late fees while they''re appealing their tickets. The city used to charge late fees 30 days after a ticket was issued, even if the driver was still appealing a guilty finding - but a law passed by the City Council earlier this year banned that practice.', 'Nix late fees in tix appeal', 75, 'parking, traffic, fines', 'nix-late-fees-in-tix-appeal', '', 0, 0, 'New York City', 17),
(285, 'secondary', 'http://www.plagiarismtoday.com/stopping-internet-plagiarism/your-copyrights-online/1-what-is-a-copyright/', 41, 'Copyright law gives exclusive right to reproduce, publish, sell, prepare derivatives of, or distribute things you create. This may include literary, musical, and artistic works. It gives you ownership rights, and generally no one else is allowed to use your creative work without permission. However, there are exceptions to copyright such as fair use and public domain.', 'What is a Copyright?', 100, 'ip, copyright, fair use, public domain', 'what-is-a-copyright', '', 0, 0, '', 99),
(287, 'secondary', 'http://techcrunch.com/2012/04/21/convertible-note-seed-financings-econ-101/', 2, 'A convertible note is short-term debt that converts into equity. The debt typically converts into shares of preferred stock upon closing of the next round of financing. An advantage of convertible notes is that it avoids the valuation discussion until the round of financing. It is also easier and cheaper to execute than a stock transfer agreement. ', 'Everything You Ever Wanted To Know About Convertible Note Seed Financings', 42, 'convertible note, financing', 'everything-you-ever-wanted-to-know-about-convertible-note-seed-financings', '', 0, 0, '', 11),
(288, 'secondary', 'http://startuplawyer.com/convertible-notes/how-convertible-debt-works', 2, 'Most convertible promissory notes contain an Automatic Conversion clause that automatically converts the debt into equity upon a "Qualified Financing." Qualified Financing is equity financing by the startup (e.g. Series A round), of an amount determined previously, that triggers the conversion of the debt to equity. The amount of shares converted is dependent on the conversion discount rate outlined in the promissory note. Typically there is a 20% discount. ', 'How Convertible Notes Work', 57, 'convertible note, financing', 'how-convertible-notes-work', '', 0, 0, '', 11),
(289, 'secondary', 'http://startuplawyer.com/convertible-notes/the-convertible-note-discount-price-cap', 2, 'Convertible notes are loans that later convert into equity. They typically convert at a 20% discount compared to other investors in the round. However, one problem is that investors with convertible notes get greater equity the lower a startup''s pre-money valuation is. Therefore, the investor may have little incentive to help increase your pre-money valuation. To avoid this situation, investors can put a price cap on the convertible note discount. The price cap is an artificial pre-money valuation that acts as a price ceiling. Thus, if the pre-money valuation is greater than the price cap, then the price cap is used to determine the number of shares to distribute. If the pre-money values is less than the price cap, the original discount rate is used.', 'Convertible Note Discount Price Caps', 53, 'convertible note, financing, price cap', 'convertible-note-discount-price-caps', '', 0, 0, '', 11),
(290, 'secondary', 'http://startuplawyer.com/convertible-notes/how-to-set-conversion-discounts-in-convertible-notes', 2, 'A Convertible Note is a loan that converts to equity upon a qualified financing round. The number of shares converted is usually discounted to benefit the note holder. Discounts are typically determined by a number of factors including: 1) the approximate amount of risk the note investor is taking; 2) general risk of an early stage startup; and 3) time and likelihood of the startup''s valuation increasing. The majority of convertible notes contain discount between 10% and 40%. ', 'Conversion Discounts in Convertible Notes', 51, 'convertible note, financing', 'conversion-discounts-in-convertible-notes', '', 0, 0, '', 11),
(291, 'secondary', 'http://copyright.cornell.edu/resources/publicdomain.cfm', 41, 'A public domain work may be used freely by everyone because it is not protected by copyright. Copyrighted works may become public domain when the work''s term has expired or if the author fails to perform certain statutory formalities. Furthermore, works of the U.S. Government are public domain. ', 'Copyright Term and the Public Domain', 65, 'ip, copyright, public domain', 'copyright-term-and-the-public-domain', '', 0, 0, '', 21),
(293, 'primary', 'http://en.wikipedia.org/wiki/Stop_Online_Piracy_Act', 37, 'The Stop Online Piracy Act (SOPA) is a United States bill designed to expand the ability of US law enforcement to fight online trafficking in copyrighted intellectual property and counterfeit goods. It encourages advertisers and payment processors to end service with offending sites and orders Internet service providers to block access to websites that feature infringing material. SOPA has been severely criticized for circumventing the DMCA''s "safe harbor" provision and for First Amendment violations.', 'What Is SOPA?', 96, 'sopa, copyright', 'what-is-sopa', '', 0, 0, '', 40),
(294, 'news', 'http://www.stanfordlawreview.org/online/dont-break-internet', 37, 'Two bills now pending in Congress-the PROTECT IP Act of 2011 (Protect IP) in the Senate and the Stop Online Piracy Act (SOPA) in the House-represent the latest legislative attempts to address a serious global problem: large-scale online copyright and trademark infringement.', 'Don''t Break the Internet - Stanford Law Review', 58, 'sopa, copyright, trademark, ip, online security', 'dont-break-the-internet-stanford-law-review', '', 0, 0, '', 19),
(295, 'secondary', 'http://www.hrc.org/marriage-center#.UBhJD7S0wfV', 34, 'Learn about the fight for marriage equality in your state. ', 'Human Rights Campaign - Marriage Center', 31, 'same-sex marriage, states, legal status ', 'human-rights-campaign-marriage-center', '', 0, 0, '', 17),
(296, 'secondary', 'http://www.net-coalition.com/wp-content/uploads/2011/08/tribe-legis-memo-on-SOPA-12-6-11-1.pdf', 37, 'Anti-SOPA advocates argue that SOPA infringes on free speech and would threaten the existence of many websites. Currently, the "safe harbor" provision of the DMCA permits service providers to create copyright policies that will protect them from copyright infringement claims. However, under SOPA, anyone who has been affected by copyright or trademark infringement may send a letter to online advertisers and payment processors notifying them of infringement. The advertisers and processors must then cease providing services to the allegedly infringing site within 5 days even if no court has actually found infringement. ', 'SOPA Violates the First Amendment', 82, 'sopa, constitution', 'sopa-violates-the-first-amendment', '', 0, 0, '', 21),
(297, 'news', 'http://www.forbes.com/sites/andygreenberg/2011/12/21/sopa-haters-are-already-finding-easy-ways-to-circumvent-its-censorship/', 37, '"The Internet interprets censorship as damage and routes around it," goes the saying coined by Sun Microsystems coder and EFF founder John Gilmore. Now the Internet''s communities of coders and free speech advocates have interpreted the Stop Online Piracy Act (SOPA) as intolerable digital damage before it has even come [...]', 'SOPA Haters Are Already Finding Easy Ways To Circumvent Its Censorship - Forbes', 46, 'sopa, censorship, piracy, DNS', 'sopa-haters-are-already-finding-easy-ways-to-circumvent-its-censorship-forbes', '', 0, 0, '', 19);
INSERT INTO `links` (`id`, `type`, `url`, `category`, `summary`, `title`, `votes`, `tags`, `slug`, `source`, `poster`, `date_created`, `location`, `views`) VALUES
(298, 'news', 'http://ammori.files.wordpress.com/2011/12/ammori-first-amd-sopa-protectip.pdf', 37, 'Generally, material that infringes on copyrighted material is subject to a standard of scrutiny that is excused rom First Amendment scrutiny. This means that someone who infringes on another''s copyrighted material would not be able to raise a First Amendment, or free speech, defense. However, anti-SOPA advocates argue that SOPA does not only target infringing material; it does not require that the court find evidence of infringement before copyright holders can demand action. Therefore, anti-SOPA advocates argue that SOPA would fail under the First Amendment because it restricts non-infringing speech.', 'Anti-SOPA Letter to Congress', 25, 'sopa, pipa, constitution, copyright, free speech', 'anti-sopa-letter-to-congress', '', 0, 0, '', 15),
(299, 'news', 'http://www.techdirt.com/articles/20111118/03163416812/sandia-national-labs-dns-filtering-sopapipa-wont-stop-piracy-will-hurt-online-security.shtml', 37, 'from the more-experts-weigh-in dept We''ve covered at great length the problems with DNS filtering in SOPA and PROTECT IP (PIPA) and how it will harm internet security. These concerns were first highlighted by a group of folks who are considered to be some of the foremost experts (and original architects) on DNS.', 'Sandia National Labs: DNS Filtering In SOPA/PIPA Won''t Stop Piracy, But Will Hurt Online Security | Techdirt', 53, 'sopa, pipa, DNS, online security', 'sandia-national-labs-dns-filtering-in-sopapipa-wont-stop-piracy-but-will-hurt-online-security-techdirt', '', 0, 0, '', 19),
(300, 'secondary', 'http://en.wikipedia.org/wiki/Viacom_International_Inc._v._YouTube,_Inc.', 41, 'In Viacom v. YouTube, Viacom sued Google for featuring clips of videos owned by Viacom without permission. Viacom argued that Google not only knew of the infringement, but also encouraged it to drive traffic to the site. The court held that some of YouTube''s use was protected under the "safe harbor" provision of the DMCA. Viacom had not proved that Google had the right and ability to control some of the material used for syndication, so the case was remanded. ', 'Viacom International Inc. v. YouTube, Inc.', 31, 'Viacom, YouTube, copyright, DMCA, safeharbor', 'viacom-international-inc-v-youtube-inc', '', 0, 0, '', 17),
(301, 'secondary', 'https://www.eff.org/deeplinks/2012/04/viacom-v-google-decision', 1, 'Although YouTube didn''t gain complete victory over Viacom (due to the remand on syndication), the Electronic Frontier Foundation ("EFF") explains that the outcome of Viacom v. YouTube is mostly in favor of the "safe harbor" provision of the DMCA. While YouTube, and other service providers, may not be "willfully blind" towards infringement or encourage it, they do not have an obligation to continuously monitor material to determine whether it is infringing. The outcome of this case establishes that the "safe harbor" provision is still intact, which is a good confirmation for innovators and service providers.', 'Viacom v. Google', 38, 'Viacom, Google, YouTube, DMCA', 'viacom-v-google', '', 0, 0, '', 0),
(302, 'primary', 'http://www.copyright.gov/legislation/dmca.pdf', 41, 'Digital Milennium Copyright Act of 1998, DMCA.', 'The Digital Millennium Copyright Act of 1998', 18, 'DMCA, copyright, safe harbor, WIPO', 'the-digital-millennium-copyright-act-of-1998', '', 0, 0, '', 19),
(303, 'secondary', 'https://www.eff.org/issues/dmca/', 41, 'The Digital Millennium Copyright Act (DMCA) has two controversial sections, the "anti-circumvention" and "safe harbor" provisions. The "anti-circumvention" provisions were intended to stop copyright pirates from defeating Digital Rights Management (DRM). This is controversial because it may affect non-infringing fair use. The "safe harbor" provisions protect service providers from monetary liability based on the allegedly infringing activities of third parties. Although copyright holders may not like the "safe harbor" provision, it is important for innovators and free expression online.', 'What is DMCA?', 59, 'dmca, copyright, safe harbor', 'what-is-dmca', '', 0, 0, '', 14),
(304, 'secondary', 'http://www.cnn.com/2012/03/22/tech/web/isps-sopa-piracy/index.html?iref=allsearch', 37, '(CNN) -- SOPA appears to be dead. But the battle over Internet piracy is not. In the wake of the debate over theStop Online Piracy Act, supporters of that now-abandoned bill are looking to Internet service providers for help; they''re also taking other tacks that Web-freedom advocates say could have much the same effect as SOPA would have had.', 'With SOPA shelved, anti-piracy advocates take new approaches - CNN.com', 47, 'sopa, piracy, censorship, acta', 'with-sopa-shelved-anti-piracy-advocates-take-new-approaches-cnncom', '', 0, 0, '', 16),
(305, 'news', 'http://blogs.wsj.com/digits/2012/05/31/top-agent-presses-silicon-valley-to-help-stop-piracy/?KEYWORDS=sopa', 37, 'Hollywood and Silicon Valley need to work together to tackle many of the challenges facing both industries, argued William Morris Endeavor Co-Chief Executive Ari Emanuel at the D: All Things Digital conference. Emanuel-whose clients include Martin Scorsese, Charlize Theron and earlier D speaker Aaron Sorkin-said he realized studios were at odds with technology companies earlier this year over the proposed Stop Online Piracy Act.', 'Top Agent Presses Silicon Valley to Help Stop Piracy', 38, 'Silicon Valley, piracy, sopa, television, ip', 'top-agent-presses-silicon-valley-to-help-stop-piracy', '', 0, 0, '', 15),
(306, 'news', 'http://www.whitehouse.gov/blog/2012/06/25/help-us-shape-our-strategy-intellectual-property-enforcement', 37, 'Today my office is starting the process of gathering input for the Administration''s new strategy for intellectual property enforcement. The overarching objective of the Strategy is to improve the effectiveness of the U.S. Government''s efforts to protect our intellectual property here and overseas.', 'Help Us Shape Our Strategy for Intellectual Property Enforcement | The White House', 31, 'sopa, white house, ip, federal register notice', 'help-us-shape-our-strategy-for-intellectual-property-enforcement-the-white-house', '', 0, 0, '', 18),
(307, 'news', 'http://www.nytimes.com/2012/07/10/business/media/tech-and-media-elite-are-likely-to-debate-piracy.html?hpw', 37, 'But lately some of the highest-paid executives at the world''s largest media companies have talked a lot about the lessons they learned from a failed industrywide attempt to pass antipiracy legislation six months ago. In January, the technology industry led by Google, Facebook and Wikipedia revolted against two bills called SOPA and PIPA - short for Stop Online Piracy Act and Protect Intellectual Property Act.', 'Tech and Media Executives Are Likely to Debate Piracy', 59, 'sopa, pipa, piracy', 'tech-and-media-executives-are-likely-to-debate-piracy', '', 0, 0, '', 18),
(308, 'news', 'http://techcrunch.com/2012/07/10/sopa-intellectual-property-attache-act/', 37, 'It''s alive! Hollywood darling U.S. Representative Lamar Smith is attempting to reanimate portions of the Stop Online Privacy Act (SOPA) bit by bit. The Intellectual Property Attaché Act, slipped in for consideration over the weekend, revives one of the sneaker portions of SOPA to create a global intellectual property task force, charged with aggressively promoting anti-piracy law around the world.', 'Zombie SOPA? Congressman Introduces Pieces Of Defeated Bill, With Support From Former Opponent Issa', 81, 'sopa, ip, copyright, hollywood', 'zombie-sopa-congressman-introduces-pieces-of-defeated-bill-with-support-from-former-opponent-issa', '', 0, 0, '', 22),
(309, 'primary', 'http://www.law.cornell.edu/uscode/text/17/512', 37, 'Online Copyright Infringement Liability limitation Act, DMCA, § 512 of Title 17 of USC.', 'Limitations on Liability Relating to Material Online', 10, 'sopa, online liability, online material', 'limitations-on-liability-relating-to-material-online', '', 0, 0, '', 18),
(310, 'news', 'http://en.wikipedia.org/wiki/Online_Copyright_Infringement_Liability_Limitation_Act', 41, 'OCILLA is also known as the "safe harbor" provision of the Digital Millennium Copyright Act. It allows service providers the opportunity to create policies that may shield them from copyright infringement claims as long as they adhere to specified guidelines.', 'Overview of the Online Copyright Infringement Liability Limitation Act', 36, 'copyright, ocilla, isp, dmca, safe harbor', 'overview-of-the-online-copyright-infringement-liability-limitation-act', '', 0, 0, '', 17),
(311, 'news', 'http://www.cnn.com/2012/07/31/us/scotus-same-sex-marriage/index.html', 34, 'Washington (CNN) -- Supporters of California''s voter-approved ballot measure banning same-sex marriage in the state asked the U.S. Supreme Court Tuesday to allow it go back into effect. At issue is whether the Constitution''s 14th Amendment guarantee of "equal protection" prevents states from defining marriage as only between one man and one woman.', 'High court asked to accept appeal over California same-sex marriage ban - CNN.com', 91, 'same-sex marriage, supreme court, constitution', 'high-court-asked-to-accept-appeal-over-california-same-sex-marriage-ban-cnncom', '', 0, 0, '', 30),
(312, 'news', 'http://www.businessweek.com/ap/2012-07-27/amazon-ceo-gives-2-dot-5m-for-wash-dot-gay-marriage-law', 34, 'OLYMPIA, Wash. (AP) - Amazon.com founder and CEO Jeff Bezos and his wife, MacKenzie, announced Friday they are donating $2.5 million to the campaign to defend Washington''s same-sex marriage law. With the gift, Washington United for Marriage has raised more than $5 million for its referendum campaign.', 'Amazon CEO gives $2.5M for Wash. gay marriage law', 76, 'same-sex marriage, washington, human rights, amazon', 'amazon-ceo-gives-25m-for-wash-gay-marriage-law', '', 0, 0, '', 16),
(313, 'news', 'http://www.cbs8.com/story/9518991/san-diegos-parking-ticket-hot-spots', 3, 'Parking citations are a multi-million dollar source of income for the City of San Diego. If you''re tired of making contributions, it pays to know where the parking cops write the most tickets. We can tell you the number one spot is not where you''d expect. When you park downtown, if you do the crime, be prepared to pay the fine.', 'San Diego''s Parking Ticket Hot Spots', 81, 'parking, fines', 'san-diegos-parking-ticket-hot-spots', '', 0, 0, 'San Diego', 16),
(314, 'news', 'http://www.utsandiego.com/news/2012/jul/13/does-your-boss-need-pay-your-parking-tickets/', 3, 'Picture this: Your boss sends you out of the office to attend an afternoon meeting with a client at a coffee shop. You get back to your car to drive back to work, and find a parking ticket on your windshield. That''s a good $50 down the drain.', 'Should your boss pay for your parking tickets?', 22, 'parking, employment, fines', 'should-your-boss-pay-for-your-parking-tickets', '', 0, 0, 'San Diego', 16),
(315, 'news', 'http://www.10news.com/news/24174726/detail.html', 3, 'POSTED: 3:05 pm PDT July 7, 2010 SAN DIEGO -- In a typical year in San Diego, the city''s Parking Enforcement division issues nearly 500,000 parking tickets, and those tickets generate a healthy sum for the city -- about $20 million each year in fines and penalties.', '10News Exposes City''s Worst Parking Ticket Offenders', 45, 'parking', '10news-exposes-citys-worst-parking-ticket-offenders', '', 0, 0, 'San Diego', 15),
(316, 'news', 'http://www.metroactive.com/papers/cruz/03.12.98/parking-9810.html', 3, 'Metro Santa Cruz | MetroActive Central | Archives ]Park Avenue Breakdown Robert Scheer A Boot Point: Once the dreaded Denver boot is clamped on a car''s front wheel, the descent into the lower circles of parking hell begins in earnest for ''scofflaws.''', 'MetroActive News & Issues | Parking Tickets', 62, 'parking, booting', 'metroactive-news-issues-parking-tickets', '', 0, 0, 'San Jose', 16),
(317, 'news', 'http://www.sfexaminer.com/local/transportation/2011/01/tow-away-zones-drivers-stuck-intersections-be-focus-parking-crackdown-s', 3, 'San Francisco motorists who park their cars in tow-away zones or stop in the middle of intersections will be targeted by new efforts to earn more money from parking scofflaws. To eliminate a projected $21.2 million budget deficit by June 30, the San Francisco Municipal Transportation Agency plans to reduce employee overtime and write more tickets.', 'Parking ticket crackdown coming for San Francisco drivers', 75, 'parking, budget deficit', 'parking-ticket-crackdown-coming-for-san-francisco-drivers', '', 0, 0, 'San Francisco', 15),
(318, 'news', 'http://www.nbcbayarea.com/news/local/Parking-Tickets-Dont-Count-on-Certain-SF-Hills-125684488.html', 3, 'Dear David, I hope you can answer this question for me. I have lived in North Beach for about 3 years, and have benefited greatly from your book and site. My question is about fighting a ticket based on how it was delivered.', 'Parking Tickets Don''t Count on Certain SF Hills', 56, 'parking, hills', 'parking-tickets-dont-count-on-certain-sf-hills', '', 0, 0, 'San Francisco', 16),
(319, 'news', 'http://www.7x7.com/arts-culture/top-5-parking-citations-issued-sf-2011', 3, 'The numbers have been crunched, and the results are in. The top 5 parking tickets in SF are: 1. Street Cleaning (527,563), 2. Parking Meters (397,449), 3. Residential (169,203), 4. Block Wheels (54,217), and 5. Vehicle Registration (43,439).', 'The Top 5 Parking Citations Issued in SF in 2011', 56, 'parking, fines', 'the-top-5-parking-citations-issued-in-sf-in-2011', '', 0, 0, 'San Francisco', 17),
(320, 'news', 'http://www.nbcbayarea.com/news/local/The-Most-Expensive-Parking-Ticket-in-San-Francisco-134940458.html', 3, 'The most expensive SF parking citations is misuse of a disabled placard, which can cost you $935. There were close to 700 illegal disabled placards confiscated in the first 3 months of the implementation of a program controlling its use. ', 'What is the Most Expensive SF Parking Citation?', 35, 'parking, fines', 'what-is-the-most-expensive-sf-parking-citation', '', 0, 0, 'San Francisco', 19),
(321, 'news', 'http://www.boston.com/whitecoatnotes/2012/07/31/digesting-the-health-care-compromise-bill/JAvFtcwKYPyZCj1g6CWQUI/story.html', 35, 'Lawmakers are expected to vote Tuesday on a 350-page bill that would make Massachusetts the first state to impose limits on how much health care providers can spend on medical costs. It''s a complicated, far-reaching bill. Leaders in the House and Senate prepared summaries of key provisions in the bill.', 'Digesting the Health Care Compromise Bill', 46, 'healthcare reform, massachusetts, health costs', 'digesting-the-health-care-compromise-bill', '', 0, 0, '', 18),
(322, 'news', 'http://money.cnn.com/2012/07/30/news/economy/medicaid-texas-health-care/index.htm?fb_action_ids=3058178273204&fb_action_types=og.recommends&fb_source=other_multiline&action_object_map=%7B%223058178273204%22%3A10151089950418217%7D&action_type_map=%7B%223058178273204%22%3A%22og.recommends%22%7D&action_ref_map=%5B%5D', 35, 'Texas resident Gerard McMahan can''t afford his health care, but also doesn''t qualify for Medicaid. NEW YORK (CNNMoney) -- Texas Governor Rick Perry says he won''t expand Medicaid eligibility under the health reform law because he wants to spare taxpayers billions of dollars.', 'Who covers health care for Texas'' uninsured? Taxpayers', 82, 'healthcare reform, texas, perry, obamacare', 'who-covers-health-care-for-texas-uninsured-taxpayers', '', 0, 0, '', 22),
(323, 'news', 'http://www.huffingtonpost.com/2012/07/24/supreme-court-health-care_n_1698873.html?utm_hp_ref=health-care-law', 35, 'Health care reform will extend health insurance benefits to 3 million fewer people by 2022 as a result of the Supreme Court''s decision in June that states could choose not to expand Medicaid for the poor, according to an analysis published by the Congressional Budget Office Tuesday.', 'Supreme Disappointment: Court Ruling On Health Care Reform Could Deny 3 Million People Insurance', 76, 'healthcare reform, health insurance, medicaid', 'supreme-disappointment-court-ruling-on-health-care-reform-could-deny-3-million-people-insurance', '', 0, 0, '', 22),
(324, 'news', 'http://www.examiner.com/article/obama-s-dream-act-by-fiat-condemned-by-lawmakers-enforcement-agents-1', 36, 'Senator David Vitter (R-LA), a ranking member of the Senate Armed Services Committee, slammed President Barack Obama''s immigration policy changes Sunday during', 'Obama''s Dream Act by fiat condemned by lawmakers, enforcement agents', 67, 'immigration, dream act', 'obamas-dream-act-by-fiat-condemned-by-lawmakers-enforcement-agents', '', 0, 0, '', 19),
(325, 'news', 'http://www.foxnews.com/us/2012/07/17/ariz-immigration-law-opponents-file-new-offensive/', 36, 'Opponents of Arizona''s hardline immigration enforcement law launched a new effort Tuesday aimed at thwarting a U.S. Supreme Court ruling that will allow police to enforce the so-called "show me your papers" provision.', 'Ariz. immigration law opponents file new offensive', 35, 'immigration, arizona, supreme court, unconstitutional', 'ariz-immigration-law-opponents-file-new-offensive', '', 0, 0, '', 18),
(326, 'news', 'http://www.businessweek.com/news/2012-07-29/scalia-rejects-criticism-of-dissent-in-arizona-case', 36, 'U.S. Supreme Court Justice Antonin Scalia rejected criticism that he improperly went outside the court record in his dissent to last term''s decision on Arizona''s immigration law, saying his consideration of presidential remarks was appropriate.', 'Scalia Rebuffs Criticism of Dissent in Immigration Case', 86, 'immigration, arizona, supreme court', 'scalia-rebuffs-criticism-of-dissent-in-immigration-case', '', 0, 0, '', 22),
(328, 'document', 'http://www.seriesseed.com/files/SeriesSeedTermSheet.doc', 40, 'This is an example of a Series Seed Term Sheet.', 'Series Seed Term Sheet', 43, 'term sheet, document', 'series-seed-term-sheet', '', 0, 0, '', 19),
(327, 'secondary', 'http://www.gabrielweinberg.com/blog/2010/06/how-to-learn-about-angelvc-term-sheets.html', 2, 'Every startup entrepreneur should have a good understanding or financing term sheets. First, familiarize yourself with some actual term sheets. Next, go through each term and actually read them. Read this blog post for more information.   ', 'How to Learn About Term Sheets?', 77, 'term sheet', 'how-to-learn-about-term-sheets', '', 0, 0, '', 20),
(329, 'document', 'http://www.ycombinator.com/seriesaa/aa-termsheet.doc', 40, 'This is YC''s Series AA Term sheet. ', 'YC Series AA Termsheet', 21, 'term sheet, document', 'yc-series-aa-termsheet', '', 0, 0, '', 19),
(330, 'primary', 'http://www.investopedia.com/terms/t/termsheet.asp#axzz22FajO8dO', 2, 'A term sheet is not a legally binding contract. It is a good faith contract that sets forth the basic terms and condition under which an investment will be made. ', 'A Term Sheet is Not a Binding Contract', 62, 'term sheet', 'a-term-sheet-is-not-a-binding-contract', '', 0, 0, '', 16),
(331, 'photo', 'http://thumbnails.visually.netdna-cdn.com/startuprollercoaster_4f7065826461f.png', 2, 'IDEA. CODE. DATA.', 'The Lean Startup', 88, 'lean', 'the-lean-startup', '', 0, 0, '', 0),
(332, 'photo', 'http://blog.intuit.com/wp-content/blogs.dir/1/uploads/1.3.12_LLC-590x2303.png', 38, 'Neat infographic on the benefits of an LLCs.', 'What is a LLC?', 96, 'llc, entity, limited liability, tax, management', 'what-is-a-llc', '', 0, 0, '', 10),
(333, 'photo', 'http://assets.gcflearnfree.org/topics/204/infographic_copyright.png', 41, 'All original work is protected under copyright. On the other hand, works in public domain are not protected by copyright and may be used freely. Creative commons is in between. It can be used without permission, but only under certain circumstances. ', 'Difference Between Copyright, Creative Commons, and Public Domain', 82, 'ip, copyright, public domain, creative commons', 'difference-between-copyright-creative-commons-and-public-domain', '', 0, 0, '', 0),
(334, 'document', 'http://www.docracy.com/263/founder-advisor-standard-template', 40, 'Example of an Advisor Agreement that can be tailored to fit your needs.', 'Advisor Agreement', 51, 'advisor, document', 'advisor-agreement', '', 0, 0, '', 27),
(335, 'secondary', 'http://smallbusiness.findlaw.com/incorporation-and-legal-structures/incorporating-in-delaware-is-it-worth-it-for-my-small.html', 38, 'Incorporating in Delaware might not make sense if you plan on keeping your business small. This is because you will still have to pay taxes within your home state, as well as Delaware. Additionally, your business may still have to qualify to do business in your home state.  This is an additional cost. In some instances, your small business may be more protected in your home state. Lastly, you might have to go to court in Delaware for any related legal issues, which can be costly and time consuming. ', 'Is Delaware Really Right for my Business?', 87, 'corporation, delaware, entity', 'is-delaware-really-right-for-my-business', '', 0, 0, '', 35),
(336, 'primary', 'http://bizadvisor.com/LimitedLiabilityCompanyforRealEstate.htm', 38, 'If your business holds real property, you might want to form an LLC instead of a corporation because of its tax benefits. During the sale of company property, a LLC is only exposed to one level of tax, whereas a corporation generates two level of taxes. Further, creditors of members of an LLC cannot get the assets of the LLC and cannot step into the shoes of the member without complying with the LLC Operating Agreement, which usually includes obstacles.', 'LLC is Better for Holding Real Property', 76, 'llc, corporation, real property, entity', 'llc-is-better-for-holding-real-property', '', 0, 0, '', 29),
(337, 'news', 'http://techcrunch.com/2011/09/22/free-startup-docs-how-much-equity-should-advisors-get/', 2, 'Advisors typically receive between 0.10% and 1.00%. The amount is dependent on how much traction your startup has and how much work you expect the advisor to put in. Check out this source for a chart on equity amounts. ', ' How Much Equity Should Advisors Get?', 44, 'advisor', 'how-much-equity-should-advisors-get', '', 0, 0, '', 43),
(338, 'secondary', 'http://www.startupcompanylawyer.com/2009/01/25/what-is-a-certificate-of-incorporation/', 38, 'A certificate of incorporation needs to be filed with the state you are incorporating in. It usually must include the name of the corporation, the business purpose, address of the corporation''s registered agent, number of shares of stock authorized to be issued, and address of the incorporator(s). It might also include provisions that regulate the powers of the corporation, the directors, and stockholders. ', 'What is a Certificate of Incorporation', 39, 'entity, certificate of incorporation, corporation', 'what-is-a-certificate-of-incorporation', '', 0, 0, '', 21),
(339, 'primary', 'http://biztaxlaw.about.com/od/copyrightsandtrademarks/f/whyregistercopyrite.htm', 41, 'Although your work is protected from the moment you create it, you may still want to register a copyright for the following reasons: 1) it creates a public record so others know it''s copyrighted; 2) if you want to sue somebody for violating your copyright, you must register it first; 3) if you take the copyright case to court, you can get greater damages; 4) it allows you to protect your copyright abroad.', 'Why You Should Register a Copyright', 92, 'ip, copyright, register ', 'why-you-should-register-a-copyright', '', 0, 0, '', 39),
(342, 'secondary', 'http://www.investopedia.com/terms/d/double_taxation.asp#axzz22oT7AOCK', 38, 'Money the corporation makes is taxed because corporations are treated as separate entities. Money paid out from the corporation to individuals is taxed as well. This means that the same money is being taxed twice. ', 'What is Double Taxation?', 82, 'corporation, entity, tax', 'what-is-double-taxation', '', 0, 0, '', 32),
(343, 'secondary', 'http://en.wikipedia.org/wiki/Creative_Commons_license', 41, 'A Creative Commons license grants distribution of copyrighted works under some conditions. It is designated by two lower-case "c"s within a circle.  Some licenses include: attribution (must give credit to author), noncommercial (can''t use to make money),  and no derivative works (can''t edit/revise work).', 'What is Creative Commons?', 27, 'creative commons, copyright', 'what-is-creative-commons', '', 0, 0, '', 21),
(347, 'secondary', 'http://www.dca.ca.gov/publications/landlordbook/checklist.pdf', 23, 'Use this move-in checklist to record the current condition of the rental unit, so you don''t end up paying for things you didn''t mess up.', 'Move-in Checklist', 17, 'checklist', 'move-in-checklist', '', 0, 0, '', 25),
(345, 'secondary', 'http://www.dca.ca.gov/publications/landlordbook/sec-deposit.shtml', 23, 'The most common disagreement between landlords and tenants is over the refund of the tenant''s security deposit after the tenant has moved out of the rental unit. California law therefore specifies procedures that the landlord must follow for refunding, using, and accounting for tenants'' security deposits.', 'Everything you Need to Know about Security Deposits', 30, 'security deposit', 'everything-you-need-to-know-about-security-deposits', '', 0, 0, 'California', 39),
(346, 'primary', 'http://law.onecle.com/california/civil/1950.5.html', 23, 'This section applies to security for a rental agreement for residential property that is used as the dwelling of the tenant.', 'California Civil Code Section 1950.5', 12, 'security deposit', 'california-civil-code-section-19505', '', 0, 0, '', 29),
(349, 'secondary', 'http://www.courts.ca.gov/1260.htm', 7, 'There are four types of restraining orders: Domestic Violence; Elder or Dependent Adult Abuse; Civil Harassment; Workplace Violence.', 'Types of Restraining Orders', 46, '', 'types-of-restraining-orders', '', 0, 0, '', 17),
(348, 'secondary', 'http://www.nolo.com/legal-encyclopedia/protect-security-deposit-move-in-30231.html', 23, 'Some ways you can protect your security deposit when you move in include: using a move-in checklist, checking beyond superficial details, and taking picture or video. ', 'Protect Your Security Deposit When you Move In', 19, 'checklist, protect security deposit', 'protect-your-security-deposit-when-you-move-in', '', 0, 0, '', 21),
(350, 'secondary', 'http://www.courts.ca.gov/selfhelp-domesticviolence.htm', 7, 'Domestic violence is abuse or threats of abuse when the person being abused and the abuser are or have been in an intimate relationship (married or domestic partners, are dating or used to date, live or lived together, or have a child together). It is also when the abused person and the abusive person are closely related by blood or by marriage.', 'What is Domestic Violence?', 60, '', 'what-is-domestic-violence', '', 0, 0, '', 19),
(351, 'primary', 'http://law.onecle.com/california/civil-procedure/527.6.html', 7, '"Harassment" is unlawful violence, a credible threat of violence, or a knowing and willful course of conduct directed at a specific person that seriously alarms, annoys, or harasses the person, and that serves no legitimate purpose. The course of conduct must be such as would cause a reasonable person to suffer substantial emotional distress, and must actually cause substantial emotional distress to the petitioner.', 'Definition of Harassment and Types', 26, '', 'definition-of-harassment-and-types', '', 0, 0, '', 19),
(352, 'primary', 'http://law.onecle.com/california/family/6211.html', 7, 'Cal. Fam. Code § 6211.', 'Legal Definition of Domestic Violence', 27, '', 'legal-definition-of-domestic-violence', '', 0, 0, '', 18),
(353, 'primary', 'http://law.onecle.com/california/family/6203.html', 7, 'Abuse: (a)Intentionally or recklessly to cause or attempt to cause bodily injury. (b) Sexual assault. (c) To place a person in reasonable apprehension of imminent serious bodily injury to that person or to another. (d) To engage in any behavior that has been or could be enjoined pursuant to Section 6320.', 'Definition of Abuse', 35, '', 'definition-of-abuse', '', 0, 0, '', 19),
(354, 'primary', 'http://law.onecle.com/california/penal/653m.html', 7, 'Types of harassment that warrant a Civil Harassment restraining order.', 'Types of Harassment', 17, '', 'types-of-harassment', '', 0, 0, '', 19),
(355, 'secondary', 'http://www.nolo.com/dictionary/temporary-restraining-order-(tro)-term.html', 7, 'A Temporary Restraining Order tells one person to stop harassing or harming another. A few days or weeks after it is issued, the court holds a second hearing to determine whether to make the restraining order last longer.', 'What is a Temporary Restraining Order', 46, '', 'what-is-a-temporary-restraining-order', '', 0, 0, '', 16),
(356, 'secondary', 'http://family.findlaw.com/domestic-violence/domestic-violence-orders-of-protection-and-restraining-orders.html', 7, 'There are several available civil options that can provide for the safety of victims of domestic assaults and their families, such as an order of protection, or a judicial ex parte order (also called a restraining order).', 'General Information on Restraining Orders', 44, '', 'general-information-on-restraining-orders', '', 0, 0, '', 19),
(357, 'secondary', 'http://www.womenslaw.org/laws_state_type.php?id=10920&state_code=CA', 7, 'A Domestic Violence Restraining Order (DVRO) is a protective order that is signed by a judge and tells the abuser to stop causing harm to person filing, or face serious legal consequences.  ', 'What is Domestic Violence Restraining Order?', 68, '', 'what-is-domestic-violence-restraining-order', '', 0, 0, '', 20),
(358, 'secondary', 'http://www.womenslaw.org/laws_state_type.php?id=487&state_code=CA', 7, 'A Civil Harassment Restraining Order is a protective order that prevents a person from harassing the person filing. It is used for persons you do not have a relationship with.', 'What is a Civil Harassment Restraining Order?', 66, '', 'what-is-a-civil-harassment-restraining-order', '', 0, 0, '', 19),
(359, 'primary', 'http://scocal.stanford.edu/opinion/granberry-v-islay-investments-31631', 23, 'The case presents issues concerning the extent of recovery available against a landlord in a class action for refund of security deposits withheld in violation of Civil Code section 1950.5.', 'Class Action Against Landlord for Security Deposit', 8, '', 'class-action-against-landlord-for-security-deposit', '', 0, 0, '', 24),
(360, 'primary', 'http://www.courts.ca.gov/1049.htm', 23, 'The security deposit serves to protect the landlord if the tenant breaks or violates the terms of the lease or rental agreement. It may be used to cover damage to the property, cleaning, key replacement, or back rent. For an unfurnished apartment, it can only be two times the monthly rent. For a furnished apartment, it can be three times the monthly rent. ', 'Rules on Security Deposits', 23, '', 'rules-on-security-deposits', '', 0, 0, '', 29),
