(392, 'secondary', 'http://www.uscis.gov/portal/site/uscis/menuitem.eb1d4c2a3e5b9ac89243c6a7543f6d1a/?vgnextoid=f2ef2f19470f7310VgnVCM100000082ca60aRCRD&vgnextchannel=f2ef2f19470f7310VgnVCM100000082ca60aRCRD', 19, 'The U.S. government can choose to deport illegal aliens or not. On June 15, 2012, the U.S. Department of Homeland Security announced that it would no longer deport certain undocumented youth for at least 2 years. This is called deferred action and was outlined in a memo from Janel Napolitano, the Secretary of Homeland Security. To be eligible, individuals must satisfy several conditions. If all conditions are satisfied, the individuals may apply for deferred action. Deferred action only last for 2 years, at which point the individual may apply for renewal. Individuals that receive deferred action may apply for employment authorization.   ', 'What is Deferred Action?', 35, '', 'what-is-deferred-action', '', 0, 0, '', 14),
(393, 'primary', 'http://www.dhs.gov/xlibrary/assets/s1-exercising-prosecutorial-discretion-individuals-who-came-to-us-as-children.pdf', 19, '', 'Memo Outlining Deferred Action', 12, '', 'memo-outlining-deferred-action', '', 0, 0, '', 12),
(394, 'secondary', 'http://www.nilc.org/FAQdeferredactionyouth.html', 19, '', 'Deferred Action FAQ', 24, '', 'deferred-action-faq', '', 0, 0, '', 12),
(395, 'secondary', 'http://www.immigrationpolicy.org/just-facts/deferred-action-childhood-arrivals-qa-guide-updated', 19, '', 'Deferred Action Q&A Guide', 18, '', 'deferred-action-qa-guide', '', 0, 0, '', 12),
(396, 'secondary', 'http://dui.drivinglaws.org/texas.php ', 24, 'Penalties are determined by a number of factors including prior convictions, minor passengers, BAC level, and injury. For a first DWI offense in Texas, a person may face 3 days to 6 months in jail, a fine up to $2000, and a license suspension between 90 days to 365 days. ', 'DUI Penalties ', 30, 'penalties, priors, refusal, bac, license ', 'dui-penalties', '', 0, 0, 'Texas', 0),
(397, 'primary', 'http://blog.austindefense.com/2006/09/articles/other-texas-statutes/driving-while-license-suspended-invalid-texas-transportation-code-section-521457/ ', 24, 'Driving without a valid driver''s license is a misdemeanor in Texas. A fine between $100 to $500 and a jail sentence between 72 hours and 6 months. ', 'Driving Without a License ', 7, 'license, misdemeanor ', 'driving-without-a-license', '', 0, 0, 'Texas', 0),
(398, 'primary', 'http://law.onecle.com/texas/penal/49.045.00.html ', 24, 'In Texas, if you are driving with a passenger under the age of 15 during your DWI, you may be charged with a state jail felony in Texas. A state jail felony carries a sentence between 180 days and 2 years and a fine up to $10,000.', 'Enhanced Penalty for Passenger Under 15 ', 10, 'penalties, child passenger, felony ', 'enhanced-penalty-for-passenger-under-15', '', 0, 0, 'Texas', 24),
(399, 'primary', 'http://www.criminallawyerdenton.com/article-dui-child-endangerment.aspx ', 24, 'A DWI with a passenger under the age of 15 is a state jail felony in Texas. A state jail felony carries a sentence between 180 days and 2 years and a fine up to $10,000. Further, child endangerment may be charged as a separate offense from DWI. It involves placing a child in a hazardous or inappropriate situation. ', 'Was There a Child Under 15 in the Car?', 18, 'penalties, child passenger, felony ', 'was-there-a-child-under-15-in-the-car', '', 0, 0, 'Texas', 24),
(400, 'primary', 'http://law.onecle.com/texas/penal/12.35.00.html ', 24, 'A state jail felony carries a sentence between 180 days and 2 years and a fine up to $10,000.', 'Passenger Under 15 is a State Jail Felony', 5, 'penalties, child passenger, felony ', 'passenger-under-15-is-a-state-jail-felony', '', 0, 0, 'Texas', 12),
(401, 'primary', 'http://law.onecle.com/texas/penal/49.07.00.html ', 24, 'A DUI with injury may be charged as Intoxication Assault,  which is a third degree felony for the first conviction. The injury must be serious, such that it creates a substantial risk of death or that causes serious permanent disfigurement or loss of the function of a body part or organ. You may receive 2 to 10 years of jail time and a fine up to $10,000. If someone died from the accident, the penalties may be harsher.', 'DUI Accidents and Injury ', 21, 'injury, felony, penalties ', 'dui-accidents-and-injury', '', 0, 0, 'Texas', 0),
(402, 'primary', 'http://www.statutes.legis.state.tx.us/Docs/PE/htm/PE.12.htm ', 24, 'Check out different penalties for class A, B, and C misdemeanors, capital felonies, first, second, and third degree felonies, and state jail felonies.\n<br/><br/>\nSec. 12.21.  CLASS A MISDEMEANOR\n(1)  a fine not to exceed $4,000;\n(2)  confinement in jail for a term not to exceed one year;  or\n(3)  both such fine and confinement.\n<br/><br/>\nSec. 12.22.  CLASS B MISDEMEANOR\n(1)  a fine not to exceed $2,000;\n(2)  confinement in jail for a term not to exceed 180 days;  or\n(3)  both such fine and confinement.\n<br/><br/>\nSec. 12.23.  CLASS C MISDEMEANOR.  An individual adjudged guilty of a Class C misdemeanor shall be punished by a fine not to exceed $500.', 'Penal Code Punishments for Misdemeanors', 20, 'misdemeanor, felony, penalties ', 'penal-code-punishments-for-misdemeanors', '', 0, 0, 'Texas', 11),
(403, 'primary', 'http://law.onecle.com/texas/penal/49.08.00.html ', 24, 'A DWI where someone was killed may be charged as Intoxication Manslaughter, which is a second degree felony. A person convicted of a second degree felony may face 2 to 20 years in jail and a fine up to $10,000. ', 'Was Someone Killed in a Accident?', 5, 'injury, felony, penalties ', 'was-someone-killed-in-a-accident', '', 0, 0, 'Texas', 12),
(404, 'secondary', 'http://www.texasdwilaw.com/dwi_cg2.html ', 24, 'The preliminary breath test (PBT) is a handheld breathalyzer administered to help determine whether the officer has probable cause to arrest you. However, the test results cannot be used against you in criminal or administrative proceedings. In fact you are not obligated to take the test if asked. See the answer to question 10 for more information.', 'The Handheld Breathalyzer', 22, 'evidence, breath test, refusal', 'the-handheld-breathalyzer', '', 0, 0, 'Texas', 12),
(405, 'secondary', 'http://www.timpowers.com/dentonCriminalDefense/2011/dwi-denton-county-refusal-of-the-portable-breath-test.html ', 24, 'The preliminary breath test (PBT) is a handheld breathalyzer administered to help determine whether the officer has probable cause to arrest you. It is not approved by Texas Department of Public Safety for use in court.  Moreover, the vast majority of the scientific community have  recognized PBTs as being inaccurate or unreliable devices.  You are not obligated to take a PBT and refusing will not result in a penalty. ', 'Do you Have to Take the Handheld Breathalyzer?', 23, 'evidence, breath test, refusal ]', 'do-you-have-to-take-the-handheld-breathalyzer', '', 0, 0, 'Texas', 48),
(406, 'primary', 'http://law.onecle.com/texas/transportation/724.035.00.html ', 24, 'Automatic penalties may be imposed for refusing a chemical test (blood or breath), such as a 180 day license suspension for the first conviction. This is because implied consent laws demand that you submit to testing or face the consequences.', 'Penalty for Refusing the Chemical Test', 23, 'penalties, refusal, breath test, blood test, implied consent', 'penalty-for-refusing-the-chemical-test', '', 0, 0, 'Texas', 12),
(407, 'secondary', 'http://dui.drivinglaws.org/resources/dui-refusal-blood-breath-urine-test/texas.htm ', 24, 'Texas implied consent laws require that you take a chemical test, either blood or breath, if you are arrested for drunk driving. If you refuse, a license suspension of at least 180 days may be imposed. Generally you cannot be forced to take a chemical test, but there are certain exceptions.', 'What Happens if You Refuse the Breathalyzer? ', 31, 'penalties, refusal, breath test, blood test, implied consent ', 'what-happens-if-you-refuse-the-breathalyzer', '', 0, 0, 'Texas', 24),
(408, 'primary', 'http://law.onecle.com/texas/transportation/724.011.00.html ', 24, 'If you are arrested for a drunk driving offense, you are required by statute to take a blood or breath test. Just by driving you have given your consent. This is codified in Texas''s implied consent laws.', 'Implied Consent Laws', 16, 'breath test, blood test, implied consent ', 'implied-consent-laws', '', 0, 0, 'Texas', 0),
(409, 'primary', 'http://www.statutes.legis.state.tx.us/Docs/PE/htm/PE.49.htm', 24, 'If you have a BAC of 0.15% or higher, a DWI may be charged as a class A misdemeanor for the first offense. A class A misdemeanor imposes a jail sentence up to 1 year and a fine up to $4000. See Section 49.04(d).', 'Penalty for a BAC of 0.15% or Higher', 20, 'penalties, bac, misdemeanor', 'penalty-for-a-bac-of-015-or-higher', '', 0, 0, 'Texas', 12),
(410, 'secondary', 'http://coferlaw.com/criminal-trial-law/dwi/breath-test-machine/2011-0-15-bacdwi-law/ ', 24, 'A first DWI  may be charged as a Class A Misdemeanor (up to 1 year in jail and $4000 fine) if the person driving had a blood alcohol concentration (BAC) of 0.15% or higher at the time the chemical test is performed. This new DWI law was added by House Bill 1199, which amended Penal Code Section 49.04 by adding a section. Essentially this means that on a person’s very first offense (with no other criminal history) he or she can be looking at a year in jail.', 'Was your BAC 0.15% or Higher?', 28, 'penalties, bac, misdemeanor', 'was-your-bac-015-or-higher', '', 0, 0, 'Texas', 0),
(411, 'primary', 'http://dwi.austindefense.com/2006/10/articles/texas-dwi-laws/alr-hearing-request-texas-transportation-code-section-524031/ ', 24, 'You have 15 days from the date of arrest to request a administrative license revocation hearing  to fight a possible license suspension. The request must be sent to the Texas Department of Public Safety. ', '15 Day Deadline to Request a DMV Hearing ', 25, 'dmv, license ', '15-day-deadline-to-request-a-dmv-hearing', '', 0, 0, 'Texas', 24),
(412, 'secondary', 'http://www.scheinerlaw.com/Houston-DWI-15-day-deadline.shtml ', 24, 'You have 15 days from the date of your arrest to send a request for a hearing to the Texas Department of Public Safety. At this hearing you can challenge your license suspension.', 'You Have 15 Days to Request a DMV Hearing', 32, 'dmv, license ', 'you-have-15-days-to-request-a-dmv-hearing', '', 0, 0, 'Texas', 24),
(413, 'secondary', 'http://www.davidhunterlawfirm.com/practice-areas/texas-dui-penalties ', 24, 'Drivers under the age of 21 may be convicted of DUI even though they do not meet the legal standard for DWI. Any detectable amount of alcohol may be sufficient to charge DUI, since it is illegal for someone under 21 to be drinking in the first place. A first DUI carries a fine up to $500, community service for 20 to 40 hours, and a 60 day license suspension. ', 'Under 21 DUI/DWI', 27, 'under 21, penalties ', 'under-21-duidwi', '', 0, 0, 'Texas', 12);
INSERT INTO `links` (`id`, `type`, `url`, `category`, `summary`, `title`, `votes`, `tags`, `slug`, `source`, `poster`, `date_created`, `location`, `views`) VALUES
(414, 'secondary', 'http://www.texascriminalattorneyblog.com/intoxication_offenses/dui/dwi_vs_duiwhat_is_the_differen/ ', 24, 'The main difference between a DUI and DWI in Texas is that a DUI is only available to someone under the age of 21. A person under 21 will be charged with a DUI if he or she has a BAC under 0.08%. Otherwise that person will be charged with a DWI and face the same consequences as an adult. A DWI imposes a harsher sentence than a DUI. However, it is easier to be convicted of a DUI because all that is necessary is that the officer detected some amount of alcohol.', 'What''s the Difference Between a DUI and DWI ', 28, 'under 21, penalties', 'whats-the-difference-between-a-dui-and-dwi', '', 0, 0, 'Texas', 12),
(415, 'primary', 'http://www.statutes.legis.state.tx.us/Docs/PE/htm/PE.49.htm ', 24, 'A DUI may be charged as a class B misdemeanor if an open container of alcohol was found in the car. You may face 6 to 180 days in jail and a fine up to $2000 for a first conviction. See Texas Penal Code § 49.04(c) for more information. ', 'Did you Have an Open Container in the Car?', 23, 'penalties, open container, misdemeanor', 'did-you-have-an-open-container-in-the-car', '', 0, 0, 'Texas', 12),
(416, 'secondary', 'http://dui.drivinglaws.org/florida.php ', 25, 'Penalties are determined by a number of factors including prior convictions, minor passengers, BAC level, and injury. For a first DUI offense in Florida, a person may up to 6 months in jail, a fine between $500 and $1000, and a license suspension between 180 days to 1 year.', 'DUI Penalties for First, Second, and Third Conviction', 28, 'penalties, priors, refusal, bac, license', 'dui-penalties-for-first-second-and-third-conviction', '', 0, 0, 'Florida', 12),
(417, 'secondary', 'http://www.flhsmv.gov/ddl/duilaws.html ', 25, 'For a first DUI offense in Florida, a person may up to 6 months in jail, a fine between $500 and $1000, and a license suspension between 180 days to 1 year. If the person had a passenger under the age 18 or a  BAC of 0.15% or greater, then fines are doubled and jail time is increased. A DUI charge is usually a misdemeanor, but may become a felony if someone was seriously injured or if it is the person''s third DUI in the past 10 years. ', 'Overview of All DUI Penalties', 33, 'penalties, priors, refusal, license, bac ', 'overview-of-all-dui-penalties', '', 0, 0, 'Florida', 13),
(418, 'primary', 'http://leg.state.fl.us/Statutes/index.cfm?App_mode=Display_Statute&Search_String=&URL=0300-0399/0316/Sections/0316.193.html ', 25, 'Florida DUI penalties and enhancements are codified under section 316.193. See § 316.193(4) for passenger under the age of 18 enhancement.', 'Florida DUI Statute', 7, 'penalties, priors, child passenger, injury', 'florida-dui-statute', '', 0, 0, 'Florida', 12),
(419, 'secondary', 'http://myduiflorida.blogspot.com/2011/02/enhanced-florida-dui-penalties-bac-15.html ', 25, 'You may face enhanced penalties for a DUI with a passenger under the age of 18. For the first conviction, you may face up to 9 month of jail time and a fine between $1000 and $2000. See § 316.193(4) for more information.', 'Was There a Passenger Under 18 in the Car? ', 18, 'penalties, child passenger ', 'was-there-a-passenger-under-18-in-the-car', '', 0, 0, 'Florida', 12),
(420, 'secondary', 'http://www.criminaldefenseattorneytampa.com/PracticeAreas/DrivingUndertheInfluenceDUI/DUIRoadblock.aspx ', 25, 'DUI checkpoints must follow written, detailed guidelines and procedures that officers are to follow at the roadblock, including selection of vehicles, detention techniques, duty assignments, and the disposition of vehicles. Failure to do so is a violation of the Fourth Amendments protection against unreasonable seizures and searches.', 'Were You Stopped at a DUI Checkpoint?', 26, 'checkpoints, constitution ', 'were-you-stopped-at-a-dui-checkpoint', '', 0, 0, 'Florida', 12),
(421, 'primary', 'http://clearwaterattorneyduilawer.com/guy-state-florida-993-so2d-77-2008 ', 25, 'The Second Court of Appeals for Florida found that police must follow strict guidelines when they set up a dui checkpoint. They must also follow those guidelines closely.', 'Police Must Follow Rules at Checkpoints ', 4, 'checkpoints, constitution', 'police-must-follow-rules-at-checkpoints', '', 0, 0, 'Florida', 12),
(422, 'primary', 'http://law.onecle.com/florida/crimes/775.082.html', 25, 'Jail time for felonies and misdemeanors.\n<br/><br/>\nFELONY\n<br/><br/>\n(b)  For a felony of the first degree, by a term of imprisonment not exceeding 30 years or, when specifically provided by statute, by imprisonment for a term of years not exceeding life imprisonment.\n<br/>\n(c)  For a felony of the second degree, by a term of imprisonment not exceeding 15 years.\n<br/>\n(d)  For a felony of the third degree, by a term of imprisonment not exceeding 5 years.\n<br/><br/>\nMISDEMEANOR\n<br/>\n(a)  For a misdemeanor of the first degree, by a definite term of imprisonment not exceeding 1 year;\n<br/>\n(b)  For a misdemeanor of the second degree, by a definite term of imprisonment not exceeding 60 days.', 'Schedule of Jail Time', 11, 'penalties, felony, misdemeanor ', 'schedule-of-jail-time', '', 0, 0, 'Florida', 11),
(423, 'primary', 'http://law.onecle.com/florida/crimes/775.083.html ', 25, 'Fines for felonies and misdemeanors.\n<br/><br/>\n(a)  $15,000, when the conviction is of a life felony.\n<br/>\n(b)  $10,000, when the conviction is of a felony of the first or second degree.\n<br/>\n(c)  $5,000, when the conviction is of a felony of the third degree.\n<br/>\n(d)  $1,000, when the conviction is of a misdemeanor of the first degree.\n<br/>\n(e)  $500, when the conviction is of a misdemeanor of the second degree or a noncriminal violation.\n', 'Schedule of Fines', 14, 'penalties, felony, misdemeanor  ', 'schedule-of-fines', '', 0, 0, 'Florida', 12),
(424, 'primary', 'http://www.flsenate.gov/laws/statutes/2011/316.1933 ', 25, 'A DUI with serious bodily injury is a felony of the third degree, which carries a possible jail sentence up to 5 years and a fine up to $5000. Serious bodily injury include substantial risk of death, serious personal disfigurement, or loss or impairment of bodily function or organ. See 316.193(3)(b) for more information.', 'Definition of Serious Bodily Injury ', 13, 'injury, felony, penalties ', 'definition-of-serious-bodily-injury', '', 0, 0, 'Florida', 11),
(425, 'secondary', 'http://www.criminaldefenseattorneytampa.com/PracticeAreas/DrivingUndertheInfluenceDUI/FelonyDUISeriousBodilyInjury.aspx ', 25, 'A DUI with injury is a misdemeanor of the first degree, which carries a possible jail sentence up to 1 year and a fine up to $1000. A DUI with serious bodily injury is a felony of the third degree, which carries a possible jail sentence up to 5 years and a fine up to $5000. Serious bodily injury include substantial risk of death, serious personal disfigurement, or loss or impairment of bodily functions. ', 'Was Someone Injured in a Accident? ', 19, 'injury, felony, penalties, misdemeanor ', 'was-someone-injured-in-a-accident', '', 0, 0, 'Florida', 36),
(426, 'secondary', 'http://www.duiattorneystampabay.com/DUI/DUI_Testing/Roadside_Breath_Testing.aspx ', 25, 'In Florida, you most likely have the right to refuse a handheld breath test, provided you are over the age of 21 and are not currently on probation for a previous DUI conviction.', 'Do you Have to Take the Handheld Breathalyzer? ', 24, 'evidence, breath test, refusal ', 'do-you-have-to-take-the-handheld-breathalyzer', '', 0, 0, 'Florida', 0),
(427, 'primary', 'http://law.onecle.com/florida/motor-vehicles/316.1939.html ', 25, 'Automatic penalties may be imposed for refusing a chemical test, such as a 1 year license suspension for the first conviction. This is because implied consent laws demand that you submit to testing or face the consequences.\n', 'Penalties for Refusing the Chemical Test ', 21, 'penalties, refusal, breath test, misdemeanor, implied consent ', 'penalties-for-refusing-the-chemical-test', '', 0, 0, 'Florida', 12),
(428, 'secondary', 'http://www.criminaldefenseattorneytampa.com/PracticeAreas/DrivingUndertheInfluenceDUI/DUIRefusaltoSubmittoTesting.aspx ', 25, 'You are required to take a chemical test (blood or breath) if you are arrested for drunk driving. If you refuse a second time, you can be charged with a separate misdemeanor of the first degree for the first offense. A misdemeanor of the first degree carries up to 1 year of jail time and a fine up to $1000. ', 'What Happens if You Refuse the Breathalyzer ', 30, 'penalties, refusal, breath test, misdemeanor, implied consent ', 'what-happens-if-you-refuse-the-breathalyzer', '', 0, 0, 'Florida', 0),
(429, 'primary', 'http://law.onecle.com/florida/motor-vehicles/316.1932.html ', 25, 'If you are arrested for a drunk driving offense, you are required by statute to take a blood or breath test. Just by driving you have given your consent. This is codified in Florida''s implied consent laws. Your license may be suspended for 1 year for the first refusal. ', 'Implied Consent Laws ', 16, 'implied consent, license, penalties', 'implied-consent-laws', '', 0, 0, 'Florida', 0),
(430, 'primary', 'http://leg.state.fl.us/Statutes/index.cfm?App_mode=Display_Statute&Search_String=&URL=0300-0399/0316/Sections/0316.193.html ', 25, 'You may face enhanced penalties for a DUI where your BAC was 0.15% or higher. For the first conviction, you may face up to 9 month of jail time and a fine between $1000 and $2000. See 316.193(4) for more information.', 'Was your BAC 0.15% or Higher?', 27, 'penalties, bac', 'was-your-bac-015-or-higher', '', 0, 0, 'Florida', 0),
(431, 'secondary', 'http://www.criminalattorneystpetersburg.com/DefenseLawyer/DUIDrunkDriving/DMVAdministrativeReviewHearing.aspx ', 25, 'You have 10 days from the date of your arrest to send a request for a DMV Administrative Review hearing to can challenge your license suspension. You must make the request in writing. ', 'You Have 10 Days to Request a DMV Hearing ', 27, 'dmv, license', 'you-have-10-days-to-request-a-dmv-hearing', '', 0, 0, 'Florida', 0),
(432, 'primary', 'http://law.onecle.com/florida/motor-vehicles/322.2615.html ', 25, 'You have 10 days from the date of arrest to request a administrative license revocation hearing  to fight a possible license suspension.', '10 Day Deadline to Request a DMV Hearing', 27, 'dmv, license ', '10-day-deadline-to-request-a-dmv-hearing', '', 0, 0, 'Florida', 12),
(433, 'primary', 'http://law.onecle.com/florida/motor-vehicles/322.2616.html ', 25, 'A person under the age of 21 driving with a BAC level at or above 0.02% will face an administrative suspension for 180 days for the first conviction. If the person''s BAC is 0.08% of higher he or she may face criminal penalties.', 'Under 21 DUI ', 20, 'under 21, penalties ', 'under-21-dui', '', 0, 0, 'Florida', 0),
(434, 'secondary', 'http://www.lawyersclearwaterfl.com/underage-dui-charges-in-florida-what-02-really-means ', 25, 'Florida has a "zero tolerance" policy when it comes to underage drinking and driving. A person under the age of 21 driving with a BAC level at or above 0.02% will face an administrative suspension for 180 days for the first conviction. If the person''s BAC is 0.08% of higher he or she may face criminal penalties similar to what an adult would face. ', 'Were You Under 21 When You Were Arrest?', 24, 'under 21, penalties ', 'were-you-under-21-when-you-were-arrest', '', 0, 0, 'Florida', 12),
(435, 'secondary', 'http://www.thedensonfirm.com/when-is-a-dui-a-felony.html ', 25, 'A DUI may be charged as a felony when: there is serious bodily injury caused by an accident, it is your third DUI in the past 10 years, or it is your fourth DUI ever.', 'When Your DUI Becomes a Felony', 20, 'penalties, felony, priors, injury ', 'when-your-dui-becomes-a-felony', '', 0, 0, 'Florida', 12),
(436, 'secondary', 'http://dui.drivinglaws.org/pa-dui.php ', 26, 'Pennsylvania has a series of penalty tiers depending on the person''s BAC, with high BACs imposing harsher punishments. For a first DUI offense with a BAC between 0.08% and 0.099%, a person may face a fine between up to $300.  For a BAC between 0.10% and 0.159%, a person may face 2 to 6 days, a fine between $500 and $5000, and a 1 year license suspension. ', 'DUI Penalties Overview ', 27, 'penalties, bac, license, priors, refusal ', 'dui-penalties-overview', '', 0, 0, 'Pennsylvania', 12),
(437, 'secondary', 'http://www.dmv.state.pa.us/legislation/dui.shtml ', 26, 'A DUI is typically a misdemeanor offense, unless someone was seriously injured or killed, at which point it may be charged as a felony. Penalties are heavily dependent on BAC level and number of priors. For example, a first DUI offense with a BAC between 0.08% and 0.099%, a person may face a fine between up to $300.  For a BAC between 0.10% and 0.159%, a person may face 2 to 6 days, a fine between $500 and $5000, and a 1 year license suspension.', 'Chart of DUI Penalties for First, Second, and Third offense', 33, 'penalties, bac, license, priors ', 'chart-of-dui-penalties-for-first-second-and-third-offense', '', 0, 0, 'Pennsylvania', 12),
(438, 'primary', 'http://law.onecle.com/pennsylvania/vehicles/00.038.004.000.html', 26, 'The penalties for DUI are outlined in  § 3804 in Pennsylvania. It includes penalties for General impairment, High rate of blood alcohol, and highest blood alcohol.', 'DUI Penalties Statute', 14, 'penalties, bac, license, priors ', 'dui-penalties-statute', '', 0, 0, 'Pennsylvania', 12),
(439, 'primary', 'http://law.onecle.com/pennsylvania/vehicles/00.015.043.000.html ', 26, 'If you were driving with a suspended or revoked license due to a prior DUI, you may face a jail sentence of 90 days or more and a fine of $1000 for the first violation.', 'Were you Driving with a Suspended License? ', 11, 'penalties, license ', 'were-you-driving-with-a-suspended-license', '', 0, 0, 'Pennsylvania', 12),
(440, 'secondary', 'http://mvwlaw.com/blog/category/dui/dui-with-a-child-in-the-vehicle/ ', 26, 'You may face enhanced penalties for a DUI with a passenger under the age of 18.', 'Was There a Child Under 18 in the Car?', 23, 'penalties, child passenger ', 'was-there-a-child-under-18-in-the-car', '', 0, 0, 'Pennsylvania', 12),
(441, 'secondary', 'http://www.rgsglaw.com/blog/2011/03/pennsylvania-sobriety-checkpoints-must-follow-specific-rules.shtml ', 26, 'The following are some, but not all, of the guidelines police must follow at a DUI checkpoint: 1) stops must be quick and there can be no physical search, 2) there must be warning of the checkpoint. 3) checkpoints must be approved and not randomly set up by police whenever they feel like it, 4) the checkpoint must be in an area where there are likely to be drunk drivers, and 5) there must be a fixed formula used to determine which drivers to stop, cops can''t decide randomly. ', 'Were You Stopped at a Checkpoint?', 26, 'checkpoints, constitution', 'were-you-stopped-at-a-checkpoint', '', 0, 0, 'Pennsylvania', 12),
(442, 'primary', 'http://law.onecle.com/pennsylvania/vehicles/00.038.003.000.html ', 26, 'A DUI with injury is a misdemeanor, which carries a possible jail sentence 48 hours and 180 days and a fine between $500 and $5000 for the first conviction. For a second conviction, the person faces a possible jail sentence between 30 days and 6 months and a fine between $750 and $5000. See § 3803(b) for more information. ', 'Was Someone Injured in a Accident?', 22, 'penalties, injury ', 'was-someone-injured-in-a-accident', '', 0, 0, 'Pennsylvania', 0),
(443, 'primary', 'http://law.onecle.com/pennsylvania/vehicles/00.038.004.000.html ', 26, 'A DUI with injury is a misdemeanor, which carries a possible jail sentence 48 hours and 180 days and a fine between $500 and $5000 for the first conviction. For a second conviction, the person faces a possible jail sentence between 30 days and 6 months and a fine between $750 and $5000. See  § 3804(b) for more information.', 'DUI with Injury: Second or Third Time', 22, 'penalties, injury ', 'dui-with-injury-second-or-third-time', '', 0, 0, 'Pennsylvania', 12),
(444, 'secondary', 'http://www.pennduidefense.com/lawyer-attorney-1633471.html ', 26, 'In Pennsylvania, you most likely not obligated to take a preliminary breath test (PBT) and will not lose your license if you refuse. PBT results are not allowed to be used in trial and are only used to help an officer determine whether or not there is probable cause to make a DUI arrest.', 'Do You Have to Take the Handheld Breathalyzer? ', 25, 'evidence, breath test, refusal ', 'do-you-have-to-take-the-handheld-breathalyzer', '', 0, 0, 'Pennsylvania', 0),
(445, 'primary', 'http://caselaw.findlaw.com/pa-superior-court/1426314.html ', 26, 'The result of the preliminary breath test (PBT) cannot be used in court. This was the holding in COMMONWEALTH v. MARSHALL.', 'Case Finding That Handheld Breathalyzer Result Can''t be Used in Court', 4, 'evidence, breath test, refusal', 'case-finding-that-handheld-breathalyzer-result-cant-be-used-in-court', '', 0, 0, 'Pennsylvania', 12),
(446, 'secondary', 'http://www.pennsylvaniaduilawyers.com/Refusal.html ', 26, 'Automatic penalties may be imposed for refusing a chemical test, such as 72 hours to 180 days in jail, a fine up between $1000 to $5000, and 1 year license suspension for the first conviction. This is because implied consent laws demand that you submit to testing or face the consequences.', 'What Happens if You Refuse the Breath Test', 33, 'penalties, refusal, breath test, license, implied consent', 'what-happens-if-you-refuse-the-breath-test', '', 0, 0, 'Pennsylvania', 24),
(447, 'secondary', 'http://dui.drivinglaws.org/resources/dui-refusal-blood-breath-urine-test/pennsylvania.htm ', 26, 'If you are arrested for a drunk driving offense, you are required by statute to take a blood or breath test. Just by driving you have given your consent. This is codified in Pennsylvania''s implied consent laws. Your license may be suspended for 1 year for the first refusal.', 'Why Do you Have to Take the Breath Test?', 28, 'penalties, refusal, breath test, license, implied consent ', 'why-do-you-have-to-take-the-breath-test', '', 0, 0, 'Pennsylvania', 12),
(448, 'primary', 'http://law.onecle.com/pennsylvania/vehicles/00.015.047.000.html ', 26, 'Your license may be suspended for 1 year for refusing to take a chemical test (blood or breath). See § 1547(b) for more information.', '1 Year License Suspension for First Refusal', 15, 'penalties, refusal, breath test, license ', '1-year-license-suspension-for-first-refusal', '', 0, 0, 'Pennsylvania', 12),
(449, 'primary', 'http://law.onecle.com/pennsylvania/vehicles/00.038.003.000.html ', 26, 'For your first refusal, you may face up to 180 days in jail. See § 3803(b)(2) for more information.', 'Misdemeanor for First Refusal', 10, 'penalties, refusal, breath test, misdemeanor', 'misdemeanor-for-first-refusal', '', 0, 0, 'Pennsylvania', 12),
(450, 'primary', 'http://law.onecle.com/pennsylvania/vehicles/00.038.002.000.html ', 26, 'Pennsylvania has a BAC tier system in determining penalty severity. A BAC at least 0.08% but less than 0.10% is considered general impairment. A BAC at least 0.10% but less than 0.16% is a high BAC. Lastly, a BAC 0.16% or higher is considered highest BAC and warrants the harshest penalties.  See § 3802(a)-(c) for more information.', 'Your BAC Level Determines Your Punishment', 31, 'penalties, bac ', 'your-bac-level-determines-your-punishment', '', 0, 0, 'Pennsylvania', 12),
(451, 'secondary', 'http://www.statecollegelawyers.com/Criminal-Defense-Overview/DUI-and-DAI/DUI-Related-License-Suspension.shtml', 26, 'You have 30 days from the date of arrest to request an administrative hearing in order to fight a possible license suspension. The license suspension case is different from the criminal DUI case. ', 'You Have 30 Days to Request a DMV Hearing ', 32, 'dmv, license ', 'you-have-30-days-to-request-a-dmv-hearing', '', 0, 0, 'Pennsylvania', 12),
(452, 'secondary', 'http://palkovitzlaw.com/dui_dwi/faqs.html ', 26, 'You have 30 days from the date of arrest to request a DMV hearing in order to fight a possible license suspension. See "PennDot Case" for more information on the administrative license suspension process.\n', '30 Day Deadline to Request a DMV Hearing', 11, 'dmv, license ', '30-day-deadline-to-request-a-dmv-hearing', '', 0, 0, 'Pennsylvania', 12),
(453, 'primary', 'http://law.onecle.com/pennsylvania/vehicles/00.038.004.000.html ', 26, 'A person under the age of 21 driving with a BAC level at or above 0.02% may face a jail sentence between 48 hours and 180 days, a fine between $500 and $5000, and an administrative license suspension for the first conviction. See § 3804(b) for more information.\n', 'Penalties for Under 21 DUI', 17, 'penalties, under 21 ', 'penalties-for-under-21-dui', '', 0, 0, 'Pennsylvania', 12),
(454, 'secondary', 'http://www.pittsburghduis.com/underage-dui.htm ', 26, 'A person under the age of 21 driving with a BAC level at or above 0.02% may face a jail sentence between 48 hours and 180 days, a fine between $500 and $5000, and an administrative license suspension for the first conviction.', 'Under 21 DUI', 23, 'penalties, under 21, bac ', 'under-21-dui', '', 0, 0, 'Pennsylvania', 0),
(455, 'primary', 'http://law.onecle.com/pennsylvania/vehicles/00.038.002.000.html ', 26, 'A person under 21 cannot have a BAC of 0.02% or above. Basically this is a "zero tolerance" standard. See § 3802(e) for more information. ', 'Underage 0.02% Limit', 5, 'under 21, bac ', 'underage-002-limit', '', 0, 0, 'Pennsylvania', 12),
(456, 'secondary', 'http://dui.drivinglaws.org/arizona.php', 27, 'Penalties are determined by a number of factors including prior convictions, minor passengers, BAC level, and injury. For a first DUI offense in Arizona a person may face 24 hours  to 10 days in jail, a fine up to $1500, and a license suspension between 90 days to 1 year.', 'DUI Penalties', 24, 'penalties, priors, refusal, bac, license', 'dui-penalties', '', 0, 0, 'Arizona', 0),
(457, 'secondary', 'http://www.maasenlaw.com/information/dui_penalties.asp ', 27, 'If you were arrested with a BAC of 0.15% or higher, you may be charged with an Extreme DUI. An Extreme DUI carries harsher penalties than regular DUIs. For example a first DUI carries jail sentence between 24 hours and 10 days, a fine up to $1500, and a license suspension between 90 days and 1 year. However, a first Extreme DUI carries a jail sentence between 10 and 30 days.', 'DUI Penalties Chart: First, Second, and Extreme DUI Conviction', 32, 'penalties, priors, bac, misdemeanor', 'dui-penalties-chart-first-second-and-extreme-dui-conviction', '', 0, 0, 'Arizona', 12),
(458, 'primary', 'http://www.azleg.gov/FormatDocument.asp?inDoc=/ars/28/01383.htm&Title=28&DocType=ARS ', 27, 'Driving with a passenger under the age of 15 is considered a Class 6 Felony. If convicted, jail time can span from 1 day to 2 years. Fines start at $4,600. Prosecutors may choose to file child endangerment charges as well. See A.R.S. § 28-1383(A)(3) for more information.', 'Enhanced Penalty for Passenger Under 15  ', 11, 'penalties, child passenger, felony', 'enhanced-penalty-for-passenger-under-15', '', 0, 0, 'Arizona', 0),
(459, 'secondary', 'http://www.russlawaz.com/arizona-aggravated-dui-child-in-car.htm ', 27, 'Driving with a passenger under the age of 15 is considered a Class 6 Felony. If convicted with no priors, jail time can span from 1 day to 2 years. Fines start at $4,600. Prosecutors may choose to file child endangerment charges as well. Prior DUI conviction will increase the penalties. ', 'Was There a Child Under 15 in the Car? ', 23, 'penalties, child passenger, felony ', 'was-there-a-child-under-15-in-the-car', '', 0, 0, 'Arizona', 0),
(460, 'primary', 'http://www.azleg.state.az.us/FormatDocument.asp?inDoc=/ars/28/03473.htm&Title=28&DocType=ARS ', 27, 'Driving with a suspended or revoked license is a Class 1 misdemeanor, which carries a jail sentence up to 6 months and a fine up to $2500.', 'Driving Without a License ', 7, 'penalties, license, misdemeanor', 'driving-without-a-license', '', 0, 0, 'Arizona', 0),
(461, 'secondary', 'http://www.russlawaz.com/arizona-aggravated-dui-suspended-license.htm ', 27, 'Driving with a suspended or revoked license due to a past DUI is a class 4 felony. If there are prior felonies, a class 4 felony carries a jail sentence between 4 months and 3 years 9 months, a fine up to $4600, and a license suspension of 3 years. ', 'Driving Without a License Due to Past DUI ', 15, 'penalties, license, felony ', 'driving-without-a-license-due-to-past-dui', '', 0, 0, 'Arizona', 12),
(462, 'primary', 'http://www.azleg.state.az.us/FormatDocument.asp?inDoc=/ars/28/01321.htm&Title=28&DocType=ARS ', 27, 'Automatic penalties may be imposed for refusing a chemical test (blood or breath test), such as a 12 month license suspension. See Section 28-1312(B) for more information.', 'Automatic License Suspension for Refusing the Breath Test', 24, 'penalties, license, refusal, breath test, implied consent ', 'automatic-license-suspension-for-refusing-the-breath-test', '', 0, 0, 'Arizona', 12),
(463, 'secondary', 'http://dui.drivinglaws.org/resources/dui-refusal-blood-breath-urine-test/arizona.htm ', 27, 'Arizona implied consent laws require that you take a chemical test, either blood or breath, if you are arrested for drunk driving. If you refuse, a license suspension of 1 year may be imposed. ', 'What Happens if You Refuse the Breath Test ', 31, 'penalties, license, refusal, breath test, implied consent ', 'what-happens-if-you-refuse-the-breath-test', '', 0, 0, 'Arizona', 0),
(464, 'secondary', 'http://www.phoenixduilawyerblog.com/arizona-dui-topics/arizona-dui-testing ', 27, 'You can refuse the handheld breathalyzer (PBT - Portable Breathalyzer Test) without be penalized because it is not mandatory. The PBT can only be used as evidence to make an arrest for DUI. The reading cannot be used in court. ', 'Do You Have to Take the Handheld Breathalyzer? ', 28, 'refusal, breath test, evidence ', 'do-you-have-to-take-the-handheld-breathalyzer', '', 0, 0, 'Arizona', 0),
(465, 'secondary', 'http://www.phillipslaw.com/arizona-dui-checkpoints-and-your-rights ', 27, 'DUI checkpoints must follow written, detailed guidelines and procedures that officers are to follow at the roadblock, including selection of vehicles, detention techniques, duty assignments, and the disposition of vehicles. Failure to do so is a violation of the Fourth Amendments protection against unreasonable seizures and searches. ', 'Checkpoints are Constitutional', 19, 'checkpoints, constitution ', 'checkpoints-are-constitutional', '', 0, 0, 'Arizona', 12),
(466, 'primary', 'http://www.azleg.gov/FormatDocument.asp?inDoc=/ars/28/01383.htm&Title=28&DocType=ARS ', 27, 'If someone was injured in a accident caused by DUI, the offense is considered an "Aggravated DUI." This is a Class 4 Felony and can result in 1.5 to 3 years in prison and fines of up to $150,000. Number of past offenses and severity of injury are factors used in determining the penalties imposed.', 'Was Someone Injured in a Accident?', 10, 'penalties, injury, felony ', 'was-someone-injured-in-a-accident', '', 0, 0, 'Arizona', 0),
(467, 'primary', 'http://www.azleg.state.az.us/FormatDocument.asp?inDoc=/ars/13/00702.htm&Title=13&DocType=ARS ', 27, 'Felonies carry harsh penalties including prison time and large fines. \n<br/><br/>\nFelony, Mitigated, Minimum, Presumptive, Maximum, Aggravated\n Class 2  3 years       4 years     5 years      10 years     12.5 years\n Class 3  2 years       2.5 years   3.5 years    7 years      8.75 years\n Class 4  1 year        1.5 years   2.5 years    3 years      3.75 years\n Class 5  .5 years      .75 years   1.5 years    2 years      2.5 years\n Class 6  .33 years     .5 years    1 year       1.5 years    2 years', 'Sentencing Guidelines for Felonies', 4, 'penalties, felony', 'sentencing-guidelines-for-felonies', '', 0, 0, 'Arizona', 12),
(468, 'secondary', 'http://www.azbailmedui.com/DUI-Defense/DMV-Hearing.aspx ', 27, 'You have 15 days from the date of arrest to request a DMV hearing in order to fight a possible license suspension. If you don''t request a hearing, you will be unable to challenge your license suspension, regardless of whether you are found innocent or guilty for the DUI. The license suspension case is different from the criminal DUI case.  ', 'You Have 15 Days to Request a DMV Hearing', 30, 'dmv, license ', 'you-have-15-days-to-request-a-dmv-hearing', '', 0, 0, 'Arizona', 0),
(469, 'primary', 'http://www.azleg.state.az.us/FormatDocument.asp?inDoc=/ars/28/01385.htm&Title=28&DocType=ARS ', 27, 'You have 15 days from the date of arrest to request a DMV hearing in order to fight a possible license suspension. The license suspension case is different from the criminal DUI case.  See 28-1385(C)(1) for more information.', '15 Day Deadline to Request a DMV Hearing ', 7, 'dmv, license ', '15-day-deadline-to-request-a-dmv-hearing', '', 0, 0, 'Arizona', 0),
(470, 'primary', 'http://www.azleg.gov/FormatDocument.asp?inDoc=/ars/4/00244.htm&Title=4&DocType=ARS ', 27, 'It is illegal for a person under the age of 21 to drink and drive.  See 4-244(34) for more information.', 'Underage Drinking and Driving ', 4, 'under 21 ', 'underage-drinking-and-driving', '', 0, 0, 'Arizona', 14),
(471, 'primary', 'http://www.azleg.state.az.us/FormatDocument.asp?inDoc=/ars/28/03322.htm&Title=28&DocType=ARS ', 27, 'Individuals convicted of a DUI while under 21 face an additional 2 year license suspension. ', '2 Year License Suspension for Underage DUI ', 23, 'penalties, license, under 21 ', '2-year-license-suspension-for-underage-dui', '', 0, 0, 'Arizona', 12),
(472, 'secondary', 'http://www.tucsonduiteam.com/duipenalties.html ', 27, 'Individuals with four or more prior DUI''s are convicted of a Class E Felony. Penalties include 2 to 7 years in prison, fines up to $265,500, and 3 years revocation of driver''s license. \n<br/><br/>\n1st Offense Misdemeanor\n<br/> \n(BAC under .15)\n<br/>\n10 days jail, up to 9 days can be suspended; work release is possible\n<br/>\n$1,460.00 in fines, court assessments and surcharges\n<br/>\nProbation, unsupervised for 12-24 months\n<br/>\nCivil driver’s license suspension for up to 90 days; 30 days mandatory, 60 days can be restricted\n<br/>\n8 points assessed against driver’s license\n<br/>\nInterlock device for 12 months (Cost: $800.00-$1,000.00)', 'DUI Penalties ', 29, 'penalties, felony, priors, bac, license ', 'dui-penalties', '', 0, 0, 'Arizona', 0),
(473, 'secondary', 'http://www.russlawaz.com/arizona-dui-homicide.htm ', 27, 'Individuals convicted of vehicular manslaughter (DUI with death) may face 7 to 21 years in prison. ', 'DUI with Death ', 4, 'penalties, injury, priors ', 'dui-with-death', '', 0, 0, 'Arizona', 15),
(474, 'secondary', 'http://www.nolo.com/legal-encyclopedia/executor-faq-29126.html', 18, 'An executor is a person who makes sure your property gets split up the way you want it to. This person also has a “fiduciary duty”—the duty to act with scrupulous good faith and honesty on behalf of someone else. Some of the specific duties of an executor include finding the deceased person’s assets and managing them until they are distributed to the rightful heirs, filing the will in the local probate court, setting up an estate bank account, and using estate funds to pay continuing expenses (e.g. mortgage payments). You can choose an executor in your will. If you have no will and suffer a fatal accident, then the court system will decide who takes over your property and charge you for it.', 'What is an Executor?', 28, '', 'what-is-an-executor', '', 0, 0, '', 28),
(475, 'secondary', 'http://ezinearticles.com/?What-is-a-Will-and-Why-Do-We-Need-One?&id=54691', 18, 'A will is a legal document that contains instructions on how your property should be split up after you die. You can also name guardians in your will for any dependent children you have under the age of 18. The court doesn''t have to necessarily follow the instructions in your will, but they usually do. You can also name an executor in your will to make sure everything goes as planned. If you die without a will, the government will decide how your property gets split and name guardians for any dependent children. ', 'What is a Will?', 16, '', 'what-is-a-will', '', 0, 0, '', 19),
(476, 'secondary', 'http://rhol.org/rental/WEAR.HTM', 23, 'Landlords can use security deposits to repair damages caused by tenants; however, they cannot use the security deposit to repair normal wear and tear. Normal wear and tear includes deterioration of the premises that occurs during normal living conditions. These are things that happen even if the tenant takes reasonable care of the premises.  Normal wear and tear can include instances such as faded paint, worn-down carpets, or loose door locks.  Damages, on the other hand, result form accidents or unreasonable care of the premises. Unreasonable care means treating the property in a way most people wouldn''t, like throwing a bowling ball around. Damages can include instances like the extreme build-up of mold, stained carpets, or ripped wallpaper. It is also important to note that if a tenant wishes to make changes to the premises that will remain after the lease expires, the tenant should do so only with the landlord’s written approval.  When doing a final inspection of the premises, the tenant should discuss any damages with the landlord.  It may also help to refer to the initial inspection checklist to verify that the damages are indeed the tenant’s responsibility. ', 'What is normal wear and tear?', 28, '', 'what-is-normal-wear-and-tear', '', 0, 0, '', 15),
(477, 'secondary', 'http://www.dca.ca.gov/publications/landlordbook/sec-deposit.shtml', 23, 'Before moving out, a tenant may be responsible for repainting the walls of his or her unit.  When repainting is necessary (not the result of normal wear and tear), the landlord can deduct the cost from the tenant’s security deposit. One way to estimate the amount that the landlord can deduct for repainting is based on the length of the tenant’s stay in the unit.  For a tenant who has occupied a unit for more than two years, a landlord will generally not deduct any amount for repainting the walls.  If the length of stay is one to two years, a landlord will generally deduct one-third of the cost. If the length of stay is less than a year but more than six months, a landlord will roughly deduct two-thirds of the cost amount.  A landlord will usually deduct the full cost amount when a tenant has occupied the unit for less than six months.', 'Repainting Walls', 14, '', 'repainting-walls', '', 0, 0, '', 15),
(478, 'secondary', 'http://www.dca.ca.gov/publications/landlordbook/sec-deposit.shtml', 23, 'Normal wear and tear to carpets, drapes, and other furnishings cannot be charged against a tenant’s security deposit. Normal wear and tear includes the simple wearing down of carpets and drapes, generally resulting from normal use or aging.  In contrast, a landlord can deduct from the tenant’s security deposit the cost amount of replacing or repairing unreasonable damages. Large rips or permanent stains in the carpets or drapes usually justify deduction for replacement. A common method of calculating the deduction for replacement allocates the total cost of replacement so that the tenant pays only for the remaining useful life of the item that the tenant has damaged (referred to as the “useful life” rule). For instance, suppose a tenant damages an eight-year-old carpet that had a life expectancy of ten years. If the replacement costs $1,000, the landlord can properly charge $200 for the two years worth of use (life) that would have remained had the tenant not damaged the carpet.', 'Damage to Carpets and Drapes', 16, '', 'damage-to-carpets-and-drapes', '', 0, 0, '', 15),
(479, 'secondary', 'http://blog.upcounsel.com/hiring-interns/', 32, '', 'What is an Intern', 20, '', 'what-is-an-intern', '', 0, 0, '', 11),
(480, 'primary', 'http://www.dol.gov/whd/regs/compliance/whdfs71.htm', 32, '', 'Federal Definition of Intern', 15, '', 'federal-definition-of-intern', '', 0, 0, '', 12),
(481, 'secondary', 'http://blog.upcounsel.com/hiring-interns/', 33, '', 'Basics of Hiring Interns', 21, '', 'basics-of-hiring-interns', '', 0, 0, '', 13),
(482, 'primary', 'http://www.dol.gov/whd/regs/compliance/whdfs71.htm', 33, '', 'Federal Regulations', 13, '', 'federal-regulations', '', 0, 0, '', 12),
(483, 'secondary', 'http://www.legalcreation.com/how-often-should-i-update-my-will.html', 18, 'It is advisable to review your will every year or so. Make sure the will remains consistent with your current wishes. Also, you should review it after major life changes, such as the death of an heir, the birth of a potential new heir, or a significant change in your financial situation.  ', 'How Often Should I Update My Will?', 10, '', 'how-often-should-i-update-my-will', '', 0, 0, '', 20),
(484, 'secondary', 'http://www.nolo.com/legal-encyclopedia/executor-faq-29126-2.html', 18, 'If you have been named in another’s will to serve as an executor, you may choose to accept or decline the responsibility.  Even if you do initially decide to serve, you may resign at any time.', 'Do I Have to Serve as Executor?', 5, '', 'do-i-have-to-serve-as-executor', '', 0, 0, '', 15),
(489, 'secondary', 'http://en.wikipedia.org/wiki/Asylum_in_the_United_States', 8, 'The United States can recognize the right of asylum and admit some refugees into the country. Those seeking asylum must show that he or she (1) fears persecution (2) for being from a particular race, religion, nationality, political opinion, and social group, and (3) that the government of their home country is responsible.', 'Asylum in the United States', 1, '', 'asylum-in-the-united-states', '', 0, 0, '', 5),
(39, 'primary', 'http://www.law.cornell.edu/uscode/text/26/5000A', 35, 'The Affordable Care Act (26 USC § 5000A) requires individuals to maintain minimum essential coverage for health insurance. Factors such as yearly income, family household, or employer size will determine an individual''s yearly contribution and whether or not government assisted funding will be provided. Penalties can be imposed to individuals that do not maintain health coverage.', 'Individual Mandate: 26 USC § 5000A', 55, 'healthcare reform, individual mandate, affordable care act, penalty, tax', 'individual-mandate-26-usc-5000a', '', 0, 0, '', 14),
(45, 'secondary', 'http://en.wikipedia.org/wiki/National_Federation_of_Independent_Business_v._Sebelius', 35, 'In National Federation of Independent Business v. Sebelius, the Supreme Court of the U.S. determined that Congress had the right to require Americans to have healthcare insurance. This power or "right" to require healthcare stems from Congress'' taxing power. ', 'Summary of Case That Validated the Individual Mandate', 65, 'healthcare reform, supreme court, individual mandate, taxing power', 'summary-of-case-that-validated-the-individual-mandate', '', 0, 0, '', 13),
(491, 'secondary', 'http://www.dol.gov/whd/fmla/', 43, 'The Family and Medical Leave Act (FMLA) offers employees twelve weeks of leave if they are eligible. Examples of eligible persons are women who have given birth to a child, adoption or foster care of a child, people who care for a seriously ill relative, a seriously ill person, or certain circumstances caused by a relative in active military duty. Twenty-six weeks of leave can be offered if a person is caring for a covered servicemember with a serious injury or illness.', 'Family and Medical Leave Act Overview', 3, '', 'family-and-medical-leave-act-overview', '', 0, 0, '', 4),
(492, 'secondary', '', 18, 'An executor does not always have to hire a lawyer.  Doing a good job simply requires persistence and an attention to detail, but not necessarily a law degree. If the assets must go through probate court, the process consists of mainly paperwork.  Most cases do not involve disputes that require a judge’s decision; an executor may never see the inside of a courtroom. An executor can usually handle the paperwork without a lawyer if the will is straightforward. In more complex situations (e.g. disputes among inheritors), an executor may want to seek legal assistance.  ', 'Does an executor have to hire a lawyer?', 13, '', 'does-an-executor-have-to-hire-a-lawyer', '', 0, 0, '', 8),
(493, 'secondary', 'http://www.lawfirms.com/resources/personal-injury/auto-accident/accident-statute-limitations.htm', 10, 'For auto accidents, the statute of limitations refers to the time limit placed on the right to bring civil legal action against the party responsible for the accident.  A victim of a car accident has to abide by the accident statute of limitations that apply in the state where the car accident took place. Here is a list of accident statutes of limitations, state by state, for personal injury and personal property damages:<br/><br/>\n(Personal injury / Personal property damages)<br/>\nKY - 1 year / 2 year<br/>\nTN – 1 year/ 3 years<br/>\nAZ, DE, HI, IN, KS, OH, OK, PA, TX, WV – 2 years for both<br/>\nCA, CT, ID, NV – 2 years / 3 years<br/>\nGA – 2 years / 4 years<br/>\nIL, IA, VA – 2 years / 5 years<br/>\nAL, AK, NJ, ND, OR – 2 years / 6 years <br/>\nMT – 3 years / 2 years<br/>\nAR, CO, MD, MA, MI, NH, NY, NC, SC, WA, DC – 3 years for both<br/>\nNM, VT- 3 years / 4 years<br/>\nSD, WI- 3 years / 6 years<br/>\nUT- 4 years / 3 years<br/>\nFL, NE, WY- 4 years for both<br/>\nMO- 5 years for both<br/>\nME, MN- 6 years for both<br/>\nMS, RI- 3 years\n ', 'Statute of Limitations for Car Accidents', 16, '', 'statute-of-limitations-for-car-accidents', '', 0, 0, '', 2),
(494, 'secondary', 'http://startupowl.com/resources/business-startup-essentials/startup-organizing/', 2, 'It''s important to organize and structure your business to get the maximum benefits afforded by the law. There are many different types of entities you can choose from including a Sole Proprietorship, General Partnership, Limited Liability Company, and Corporation. Each has it''s own advantages and disadvantages. ', 'Organizing Your Business', 5, '', 'organizing-your-business', '', 0, 0, '', 5);
