(51, 4, 'MB', 'Were you under 21 when you were arrested?', '', 2, 'Yes,Under 21,under-21|No,,', '', 0),
(52, 4, 'EX', '<b>Under 21</b><br/><br/>California has a zero&ndash;tolerance policy towards underage drinking and driving. If your BAC was less than 0.08%&#44; you may receive an infraction&#44; which means the maximum penalty is a fine. You may also lose your driver&#39;s license for up to a year. If your BAC was 0.08% or greater&#44; you may be charged with a normal DUI.', 'Under 21', 3, 'Continue,,', '', 0),
(53, 6, 'MB', 'Were you under 21 when you were arrested?', '', 1, 'Yes,Under 21,under 21|No,,', '', 0),
(54, 6, 'EX', '<b>Under 21</b><br/><br/>The main difference between a DUI and DWI in Texas is that a DUI is only available to someone under the age of 21. A person under 21 will be charged with a DUI if he or she has a BAC under 0.08%. Otherwise that person will be charged with a DWI and face the same consequences as an adult. A DWI imposes a harsher sentence than a DUI. However&#44; it is easier to be convicted of a DUI because all that is necessary is that the officer detected some amount of alcohol.', 'Under 21', 2, 'Continue,,,', '', 0),
(55, 6, 'MC', 'In the past 10 years, how many times have you been convicted of drunk driving?', '', 3, 'This is my first,First,penalties|One time,Second,penalties|Two or more times,Third,penalties', '', 0),
(56, 6, 'EX', '<b>Possible Penalty</b></br><br/>Jail &ndash; 3 days to 180 days<br/>Fines &ndash; up to $2000<br/>License Suspension &ndash; 90 days to 1 year', 'First', 4, 'Continue,,,', '', 0),
(57, 6, 'MB', 'Did you get arrested with the last 15 days?', '', 7, 'Yes,DMV5,,|No,,,', '', 0),
(58, 6, 'EX', '<b>DMV Hearing</b><br/><br/>You have a right to fight your license suspension. To do this you must send a request for a hearing to Texas Department of Public Safefy within 15 days of your arrest. A DWI/DUI attorney will file this request for you and represent you in the process.', 'DMV5', 8, 'Continue,,,', '', 0),
(59, 6, 'MB', 'After you were arrested&#44; did you take a breath&#44; blood&#44; or urine test?', '', 9, 'Yes,Chemical,|No refused,Refusal,refusal|No not given,,', '', 0),
(60, 6, 'MB', 'Which one of the following tests did you take?', 'Chemical', 10, 'Breath,Breath,breath test|Blood,,blood test|Both,Breath,breath test', '', 0),
(61, 6, 'MB', 'Did you burp, vomit, smoke, regurgitate, drink, smoke, or eat 15 minutes before the breathalyzer?', 'Breath', 11, 'Yes,Inaccurate,inaccurate|No,,', '', 0),
(62, 6, 'EX', '<b>BAC tests</b><br/><br/>Your BAC results may be inaccurate. When you burp&#44; vomit&#44; regurgitate&#44; drink&#44; smoke&#44; or eat&#44; a tiny amount of alcohol was probably introduced to your mouth. Since the breathalyzer machine assumes that it is only measuring your breath alcohol&#44; a tiny amount of mouth alcohol may have produced an inaccurate BAC measurement. Other conditions that may increase your mouth alcohol or register an inaccurate measurement include dentures&#44; diabetes&#44; and the use of alcohol&ndash;containing products such as mouthwash&#44; breath spray&#44; and cough syrup.', 'Inaccurate', 12, 'Continue,,,', '', 0),
(63, 6, 'MC', 'What was your BAC?', 'Chemical', 13, 'Less than 0.15%,Rising,bac|0.15% or greater,High BAC,bac|I don&#039;t know,,', '', 0),
(64, 6, 'MB', 'Did you drink shortly before getting arrested?', 'Rising', 14, 'Yes,Rising2,rising bac defense|No,,', '', 0),
(65, 6, 'EX', '<b>Rising BAC Defense</b><br/><br/>You may have a &quot;Rising BAC Defense.&quot; What matters in a DUI/DWI case is your BAC at the time of driving&#44; not your BAC at the police station. To figure this out&#44; prosecutors will try to estimate your driving BAC. Most of the time they will estimate a BAC higher than the test results because they assume that your body was burning off alcohol between the time of arrest and testing. However&#44; this assumption is false if you had a drink shortly before being arrested and/or tested&#44; because your body was still absorbing that drink. This is called the &quot;Rising BAC defense&quot; and it might be used to help your case.	', 'Rising2', 15, 'Continue,,,', '', 0),
(66, 6, 'EX', '<b>High BAC</b><br/><br/>If you have a BAC of 0.15% or higher&#44; a DWI may be charged as a class A misdemeanor for the first offense. A class A misdemeanor imposes a jail sentence up to 1 year and a fine up to $4000. ', 'High BAC', 16, 'Continue,,,', '', 0),
(67, 6, 'EX', '<b>Refusal</b><br/><br/>You may face automatic penalties for refusing a chemical test. This is because just by driving the law says you have given your &quot;implied consent&quot; to submit to testing if arrested for drunk driving.<br/>First Offense – 180 day license suspension<br/>Second Offense – 2 year license suspension<br/>Third Offense – 2 year license suspension', 'Refusal', 17, 'Continue,,,', '', 0),
(68, 6, 'MB', 'How were you pulled over?', '', 18, 'Traffic Stop,Traffic,evidence|Accident,Accident,', '', 0),
(69, 6, 'EX', '<b>Traffic Stop</b><br/><br/>You have a right to not be pulled over randomly for no reason. Police must have &quot;probable cause&quot; before pulling over a car. An officer has probable when there is a reasonable&#44; articulable suspicion that a law has been broken. In most instances&#44; breaking a traffic law is enough for a officer to legally pull you over. If an officer pulls you over illegally&#44; a lawyer will file a motion to suppress any evidence obtained from that stop and get your case dismissed.', 'Traffic', 19, 'Continue,,,', '', 0),
(74, 6, 'MB', 'Was anyone injured?', 'Accident', 20, 'Yes,Wobbler,injury|No,,', '', 0),
(75, 6, 'EX', '<b>Accident</b><br/><br/>A DUI/DWI with injury may be charged as Intoxication Assault&#44;  which is a third degree felony for the first conviction. The injury must be serious&#44; such that it creates a substantial risk of death or that causes serious permanent disfigurement or loss of the function of a body part or organ. You may receive 2 to 10 years of jail time and a fine up to $10&#44;000. If someone died from the accident&#44; the penalties may be harsher.', 'Wobbler', 21, 'Continue,,,', '', 0),
(76, 6, 'MB', 'Was there a passenger under the age of 15 in the car?', '', 22, 'Yes,Minor,child passenger|No,,', '', 0),
(77, 6, 'EX', '<b>Child Passenger</b><br/><br/>A DWI with a passenger under the age of 15 is a state jail felony in Texas. A state jail felony carries a sentence between 180 days and 2 years and a fine up to $10&#44;000.', 'Minor', 23, 'Continue,,,', '', 0),
(78, 6, 'MB', 'Did you have an open container in the car? ', '', 24, 'Yes,Container,|No,,', '', 0),
(79, 6, 'EX', '<b>Open Container</b><br/><br/>A DWI may be charged as a class B misdemeanor if an open container of alcohol was found in the car. You may face 6 to 180 days in jail and a fine up to $2000 for a first conviction.  ', 'Container', 25, 'Continue,,,', '', 0),
(80, 7, 'MB', 'Were you under 21 when you were arrested?', '', 1, 'Yes,Under 21,under 21|No,,', '', 0),
(81, 7, 'EX', '<b>Under 21</b><br/><br/>Florida has a zero&ndash;tolerance policy towards underage drinking and driving. If your BAC was less than 0.08%&#44; you may receive 180 day license suspension for the first offense. If your BAC was 0.08% or greater&#44; you may be charged with a normal DUI.', 'Under 21', 2, 'Continue,,,', '', 0),
(84, 7, 'MB', 'Were you arrested with in the last 10 days?', '', 3, 'Yes,DMV5,,|No,,,', '', 0),
(85, 7, 'EX', '<b>DMV Hearing</b><br/><br/>You have a right to fight your license suspension. To do this you must request a DMV Administrative Review hearing within 10 days of your arrest. A DUI attorney will file this request for you and represent you in the process. ', 'DMV5', 4, 'Continue,,,', '', 0),
