(95, 7, 'MB', 'How were you pulled over?', '', 25, 'Traffic Stop,Traffic,evidence|DUI Checkpoint,Checkpoint,checkpoints|Accident,Accident,', '', 0),
(96, 7, 'EX', '<b>Traffic Stop</b><br/><br/>You have a right to not be pulled over randomly for no reason. Police must have &quot;probable cause&quot; before pulling over a car. An officer has probable when there is a reasonable&#44; articulable suspicion that a law has been broken. In most instances&#44; breaking a traffic law is enough for a officer to legally pull you over. If an officer pulls you over illegally&#44; a lawyer will file a motion to suppress any evidence obtained from that stop and get your case dismissed.', 'Traffic', 26, 'Continue,,,', '', 0),
(100, 7, 'EX', '<b>DUI Checkpoints</b><br/><br/>DUI checkpoints are governed by strict rules and regulations. For example&#44; cars cannot be stopped randomly. A pre&ndash;determined formula must be followed&#44; such as every fifth car is stopped. If any of these rules are broken&#44; the checkpoint may be illegal and a lawyer will file a motion to suppress any evidence obtained from that stop and get your case dismissed. ', 'Checkpoint', 27, 'Continue,,,', '', 0),
(101, 7, 'MB', 'Was anyone injured?', 'Accident', 28, 'Yes,Wobbler,injury|No,,', '', 0),
(102, 7, 'EX', '<b>Accident</b><br/><br/>A DUI with injury is a misdemeanor of the first degree&#44; which carries a possible jail sentence up to 1 year and a fine up to $1000. A DUI with serious bodily injury is a felony of the third degree&#44; which carries a possible jail sentence up to 5 years and a fine up to $5000. Serious bodily injury include substantial risk of death&#44; serious personal disfigurement&#44; or loss or impairment of bodily functions.', 'Wobbler', 29, 'Continue,,,', '', 0),
(103, 7, 'MB', 'Was there a passenger under the age of 14 in the car?', 'Minors', 15, 'Yes,High BAC,child passenger|No,Priors,', '', 0),
(105, 4, 'EX', '<b>Possible Penalty</b><br/><br/>Jail – 10 days to 1 year<br/>Fines – $1800 to $2800<br/>License Suspension – 2 years', 'Second', 6, 'Continue,,', '', 0),
(106, 4, 'EX', '<b>Possible Penalty</b><br/><br/>Jail – 120 days to 1 year<br/>Fines – $1800 to $18000<br/>License Suspension – 3 years', 'Third', 7, 'Continue,,', '', 0),
(107, 4, 'EX', 'If you have had 3 or more separate DUI convictions in the past 10 years&#44; this offense will most likely be charged as a felony.<br/><br/><b>Possible Penalties</b><br/><br/>Jail – up to 3 years<br/>Fines – $390 to $1000<br/>License Suspension – 4 years', 'More', 8, 'Continue,,', '', 0),
(108, 6, 'EX', '<b>Possible Penalty</b></br><br/>Jail &ndash; 30 days to 1 year<br/>Fines &ndash; up to $4000<br/>License Suspension &ndash; 180 days to 2 year', 'Second', 5, 'Continue,,,', '', 0),
(109, 6, 'EX', '<b>Possible Penalty</b></br><br/>If you have had 2 or more separate DWI convictions in the past 10 years&#44; this offense will most likely be charged as a felony.<br/>Jail – 2 years<br/>Fines – up to $10000<br/>License Suspension – 180 days to 2 years', 'More', 6, 'Continue,,,', '', 0),
(110, 7, 'MC', 'How many times have you been convicted of drunk driving in the past?', 'Priors', 20, 'This is my first,First2,|One time,Second2,|Two times,Third2,|Three or more times,More,', '', 0),
(111, 7, 'EX', '<b>Possible Penalty</b><br/><br/>Jail – up to 9 months<br/>Fines – $1000 to $2000<br/>License Suspension – 180 days to 1 year', 'First1', 17, 'Continue,,,', '', 0),
(112, 7, 'EX', '<b>Possible Penalty</b><br/><br/>Jail – up to 1 year&#44; unless you&#39;ve had another DUI in the past 5 years&#44; then 10 days mandatory<br/>Fines – $2000 to $4000<br/>License Suspension – 1 year&#44; unless this DUI is within 5 year of a previous DUI conviction&#44; then 5 years', 'Second1', 18, 'Continue,,,', '', 0),
(113, 7, 'EX', '<b>Possible Penalty</b><br/><br/>Jail – up to 1 year (mandatory 30 days if this is your third conviction within 10 years)<br/>Fines – $4000 minimum<br/>License Suspension – 2 years&#44; unless this is your third conviction with 10 years&#44; then 10 years', 'Third1', 19, 'Continue,,,', '', 0),
(114, 7, 'EX', '<b>Possible Penalty</b><br/><br/>Jail – up to 5 years<br/> Fines – $2000 minimum<br/>License Suspension – for life', 'More', 24, 'Continue,,,', '', 0),
(115, 7, 'EX', '<b>Possible Penalty</b><br/><br/>Jail – up to 6 months<br/>Fines – $500 to $1000<br/>License Suspension – 180 days to 1 year', 'First2', 21, 'Continue,,,', '', 0),
(116, 7, 'EX', '<b>Possible Penalty</b><br/><br/>Jail – up to 9 months&#44; unless you&#39;ve had another DUI in the past 5 years&#44; then 10 days mandatory<br/>Fines – $1000 to $2000<br/>License Suspension – 1 year&#44; unless you&#39;ve had another DUI in the past 5 years&#44; then 5 years', 'Second2', 22, 'Continue,,,', '', 0),
(117, 7, 'EX', '<b>Possible Penalty</b><br/><br/>Jail – up to 1 year (mandatory 30 days if this is your third conviction within 10 years)<br/>Fines – $2000 to $5000<br/>License Suspension – 2 years&#44; unless this is your third conviction with 10 years&#44; then 10 years', 'Third2', 23, 'Continue,,,', '', 0),
(118, 7, 'EX', 'Have you ever refused the chemical test in the past?', 'Second Refusal', 13, 'Yes,Second Refusal1,|No,,', '', 0),
(119, 7, 'EX', '<b>Refusal</b><br/><br/>If you refuse the chemical test a second time&#44; you can be charged with a separate misdemeanor of the first degree for the first offense. A misdemeanor of the first degree carries up to 1 year of jail time and a fine up to $1000. ', 'Second Refusal1', 14, 'Continue,Minors,,', '', 0),
(120, 8, 'MB', 'Were you under 21 when you were arrested?', '', 1, 'Yes,Under 21,under 21|No,,', '', 0),
(121, 8, 'EX', '<b>Under 21</b><br/><br/>Pennsylvania has a zero–tolerance policy towards underage drinking and driving. If your BAC was 0.02% or greater&#44; you may face a jail sentence between 48 hours and 180 days&#44; a fine between $500 and $5000&#44; and an administrative license suspension for the first conviction', 'Under 21', 2, 'Continue,,,', '', 0),
(127, 8, 'IN', 'Did you get arrested within the last 10 days?', '', 3, 'Yes,DMV5,,|No,,,', '', 0),
(128, 8, 'EX', '<b>DMV Hearing</b><br/><br/>You have a right to fight your license suspension. To do this you must request a DMV hearing within 10 days of your arrest. A DUI attorney will file this request for you and represent you in the process. ', 'DMV5', 4, 'Continue,,,', '', 0),
(129, 8, 'MB', 'After you were arrested&#44; did you take a breath&#44; blood&#44; or urine test?', '', 5, 'Yes,Chemical,|No refused,Refusal,refusal|No not given,,', '', 0),
(130, 8, 'MB', 'Which one of the following tests did you take?', 'Chemical', 24, 'Breath,Breath,breath test|Blood,,blood test|Both,Breath,breath test', '', 0),
(131, 8, 'MB', 'Did you burp&#44; vomit&#44; smoke&#44; regurgitate&#44; drink&#44; smoke&#44; or eat 15 minutes before the breathalyzer?', 'Breath', 25, 'Yes,Inaccurate,inaccurate|No,,', '', 0),
(132, 8, 'EX', '<b>BAC Test</b><br/><br/>Your BAC results may be inaccurate. When you burp&#44; vomit&#44; regurgitate&#44; drink&#44; smoke&#44; or eat&#44; a tiny amount of alcohol was probably introduced to your mouth. Since the breathalyzer machine assumes that it is only measuring your breath alcohol&#44; a tiny amount of mouth alcohol may have produced an inaccurate BAC measurement. Other conditions that may increase your mouth alcohol or register an inaccurate measurement include dentures&#44; diabetes&#44; and the use of alcohol–containing products such as mouthwash&#44; breath spray&#44; and cough syrup.', 'Inaccurate', 26, 'Continue,,,', '', 0),
(133, 8, 'MC', 'What was your BAC?', 'Chemical', 6, 'Less than 0.08%,Injury,bac|0.08% to 0.099%,Injury,bac|0.10% to 0.159%,High,bac|0.16% or higher,Highest,bac|I don&#39;t know,,', '', 0),
(134, 8, 'MB', 'Did you drink shortly before getting arrested?', 'Rising', 22, 'Yes,Rising2,rising bac defense|No,,', '', 0),
(135, 8, 'EX', '<b>Rising BAC Defense</b><br/><br/>You may have a &quot;Rising BAC Defense.&quot; What matters in a DUI case is your BAC at the time of driving&#44; not your BAC at the police station. To figure this out&#44; prosecutors will try to estimate your driving BAC. Most of the time they will estimate a BAC higher than the test results because they assume that your body was burning off alcohol between the time of arrest and testing. However&#44; this assumption is false if you had a drink shortly before being arrested and/or tested&#44; because your body was still absorbing that drink. This is called the &quot;Rising BAC defense&quot; and it might be used to help your case. ', 'Rising2', 23, 'Continue,,,', '', 0),
(136, 8, 'MC', 'In the past 10 years&#44; how many times have you been convicted of drunk driving?', 'Low', 8, 'This is my first,First1,penalties|One time,Second1,penalties|Two or more times,More1,penalties', '', 0),
(137, 8, 'EX', '<b>Refusal</b><br/><br/>You may face automatic penalties for refusing a chemical test. This is because just by driving the law says you have given your &quot;implied consent&quot; to submit to testing if arrested for drunk driving.<br/><br/>First Offense – 1 year license suspension<br/>Second Offense – 18 month license suspension<br/>Third Offense – 18 month license suspension', 'Refusal', 17, 'Continue,Highest,,', '', 0),
(138, 8, 'MB', 'How were you pulled over?', '', 29, 'Traffic Stop,Traffic,evidence|DUI Checkpoint,Checkpoint,checkpoints|Accident,Accident,', '', 0),
(139, 8, 'EX', '<b>Traffic Stop</b><br/><br/>You have a right to not be pulled over randomly for no reason. Police must have &quot;probable cause&quot; before pulling over a car. An officer has probable when there is a reasonable&#44; articulable suspicion that a law has been broken. In most instances&#44; breaking a traffic law is enough for a officer to legally pull you over. If an officer pulls you over illegally&#44; a lawyer will file a motion to suppress any evidence obtained from that stop and get your case dismissed.', 'Traffic', 30, 'Continue,,,', '', 0),
(143, 8, 'EX', '<b>DUI Checkpoints</b><br/><br/>DUI checkpoints are governed by strict rules and regulations. The following are some&#44; but not all&#44; of the guidelines police must follow at a DUI checkpoint: 1) stops must be quick and there can be no physical search&#44; 2) there must be warning of the checkpoint. 3) checkpoints must be approved and not randomly set up by police whenever they feel like it&#44; 4) the checkpoint must be in an area where there are likely to be drunk drivers&#44; and 5) there must be a fixed formula used to determine which drivers to stop&#44; cops can&#39;t decide randomly.', 'Checkpoint', 31, 'Continue,,,', '', 0),
(144, 8, 'MB', 'Was anyone injured?', 'Accident', 32, 'Yes,Wobbler,injury|No,,', '', 0),
(145, 8, 'EX', '<b>Accident</b><br/><br/>A DUI with injury may increase your penalties.', 'Wobbler', 33, 'Continue,,,', '', 0),
(146, 8, 'MB', 'Was there a passenger under the age of 18 in the car?', '', 27, 'Yes,Minor,child passenger|No,,', '', 0),
(147, 8, 'EX', '<b>Minor Passenger</b><br/><br/>You may face additional penalties for a DUI with a passenger under the age of 18. For a first offense&#44; add at least $1000 and 100 hours of community service. For a second offense&#44; add at least $2500 and between 1 and 6 months of jail time. For a third offense&#44; add between 6 month and 2 years of jail time.', 'Minor', 28, 'Continue,,,', '', 0),
(148, 8, 'EX', '<b>Possible Penalty</b><br/><br/>Probation – up to 6 months<br/>Fines – $300<br/>Alcohol highway safety school', 'First1', 9, 'Continue,Rising,,', '', 0),
(149, 8, 'EX', '<b>Possible Penalty</b><br/><br/>Jail – 5 days to 6 months<br/>Fines – $300 to $2500<br/>License Suspension – 1 year<br/>1 year ignition interlock<br/>Alcohol highway safety school', 'Second1', 10, 'Continue,Rising,,', '', 0),
(150, 8, 'EX', '<b>Possible Penalty</b><br/><br/>Jail – 10 days to 2 years<br/>Fines – $500 to $5000<br/>License Suspension – 1 year<br/>1 year ignition interlock<br/>Alcohol highway safety school', 'More1', 11, 'Continue,Rising,,', '', 0),
(151, 8, 'MC', 'In the past 10 years&#44; how many times have you been convicted of drunk driving?', 'High', 12, 'This is my first,First2,penalties|One time,Second2,penalties|Two times,Third2,penalties|Three or more times,More2,penalties', '', 0),
(152, 8, 'EX', '<b>Possible Penalty</b><br/><br/>Jail – 48 hours to 6 months<br/>Fines – $500 to $5000<br/>License Suspension – 1 year<br/>Alcohol highway safety school', 'First2', 13, 'Continue,,,', '', 0),
(153, 8, 'EX', '<b>Possible Penalty</b><br/><br/>Jail – 30 days to 6 months<br/>Fines – $750 to $5000<br/>License Suspension – 1 year<br/>1 year ignition interlock<br/>Alcohol highway safety school', 'Second2', 14, 'Continue,,,', '', 0),
(154, 8, 'EX', '<b>Possible Penalty</b><br/><br/>Jail – 90 days to 5 years<br/>Fines – $1500 to $10000<br/>License Suspension – 18 months<br/>1 year ignition interlock', 'Third2', 15, 'Continue,,,', '', 0),
(155, 8, 'EX', '<b>Possible Penalty</b><br/><br/>Jail – 1 to 5 years<br/>Fines – $1500 to $10000<br/>License Suspension – 18 months<br/>1 year ignition interlock', 'More2', 16, 'Continue,,,', '', 0),
(156, 8, 'MC', 'In the past 10 years&#44; how many times have you been convicted of drunk driving?', 'Highest', 18, 'This is my first,First3,penalties|One time,Second3,penalties|Two or more times,More3,penalties', '', 0),
(157, 8, 'EX', '<b>Possible Penalty</b><br/><br/>Jail – 72 hours to 6 months<br/>Fines – $1000 to $5000<br/>License Suspension – 1 year<br/>Alcohol highway safety school', 'First3', 19, 'Continue,,,', '', 0),
(158, 8, 'EX', '<b>Possible Penalty</b><br/><br/>Jail – 90 days to 5 years<br/>Fines – $1500 to $10000<br/>License Suspension – 18 months<br/>1 year ignition interlock<br/>Alcohol highway safety school', 'Second3', 20, 'Continue,,,', '', 0),
(159, 8, 'EX', '<b>Possible Penalty</b><br/><br/>Jail – 1 to 5 years<br/>Fines – $2500 to $10000<br/>License Suspension – 18 months<br/>1 year ignition interlock', 'More3', 21, 'Continue,,,', '', 0),
