(2222, 65, 'MB', 'Have you been convicted of three of more misdemeanors? Do not count minor traffic offenses or state immigration–related offenses. ', 'Three', 13, 'Yes,Bad,,|No,,,', '', 0),
(2223, 65, 'ZZ', 'You are probably eligible for Deferred Action because you satisfied the necessary conditions. To file&#44; you need to submit a I–821D “Consideration of Deferred Action for Childhood Arrivals” form. You must submit this form&#44; together with the I–765 form requesting a work permit&#44; to U.S. Citizenship and Immigration Services (USCIS). A lawyer can help you file the request and get you the rights you deserve!', '', 14, '0,,,', '', 0),
(2224, 66, 'EX', '<div style=&quot;text&ndash;align:center&quot;><big>Why Get a Will</big></div><br/>Find out why getting a will is an important step to protecting your loved ones and can save your family a lot of money.', '', 1, 'Start,,,', '', 0),
