(2309, 70, 'MB', 'Has it been 21 or more days since you have moved out?', 'Deserve', 2, 'Yes,21Yes,|No,Part2,', '', 0),
(2310, 70, 'MB', 'Did you get a statement describing why you did not get your full security deposit back?', 'Part2', 3, 'Yes,ItemYes,|No,21No,', '', 0),
(2311, 70, 'EX', '<b>Landlord Obligations</b><br/><br/>Your landlord has up to 21 days from the day you move out to give you your full deposit back or an statement describing any deductions and the remaining deposit. If you don&#39;t get anything within 21 days&#44; you have a right to fight for your full security deposit.', '21No', 4, 'Continue,ItemYes,', '', 0),
(2312, 70, 'EX', '<b>Good Job!</b> You&#39;re on top of things.', 'Goodjob', 5, 'Continue,,', '', 0),
(2313, 70, 'MB', 'Did you get a statement describing why you did not get your full security deposit back?', '21Yes', 6, 'Yes,ItemYes,|No,ItemNo,', '', 0),
(2314, 70, 'OP', 'Was money deducted from your security deposit for any of the following reasons?', 'ItemYes', 7, 'Unpaid rent,Rent,,|By lease agreement (lost keys&#44; etc.),Keys,,|Cleaning or repair for damamges,Clean,,|Other,None4,,', '', 0),
(2315, 70, 'EX', '<b>Deductions</b><br/><br/>California law specifically allows the landlord to use a tenant&#39;s security deposit for four purposes: unpaid rent&#44; cleaning the rental&#44; repairs for damages&#44; and things written in the lease&#44; such as lost keys. Your security deposit cannot be deducted for any other reason.', 'None4', 8, 'Continue,,', '', 0),
(2316, 70, 'EX', '<b>Unpaid Rent</b><br/><br/>You are usually obligated to pay rent. If you broke your lease and found a suitable replacement without delay&#44; your landlord typically cannot touch your security deposit. Or if your rental unit was &quot;uninhabitable&#44;&quot; your security deposit cannot be touched and you do not have to pay rent. An uninhabitable rental unit is unfit to live in. It might have major plumping issues&#44; little light and ventilation&#44; structural hazards&#44; or vermin problems. A lawyer can help you figure out whether your rental complies with the local municipal housing code.', 'Rent', 9, 'Continue,,', '', 0),
(2317, 70, 'EX', '<b>By Lease</b><br/><br/>If your lease says you must replace certain items&#44; such as lost keys&#44; your secuity deposit may be used to pay this.', 'Keys', 10, 'Continue,,', '', 0),
(2318, 70, 'EX', '<b>Cleaning and Repair</b><br/><br/>Cleaning: Your landlord can only charge you to make the unit as clean as it was when you first moved in. If there was a giant stain on the carpet when you first moved in&#44; you are not required to clean it&#44; and your security deposit can&#39;t be used to clean it.<br/><br/>Repairs: Your security deposit can also be used to fix things you or your guests damaged. But it can&#39;t be used for normal wear and tear&#44; such as wearing down with time and moderate dirt.', 'Clean', 11, 'More Examples,More Cleaning,|Continue,,', '', 0),
(2319, 70, 'EX', '<b>Cleaning and Repairs</b><br/><br/>Reasonable cleaning costs would include the cost of such things as eliminating flea infestations left by the tenant&#39;s animals&#44; cleaning the oven&#44; removing decals from walls&#44; removing mildew in bathrooms&#44; defrosting the refrigerator&#44; or washing the kitchen floor. But the landlord could not charge for cleaning any of these conditions if they existed at the time that the departing tenant moved in.', 'More Cleaning', 12, 'Continue,,', '', 0),
(2320, 70, 'OP', 'Were you charged for any of the following?', 'Clean', 13, 'Walls,Walls,|Carpets and drapes,Carpets,|Other,Other,', '', 0),
(2321, 70, 'EX', '<b>Wall Damage</b><br/><br/>Generally&#44; minor marks or nicks in walls are the landlord&#39;s responsibility as normal wear and tear (for example&#44; worn paint caused by a sofa against the wall). If there is more damage than normal wear and tear&#44; cost can be determined by how long you have lived in the apartment. For example:<br/><br/>Less than 6 months = full cost deducted from deposit<br/>6 months to 1 year = two–thirds of cost<br/>1 year to 2 years = one–third of cost<br/>2 or more years = no deduction', 'Walls', 14, 'Continue,,', '', 0),
(2322, 70, 'EX', '<b>Carpet and Drapes</b><br/><br/>You will not be charged for normal wear and tear. Normal wear and tear includes simple wearing down of carpet and drapes because of normal use or aging&#44; and includes moderate dirt or spotting. In contrast&#44; large rips or permanent stains justify a deduction from the tenant&#39;s security deposit for repairing the carpet or drapes&#44; or replacing them if that is reasonably necessary.', 'Carpets', 15, 'Continue,,', '', 0),
(2323, 70, 'MB', 'Was the damage more than normal wear and tear?', 'Other', 16, 'Yes,Wear,|No,,', '', 0),
(2324, 70, 'EX', '<b>Damage Amount and Life Expectancy</b><br/><br/>Depending how old the item you damaged was&#44; you might not have to replace it completely. For example if a carpet has a life expectancy of 10 years and costs $1000&#44; if you damage it at year eight&#44; you should only have to pay $200 for the two years left it was expected to last.', 'Wear', 17, 'Continue,,', '', 0),
(2325, 70, 'OP', 'Who did the cleaning/repairs?', 'Clean', 18, 'Landlord or Landlord&#39;s employees,Landlord,|Another person or business,Business,|Landlord is estimating costs,Estimate,|I don&#39;t know,,', '', 0),
(2326, 70, 'MB', 'Did the statement list the work done&#44; time spent&#44; and hourly rate?', 'Landlord', 19, 'Yes,ListYes,|No,ListNo,', '', 0),
(2327, 70, 'MB', 'Was this amount reasonable? (the normal amount for getting this type or work done)', 'ListYes', 20, 'Yes,ReasonableYes,|No,ReasonableNo,', '', 0),
(2328, 70, 'EX', '<b>Reasonable Amount</b><br/><br/>If the amount was reasonable&#44; you can&#39;t really dispute it. Unless it was used for something not caused by you or is the result of normal wear and tear.', 'ReasonableYes', 21, 'Continue,,', '', 0),
(2329, 70, 'EX', '<b>Fight for your right!</b><br/><br/>Your landlord can&#39;t charge $1000 for a $100 job. The landlord must charge you a reasonable amount (the normal amount for that service or item). You have a right to get your money back!', 'ReasonableNo', 22, 'Continue,,', '', 0),
(2330, 70, 'EX', '<b>Itemized Statement</b><br/><br/>The statement should list the work done&#44; time spent&#44; and the hourly rate. If any of this is unreasonable (e.g. too much time spent&#44; rate too high&#44; etc)&#44; you can challenge it and try to get your money back. It&#39;s your right!', 'ListNo', 23, 'Continue,,', '', 0),
(2331, 70, 'EX', '<b>Estimated Costs</b><br/><br/>If repairs or cleaning are not yet completed&#44; your landlord can make a good faith estimate for the costs. You landlord cannot make super high or unreasonable estimates. Invoices&#44; receipts&#44; or statements of any work done must be sent within 14 days of completion.', 'Estimate', 24, 'Continue,,', '', 0),
(2332, 70, 'MB', 'Was the estimated amount reasonable (the normal amount for getting this type or work done)?', 'Estimate', 25, 'Yes,ReasonableYes,|No,ReasonableNo,', '', 0),
(2333, 70, 'MB', 'Did you receive receipts or invoices for any cleaning or repairs performed by another person or business?', 'Business', 26, 'Yes,,,|No,Waive,,', '', 0),
(2334, 70, 'MB', 'Did you give up your rights to recieve receipts? (This is usually done in the notice or termination before you move out)', 'Waive', 27, 'Yes,WaiveYes,|No,126,|I don&#39;t know,126,', '', 0),
(2335, 70, 'MB', 'Has it been 14 days or more since you&#39;ve recieved the itemized statement?', 'WaiveYes', 28, 'Yes,14Yes,|No,14No,', '', 0),
(2336, 70, 'EX', '<b>Invoices and Receipts</b><br/><br/>You probably can&#39;t request receipts and invoices from the landlord because it has been more than 14 days since you received the itemized statement. ', '14Yes', 29, 'Continue,,', '', 0),
(2337, 70, 'EX', '<b>Invoices and Receipts</b><br/><br/>You can and should request receipts and invoices from the landlord. This can help you determine whether or not you were overcharged.', '14No', 30, 'Continue,,', '', 0),
(2338, 70, 'MB', 'Was $126 or more deducted for cleaning and repairs?', '126', 31, 'Yes,126Yes,|No,WaiveYes,', '', 0),
(2339, 70, 'EX', '<b>Invoices and Receipts</b><br/><br/>Your landlord is required to give you receipts and invoices of any work performed by another person or business. This can help you determine whether or not you were overcharged. If you do not have them yet&#44; ask your landlord.', '126Yes', 32, 'Continue,,', '', 0),
(2340, 70, 'EX', '<b>Fight for Your Right!</b><br/><br/>Under the law if you do not receive a statement of deductions within 21 days of your move out&#44; you have a right to get your entire security deposit back.', 'ItemNo', 33, 'Continue,,', '', 0),
(2341, 70, 'EX', '<b>How to Get Your Security Deposit Back</b><br/><br/>Now you know if you deserve part or all of your security deposit back. Now learn how to get it back.', 'Deserve', 34, 'Continue,Refund,,', '', 0),
(2342, 70, 'EX', '<b>How to Get Your Security Deposit Back</b><br/><br/>If you feel that the wrong amount has been deducted from your security deposit&#44; you have a right to get back what you deserved. If you did not get an itemized statement after 21 days from move out&#44; you are entitled to get your full security deposit back.', 'Fight', 35, 'Continue,Refund,', '', 0),
(2343, 70, 'MB', 'Have you asked your landlord for a refund?', 'Refund', 36, 'Yes,,|No,RefundNo,', '', 0),
(2344, 70, 'EX', '<b>Ask Your Landlord</b><br/><br/>You should first ask your landlord for a refund before resorting to legal action. It&#39;s a lot less effort and you might just get what you want. Be sure to state the amount of money wanted and reasons why you deserve that amount. Always include a letter when you make your request to use as future reference and hard evidence. It&#39;s a good idea to send the letter by certified mail or have the landlord sign it upon receipt&#44; acknowledging that he or she received it.', 'RefundNo', 37, 'Continue,,', '', 0),
(2345, 70, 'MB', 'Have you tried third&ndash;party mediation?', 'Refund', 38, 'Yes,,|No,MediationNo,', '', 0),
(2346, 70, 'EX', '<b>Third–Party Mediation</b><br/><br/>Try to work out a compromise with third–party mediation. In mediation, a neutral person will try to work out a deal that''s okay with you and your landlord. Check out the following link to find out who to contact in your region: <a href="http://ow.ly/d6B7Z" target="_blank">http://ow.ly/d6B7Z</a>. If mediation does not work, you may want to take legal action.', 'MediationNo', 39, 'Continue,,', '', 0),
(2347, 70, 'MB', 'Is the amount of money you want back above $7500?', 'Refund', 40, 'Yes,7500Yes,|No,7500No,', '', 0),
(2348, 70, 'ZZ', '<b>Result:</b><br/>You have a choice to take your case superior court or small claims court. If you decide to take your case to small claims court&#44; you can only recover up to $7500 and will lose the rest. In superior court&#44; you may be able to recover the full amount. A lawyer can help you file a complaint in superior court.', '7500Yes', 41, '0,,,', '', 0),
(2349, 70, 'ZZ', '<b>Result:</b><br/>You can try to recover your money in Small Claims Court. Here&#44; the landlord must convince the judge that the damage occurred&#44; and that the amount deducted from you security deposit is appropriate. You can argue that the amount is in appropriate or that the damage wasn&#39;t caused by you or is just normal wear and tear. A lawyer can help you win your case.', '7500No', 42, '0,,,', '', 0),
(2350, 70, 'EX', '<b>Protect Your Security Deposit</b><br/><br/>Learn how to protect your security deposit before any deductions are made.', 'Protect', 43, 'Continue,,', '', 0),
(2351, 70, 'EX', '<b>Landlord Obligations</b><br/><br/>Know your rights: Your landlord has 21 days from the day you move out to send you either your full security deposit or itemized statement that lists amount of any deductions from your security deposit and reasons for those deductions&#44; and a refund of any amounts not deducted.', 'Protect', 44, 'Continue,,', '', 0),
(2352, 70, 'MB', 'Do you know what normal wear and tear means?', 'Protect', 45, 'Yes,,|No,Wear3,', '', 0),
(2353, 70, 'EX', '<b>Wear and Tear</b><br/><br/>Normal wear and tear is a term that is often used to describe the condition of things in a rental unit. It means wearing down caused by age and normal use. For example&#44; normal wear and tear for a carpet may include minor stains. However&#44; a big&#44; permanent stain is not normal wear and tear. You are not responsible for normal wear and tear&#44; but you may be charged for damages beyond it. ', 'Wear3', 46, 'Continue,,', '', 0),
(2354, 70, 'OP', 'Money from your security deposit can only be deducted for the following reasons: (check off which ones you&#39;d like to learn more about about)', 'Protect', 47, 'Unpaid rent,Rent2,|Cleaning the rental,Cleaning2,|Repair for damages,Repair2,|By lease agreement,Keys2,|nota,,', '', 0),
(2355, 70, 'EX', '<b>Unpaid Rent</b><br/><br/>You are usually obligated to pay rent. If you broke your lease and found a suitable replacement without delay&#44; your landlord typically cannot touch your security deposit. Or if your rental unit was &quot;uninhabitable&#44;&quot; your security deposit cannot be touched and you do not have to pay rent. An uninhabitable rental unit is unfit to live in. It might have major plumping issues&#44; little light and ventilation&#44; structural hazards&#44; or vermin problems. A lawyer can help you figure out whether your rental complies with the local municipal housing code.', 'Rent2', 48, 'Continue,,', '', 0),
(2356, 70, 'EX', '<b>Cleaning the Rental</b><br/><br/>Your landlord can only charge you to make the unit as clean as it was when you first moved in. If there was a giant stain on the carpet when you first moved in&#44; you are not required to clean it&#44; and your security deposit can&#39;t be used to clean it.', 'Cleaning2', 49, 'Continue,,', '', 0),
(2357, 70, 'EX', '<b>Repairs for Damages</b><br/><br/>Your security deposit can be used to fix things that you or your guests damaged. But it can&#39;t be used for normal wear and tear&#44; such as wearing down with time and moderate dirt. ', 'Repair2', 50, 'Continue,,', '', 0),
(2358, 70, 'EX', '<b>By Lease</b><br/></br>If your lease says you must replace certain items&#44; such as lost keys&#44; your secuity deposit may be used to pay this.', 'Keys2', 51, 'Continue,,', '', 0),
(2359, 70, 'MB', 'Have you moved out yet?	', 'Protect', 52, 'Yes,,|No,Inspection,', '', 0),
(2360, 70, 'MB', 'Have you requested an intial inspection yet?', 'Inspection', 53, 'Yes,Goodjob,|No,Inspection2,', '', 0),
(2361, 70, 'EX', '<b>Initial Inspection</b><br/><br/>During the initial inspection the landlord will note things that need to be repaired and cleaned. You will then have an opportunity to do what is needed&#44; so none of your security deposit is taken out. It&#39;s your responsibility to request the initial inspection&#44; not your landlord. It must be schuduled during the last 2 weeks of the lease. Remember it&#39;s your right! There are however a few situations where a landlord does not have to perform an initial inspection.', 'Inspection2', 54, 'Continue,Inspection3,', '', 0),
(2362, 70, 'EX', '<b>Initial Inspection</b><br/><br/>The landlord is not required to perform an initial inspection if the landlord has served the tenant with a three–day notice because the tenant has failed to pay the rent&#44; violated a provision of the lease or rental agreement&#44; materially damaged the property&#44; committed a nuisance&#44; or used the property for an unlawful purpose.', 'Inspection3', 55, 'Continue,,', '', 0),
(2363, 70, 'OP', 'Are you worried about damage to any of the following?', 'Protect', 56, 'Carpets and Drapes,Carpets,|Walls,Walls,|nota,,', '', 0),
(2364, 70, 'MB', 'Have you used a move in checklist yet?', 'Protect', 57, 'Yes,Goodjob,|No,Checklist,', '', 0),
(2365, 70, 'EX', '<b>Move&ndash;in Checklist</b><br/><br/>It&#39;s a good idea to have a move&ndash;in checklist to record the current condition of the rental unit. Do this now&#44; so you don&#39;t end up paying for things you didn&#39;t mess up. California does not require landlords to do this.', 'Checklist', 58, 'Continue,,', '', 0),
(2366, 70, 'MB', 'Have you taken pictures or made a video of the rental unit?', 'Protect', 59, 'Yes,Goodjob,|No,Video,', '', 0),
(2367, 70, 'EX', '<b>Taking Pictures</b><br/><br/>Taking pictures or making a video is a good idea. It can be used as hard evidence to show that you did not damage something.', 'Video', 60, 'Continue,,', '', 0),
(2398, 69, 'EX', '<b>Threats</b><br/><br/>The more severe a threat&#44; the more likely you will be able to get a restraining order. Threats that make you fear for your life help make a strong case for receiving a restraining order.', 'PT', 12, 'Continue,,,', '', 0),
(2399, 72, 'EX', 'There are a number of things to look at to determine whether you are an employee or independent contractor. Just because your employer says your something&#44; doesn&#39;t make it true. This guide is meant to help you figure out your true status. At the end you will get a summary of your results.  ', '', 1, 'Continue,,,', '', 0),
(2400, 72, 'MB', 'Are you a <b>construction contractor</b>? ', '', 2, 'Yes,Construction,,|No,,,', '', 0),
(2401, 72, 'MB', 'Are you licensed?', 'Construction', 3, 'Yes,,,|No,Licensed,,', '', 0),
(2402, 72, 'EX', 'You might be an employee. Since you are not licensed the court will assume you are an employee. Your employer can present evidence to prove that you&#39;re actually an independent contractor.', 'Licensed', 4, 'Continue,,,', '', 0),
(2403, 72, 'MB', 'Can your employer let you go or fire you <b>whenever</b> he or she wants to?', '', 5, 'Yes,,,discharge=employee|No,,,discharge=independent contractor|I don&#39;t know,,,', '', 0),
(2406, 72, 'MB', 'Do you report to a supervisor?', '', 6, 'Yes,,,supervisor=employee|No,,,supervisor=independent contractor', '', 0),
(2409, 72, 'MC', 'Who <b>supplies</b> your work equipment?', '', 7, 'My employer ,,,equipment=employee|I do,,,equipment=independent contractor|A combination ,Purchase,,|There is no equipment,,,', '', 0),
(2410, 72, 'MB', 'Did you purchase or own <b>most</b> of the equipment you use? ', 'Purchase', 8, 'Yes,,,equipment=independent contractor|No,,,', '', 0),
(2414, 72, 'MC', 'Where do you work?', '', 9, 'Home or a place of your choosing ,,,where= independent contractor|Employer&#39;s premises ,,,where=employee|A combination ,,,|None of the Above,,,', '', 0),
(2420, 72, 'MC', 'What are you paid by?', '', 10, 'Hour/Salary,,,paid=employee|Amount of work completed,,,paid=independent contractor', '', 0),
(2423, 72, 'MB', 'Who&#44; for the most part&#44; decided the price/wage you are paid?', '', 11, 'Employer,,,wage=employee|I did,,,wage=independent contractor', '', 0),
(2426, 72, 'MB', 'Who choose the start date? ', '', 12, 'Employer,,,start=employee|I did,,,start=independent contractor', '', 0),
(2429, 72, 'MC', 'How long is your work performed for?', '', 13, 'Undetermined – Ongoing ,,,time=employee|For a fixed period of time ,Regular,,|Until the job is done,Regular,,', '', 0),
(2431, 72, 'MB', 'Is your work for your employer <b>reocurring</b>? For example&#44; you do it seasonally&#44; such as every winter. ', 'Regular', 14, 'Yes,,,time=employee|No,,,time=independent contractor', '', 0),
(2434, 72, 'MB', 'Are you working for another business?', '', 15, 'Yes,Necessary,,|No,,,', '', 0),
(2435, 72, 'MB', 'Is the work you perform a <b>necessary</b> part of that business? For example&#44; a store can&#39;t run without cashiers.', 'Necessary', 16, 'Yes,,,necessary=employee|No,,,necessary=independent contractor|I don&#39;t know,,,', '', 0),
(2438, 72, 'MC', 'Did you believe you were an Independent Contractor or Employee while working?', '', 17, 'Independent Contractor ,,,contract=independent contractor|Employee,,,contract=employee|I don&#39;t know,,,', '', 0),
(2441, 72, 'MB', 'Is your field <b>specialized</b>? ', '', 18, 'Yes,,,specialized=independent contractor|No,,,specialized=employee', '', 0),
(2444, 72, 'MC', 'Can your work be completed using <b>different or unique methods</b>?', '', 19, 'Different ways ,Different,,skill= independent contractor|More or less one way ,Same,,skill=employee', '', 0),
(2445, 72, 'MB', 'Is your work done under <b>supervision</b>? For example&#44; you are watched sometimes.', 'Different', 20, 'Yes,,,watched=employee|No,,,watched=independent contractor', '', 0),
(2448, 72, 'MB', 'Does your employer tell you how to do your job?', 'Different', 21, 'Yes,Train,,|No,MethodsIC,,method=independent contractor', '', 0),
(2450, 72, 'MB', 'Did your employer train you?', 'Train', 22, 'Yes,TrainEE,,train=employee|No,TrainIC,,train=independent contractor', '', 0),
(2453, 72, 'MB', 'Is your work done under <b>supervision</b>? For example&#44; you are watched sometimes.', 'Same', 23, 'Yes,,,watched=employee|No,,,', '', 0),
(2454, 72, 'MB', 'Does your employer tell you how to do your job?', 'Same', 24, 'Yes,Train2,,|No,,,', '', 0),
(2455, 72, 'MB', 'Did your employer train you?', 'Train2', 25, 'Yes,,,train=employee|No,,,', '', 0),
(2456, 72, 'MB', 'Could you <b>hire</b> anyone else to help you with your work&#44; without permission of your employer? ', '', 26, 'Yes,,,hire=independent contractor|No,,,hire=employee', '', 0);
INSERT INTO `questions` (`id`, `test_id`, `type`, `question`, `cluster`, `seq`, `answers`, `factor`, `sidepane`) VALUES
(2459, 72, 'OP', 'Do you have <b>any</b> of the following that is<br/>NOT provided by your employer:', 'CanHire', 27, 'A business name,,,|An office,,,|Multiple clients or companies you provide your service to ,,,|nota,,,', '', 0),
(2461, 72, 'MB', 'Can you <b>refuse</b> to do work your employer asks you to do?', '', 28, 'Yes,,,refuse=independent contractor|No,,,refuse=employee', '', 0),
(2464, 72, 'EX', '<b>Results</b><br/><br/>\nCount of the number of factors in favor of employee or independent contractor status to figure out what you might be.<br/><br/>\ndischarge: {discharge}<br/>\nsupervisor: {supervisor}<br/>\nequipment: {equipment}&#44; {where}<br/>\ninvestment: {investment}<br/>\ncompensation: {paid}&#44; {wage}&#44; {start}<br/>\npermanance: {time}<br/>\nregular business: {necessary}<br/>\ncontract: {contract}<br/>\ndistinct occupation: {specialized}<br/>\ncontrol: {skill}&#44; {watched}&#44; {methods}&#44; {train}&#44; {refuse}<br/>\nbussiness: {hire}&#44; {business}<br/>', '', 29, 'Continue,,,', '', 0),
(2465, 73, 'EX', 'It&#39;s important to know whether the person you&#39;re hiring is an Employee or Independent Contractor because getting it wrong can lead to big fines and penalties. Willful misclassification of your worker as an independent contractor can result in a fine between $5000 to $15000 for each violation. This guide will help you figure out which factors to watch for to keep compliant.', '', 1, 'Start,,,', '', 0),
(2466, 73, 'MB', 'Is the person a <b>construction contractor</b>? ', '', 2, 'Yes,Construction,,|No,,,', '', 0),
(2467, 73, 'MB', 'Is the person licensed?', 'Construction', 3, 'Yes,,,|No,Licensed,,', '', 0),
(2468, 73, 'EX', 'Your worker might be an <b>employee</b>&#44; since he or she is not licensed. If this becomes an issue&#44; you can present other evidence to prove that the person is actually an independent contractor.', 'Licensed', 4, 'Continue,,,', '', 0),
(2469, 73, 'MB', 'Can you fire your worker <b>whenever</b> you want to?', '', 5, 'Yes,,,discharge=<b>discharge</b> &ndash; employees can be fired at any moment. You need to give up this power for independent contractor status.|No,,,discharge1=<b>discharge</b> &ndash; cannot fire your worker at any moment|I don&#39;t know,,,', '', 0),
(2470, 73, 'MB', 'Does your worker report to a supervisor?', '', 6, 'Yes,,,supervisor=<b>supervisor</b> &ndash; employees have supervisors. Independent contractors usually do not.|No,,,supervisor1=<b>supervisor</b> &ndash; does not report to a supervisor', '', 0),
(2471, 73, 'MC', 'Who <b>supplies</b> the worker&#39;s tools and work equipment?', '', 7, 'I do,EquipmentEE,,equipment=<b>equipment</b> - employees are supplied equipment. Independent contractors usually supply their own equipment.|The worker,EquipmentIC,,equipment1=<b>equipment</b> - supplies own equipment|A combination ,Purchase,,|There is no equipment,,,', '', 0),
(2472, 73, 'MB', 'Did the worker purchase or own <b>most</b> of the equipment you use? ', 'Purchase', 8, 'Yes,PurchaseIC,,equipment1=<b>equipment</b> - supplies own equipment|No,,,', '', 0),
(2473, 73, 'MC', 'Where does this person work?', '', 9, 'Wherever the worker wants to (home&#44; starbucks&#44; etc.),WhereIC,,where1=<b>location</b> - works at place of choosing|Employer&#39;s premises ,WhereEE,,where=<b>location</b> - employees usually work at an employer''s premises. Try to give your worker an option to work wherever he or she wants.|A combination ,,,|None of the Above,,,', '', 0),
(2474, 73, 'MB', 'Besides equipment&#44; does your worker spend any money for work&#44; such as personal investments?', '', 10, 'Yes,InvestmentIC,,investment1=<b>investments</b> - makes personal investments|No,InvestmentEE,,investment=<b>investment</b> - employees usually do not invest in the business. Independent contracts invest in the business.', '', 0),
(2475, 73, 'MC', 'What is the worker paid by?', '', 11, 'Hour/Salary,PaidEE,,paid=<b>paid</b> - employees are usually paid by the hour or a salary. Try paying your worker by the amount of work completed.|Amount of work completed,PaidIC,,paid1=<b>paid</b> - by the job or amount of work completed', '', 0),
(2476, 73, 'MB', 'Who&#44; for the most part&#44; decided the price/wage you are paid?', '', 12, 'I did,WageEE,,wage=<b>wage</b> - employees usually don''t get to decide how much they''re paid. Try letting your worker decide how much to get paid for his or her services.|The worker,WageIC,,wage1=<b>wage</b> - decided by worker', '', 0),
(2477, 73, 'MB', 'Who choose the start date? ', '', 13, 'I did,StartEE,,start=<b>start date</b> - employees usually don''t get to choose their start date. Independent contractors typically choose their own schedules.|The worker,StartIC,,start1=<b>start date</b> - chose start date', '', 0),
(2478, 73, 'MC', 'How long does the worker&#39;s job last for?', '', 14, 'Undetermined – Ongoing ,TimeEE,,time=<b>duration</b> - employees usually work without having a definite end date. Independent contractors usually have a fixed date to end working. |For a fixed period of time ,Regular,,|Until the job is done,Regular,,', '', 0),
(2479, 73, 'MB', 'Is the person&#39;s work <b>reocurring</b>? For example&#44; it is seasonal&#44; such as every spring. ', 'Regular', 15, 'Yes,RegularEE,,time=<b>duration</b> - reoccurring work is usually done by employees. Independent contractors specialize in work as needed.|No,RegularIC,,time1=<b>duration</b> - the end date is fixed', '', 0),
(2480, 73, 'MB', 'Is the work performed a <b>necessary</b> part of the business? For example&#44; a store cannot run without cashiers. ', '', 16, 'Yes,NecessaryEE,,necessary=<b>necessary</b> - employees usually perform a necessary part of your business. Independent contractors are usually used for special jobs.|No,NecessaryIC,,necessary1=<b>necessary</b> - not a necessary part of your business.|I don&#39;t know,,,', '', 0),
(2481, 73, 'MC', 'Does your worker think he or she is an Independent Contractor or Employee?', '', 17, 'Independent Contractor ,ContractIC,,contract1=<b>belief</b> - believed was an independent contractor|Employee,,,|I don&#39;t know,,,', '', 0),
(2482, 73, 'MB', 'Is your worker&#39;s field <b>specialized</b>? ', '', 18, 'Yes,SpecializedIC,,specialized1=<b>specialized</b> - worker''s field is specialized|No,SpecializedEE,,specialized=<b>specialized</b> - employees usually do not preform specialized work. Independent contractors usually specialize in a field.', '', 0),
(2483, 73, 'MC', 'Can the work be completed in different ways or is there really only one way of completing the job?', '', 19, 'Different ways,Different,,skill1=<b>skill</b> - work can be completed in different ways|One way,Same,,skill=<b>skill</b> - employees usually preform low skill work that can only really be completed in one way. Independent contractors can preform their work in different ways.', '', 0),
(2484, 73, 'MB', 'Is your worker under watch or under <b>supervision</b>?', 'Different', 20, 'Yes,WatchedEE,,watched=<b>supervision</b> - employees are usually under supervision. Independent contractors are not. |No,WatchedIC,,watched1=<b>supervision</b> - not under supervision', '', 0),
(2485, 73, 'MB', 'Do you tell your worker how to do the job?', 'Different', 21, 'Yes,Train,,|No,MethodsIC,,method1=<b>methods</b> - not told how to do job', '', 0),
(2486, 73, 'MB', 'Did you train your worker?', 'Train', 22, 'Yes,TrainEE,,train=<b>trained</b> - employees are usually trained for their job. Independent contractors do not need training.|No,TrainIC,,train1=<b>trained</b> - not trained ', '', 0),
(2487, 73, 'MB', 'Is your worker under watch or under <b>supervision</b>?', 'Same', 23, 'Yes,WatchedEE,,watched=<b>supervision</b> - employees are usually under supervision. Independent contractors are not. |No,,,', '', 0),
(2488, 73, 'MB', 'Do you tell your worker how to do the job?', 'Same', 24, 'Yes,Train2,,|No,,,', '', 0),
(2489, 73, 'MB', 'Do you train your worker?', 'Train2', 25, 'Yes,TrainEE,,train=<b>trained</b> - employees are usually trained for their job. Independent contractors do not need training.|No,,,', '', 0),
(2490, 73, 'MB', 'Could your worker <b>hire</b> third–parties to help with the job&#44; without your permission? ', '', 26, 'Yes,HireIC,,hire1=<b>hire</b> - can hire other people|No,HireEE,,hire=<b>hire</b> - employees cannot hire others to help them with their job, but independent contractors usually can.', '', 0),
(2491, 73, 'OP', 'Does your worker have <b>any</b> of the following that is<br/>NOT provided by you:', 'CanHire', 27, 'A business name,BusinessIC,,|An office,BusinessIC,,|Multiple clients or companies you provide your service to ,BusinessIC,,|nota,,,', '', 0),
(2492, 73, 'MB', 'Can your worker <b>refuse</b> to do work assigned to him or her?', '', 28, 'Yes,RefuseIC,,refuse1=<b>refuse</b> - can refuse work|No,RefuseEE,,refuse=<b>refuse</b> - employees usually can''t refuse to do the work you assign. Independent contractors can decide.', '', 0),
(2493, 73, 'EX', '<b>Results</b><br/><br/>\nThe following factors are in favor of independent contractor status:<br/><br/>\n{discharge1}<br/>\n{supervisor1}<br/>\n{equipment1}<br/>\n{where1}<br/>\n{investment1}<br/>\n{paid1}<br/>\n{wage1}<br/> \n{start1}<br/>\n{time1}<br/>\n{necessary1}<br/>\n{contract1}<br/>\n{specialized1}<br/>\n{skill1}<br/>\n{watched1}<br/>\n{business1}<br/>\n{methods1}', '', 29, 'Continue,,,', '', 0),
(2494, 73, 'EX', '<b>Results</b><br/><br/>The following factors are indicative of employee status. Here are some tips on how to get your worker closer to independent<br/><br/>\n{discharge}<br/>\n{supervisor}<br/>\n{equipment}<br/>\n{where}<br/>\n{investment}<br/>\n{paid}<br/>\n{wage}<br/> \n{start}<br/>\n{time}<br/>\n{necessary}<br/>\n{specialized}<br/>\n{skill}<br/>\n{watched}<br/>\n{business1}<br/>\n{methods}', '', 30, 'Continue,,,', '', 0),
(2495, 24, 'ZZ', 'Based on your answers&#44; you may be eligible to receive asylum from the United States. ', '', 34, '0,,,', '', 0),
(2496, 74, 'MB', 'Is the purpose of the internship to benefit you or the employer?', '', 1, 'Me,,,|Employer,Intern,,purpose=Work benefits your employer&#44; not you|Both,,,', '', 0),
(2497, 74, 'MB', 'Do you work under close observation?', 'Close', 4, 'Yes,,,|No,,,close=You are not under close observation', '', 0),
(2498, 74, 'MB', 'Do you do the same work as a paid employee?', '', 2, 'Yes,Intern2,,same=You replace regular employees|No,Close,,|I don&#39;t know,Close,,', '', 0),
(2499, 74, 'MB', 'Does your employer receive an immediate benefit from your work?', '', 6, 'Yes,Intern3,,benefit=Employer receives immediate benefit|No,,,|I don&#39;t know,,,', '', 0),
(2500, 74, 'MB', 'Are you <b>guaranteed</b> a job at the end of your &quot;internship&quot;?', '', 8, 'Yes ,Intern4,,job=You are guaranteed a job|No,,,', '', 0),
(2501, 74, 'MB', 'Was it your understanding that you would not get paid a wage?', '', 10, 'Yes,,,|No,Intern5,,paid=You thought you&#39;d get paid', '', 0),
(2502, 74, 'MB', 'Is your work similar to training given in an educational setting?', '', 12, 'Yes,,,|No,Intern6,,educational=Training is not educational', '', 0),
(2503, 75, 'MB', 'Is the purpose of the internship to benefit the worker or the company? ', '', 1, 'Company,Benefit,,|Worker,,,|Both,,,|I don&#39;t know,,,', '', 0),
(2504, 75, 'MB', 'Does the person work under close observation?', 'Close', 4, 'Yes,,,|No,Supervision,,', '', 0),
(2505, 75, 'MB', 'Does the person do the same work as a paid employee?', '', 3, 'Yes,Same,,|No,Close,,|I don&#39;t know,Close,,', '', 0),
(2506, 75, 'MB', 'Does your company receive an immediate benefit from the work performed?', '', 7, 'Yes,Immediate,,|No,,,|I don&#39;t know,,,', '', 0),
(2507, 75, 'MB', 'Is the person guaranteed a job at the end of the &quot;internship&quot;?', '', 9, 'Yes ,Job,,|No,,,', '', 0),
(2508, 75, 'MB', 'Did you and your worker both understand that a wage would not be paid?', '', 11, 'Yes,,,|No,Understand,,', '', 0),
(2509, 75, 'MB', 'Is the work similar to training given in an education setting?', '', 13, 'Yes,,,|No,Educational,,', '', 0),
(2510, 75, 'EX', '<b>Benefit</b><br/><br/>An internship should be  designed as an extension of the worker&#39;s educational experience and should be for the benefit of the worker&#44; not your company. The worker should not be engaged in the regular and routine work of your company&#39;s operations that benefit the company. If the purpose of the internship is to derive benefit to your company&#44; the worker is probably not an intern. ', 'Benefit', 2, 'Continue,,,', '', 0),
(2511, 75, 'EX', '<b>Regular Employees</b><br/><br/>An intern can not displace regular employees. If the worker is doing the same work a paid employee would be doing within your company&#44; then the worker is probably not an intern. The fact that a company would pay for someone to do the work is evidence that the work is important. Workers should get paid for work that is important to a company&#39;s operations. ', 'Same', 6, 'Continue,,,', '', 0),
(2512, 75, 'EX', '<b>Supervision</b><br/><br/>Interns usually work under close supervision. If a worker is under the same level of supervision as a regular employee&#44; the worker is probably not an intern. Close supervision is necessary for interns because the your main duty is to provide the intern with an opportunity to learn certain functions within the employment setting. ', 'Supervision', 5, 'Continue,,,', '', 0),
(2513, 75, 'EX', '<b>Immediate Benefit</b><br/><br/>Your company cannot receive an immediate benefit from the worker in order to classify that person as an intern. In fact&#44; sometimes your operations may be impeded by having the worker around. This is because an internship is for the benefit of the worker and not the company. ', 'Immediate', 8, 'Continue,,,', '', 0),
(2514, 75, 'EX', '<b>Job</b><br/><br/>The duration of the internship period must be fixed in the beginning. At the end of the internship period&#44; an intern is not guaranteed a job. It may be a possibility&#44; but not a guarantee. You can&#39;t use the period as a trial and give the expectation that the worker will be hired at the end. ', 'Job', 10, 'Continue,,,', '', 0),
(2515, 75, 'EX', '<b>Understanding</b><br/><br/>It should be made clear that the worker is not to be paid (or be paid below minimum wage of a stipend) from the beginning of the internship. A lack of this understanding might be evidence that the worker is not an intern. ', 'Understand', 12, 'Continue,,,', '', 0),
(2516, 75, 'EX', '<b>Educational</b><br/><br/>The type of training an intern receives should be similar to training that would be given in an educational environment. This is because an internship should be an extension of a worker&#39;s educational experience. ', 'Educational', 14, 'Continue,,,', '', 0),
(2517, 74, 'MB', 'Do you do the same work as a paid employee?', 'Intern', 3, 'Yes,Intern2,,same=You replace regular employees|No,Close2,,|I don&#39;t know,Close2,,', '', 0),
(2518, 74, 'MB', 'Do you work under close observation?', 'Close2', 5, 'Yes,Intern2,,|No,Intern2,,close=You are not under close observation', '', 0),
(2519, 74, 'MB', 'Does your employer receive an immediate benefit from your work?', 'Intern2', 7, 'Yes,Intern3,,benefit=Employer receives immediate benefit|No,Intern3,,|I don&#39;t know,Intern3,,', '', 0),
(2520, 74, 'MB', 'Are you <b>guaranteed</b> a job at the end of your &quot;internship&quot;?', 'Intern3', 9, 'Yes ,Intern4,,job=You are guaranteed a job|No,Intern4,,', '', 0),
(2521, 74, 'MB', 'Was it your understanding that you would not get paid a wage?', 'Intern4', 11, 'Yes,Intern5,,|No,Intern5,,paid=You thought you&#39;d get paid', '', 0),
(2522, 74, 'MB', 'Is your work similar to training given in an educational setting?', 'Intern5', 13, 'Yes,Intern6,,|No,Intern6,,educational=Training is not educational', '', 0),
(2523, 74, 'ZZ', 'You are probably not an intern because you did not satisfy one or more of the factors to be classified as an unpaid intern. You may be owed wages from your employer for the work you did. A lawyer can help you recover the money you deserve. The following facts disqualify you from being an intern:<br/><br/>\n<div>{purpose}</div>\n<div>{same}<div/>\n<div>{close}<div/>\n<div>{benefit}<div/>\n<div>{job}<div/>\n<div>{paid}<div/>\n<div>{educational}<div/>', 'Intern6', 14, '0,,,', '', 0),
(2524, 74, 'ZZ', 'You are probably an intern because you satisfy the federal standard for making the determination. However&#44; states&#44; such as California&#44; have stricter conditions which must be factored in. ', '', 15, '0', '', 0),
(2526, 76, 'MB', 'Is your business planning to grant stock options or other equity compensation?', '', 1, 'Yes,Options,,|No,,,', '', 0),
(2527, 76, 'MB', 'Is your business likely to get sued?', '', 3, 'Yes,Sued,,|No,,,|Maybe,Sued,,', '', 0),
(2528, 76, 'MB', 'Is your business seeking seed or venture capital?', '', 5, 'Yes,Venture,,|No,,,|Maybe,Venture,,', '', 0),
(2529, 76, 'MB', 'Does your business have more than 1 founder?', '', 7, 'Yes,Founder,,|No,,,', '', 0),
(2530, 76, 'MB', 'Is your business hiring developers or designers?', '', 9, 'Yes,Hiring,,|No,,,', '', 0),
(2531, 23, 'ZZ', 'If you didn&#39;t see any explanations&#44; then you probably have a decent case to obtain custody of your child. If you had negative factors affecting your case&#44; you can still argue that you deserve custody of your child. In both instances a lawyer can help you obtain custody of your child. ', '', 30, '0', '', 0),
(2533, 75, 'ZZ', 'If you did not see any recommendations&#44; your worker is probably an intern. However&#44; some states have stricter regulations in determining intern status. If you did see recommendations&#44; your worker may want to modify your internship program or you may owe wages. A lawyer can help you figure out the best way to keep your company compliant with all federal and state regulations. Failing to do so may lead to law suits and fines. ', '', 15, '0,,,', '', 0),
(2535, 77, 'MB', 'Have you revealed secret business information to employees or contractors?', '', 1, 'Yes,NDA,,|No,,,', '', 0),
(2536, 77, 'EX', '<b>NDA</b><br/><br/>You might need a Non&ndash;disclosure agreement. A Non&ndash;disclosure agreement (NDA) is an agreement between two parties that outlines confidential information that cannot be shared or disclosed to others. It is necessary if a company is sharing confidential information to another person&#44; such as an employee&#44; and wants that person not to disclose the information to others.', 'NDA', 2, 'Continue,,,', '', 0),
(2537, 77, 'MB', 'Would your employee or contractor be able to use their experience at your company to compete with you in the future?', '', 3, 'Yes,Noncompete,,|No,,,', '', 0),
(2538, 77, 'EX', '<b>Non–compete</b><br/><br/>You might need a Non–compete Agreement. A non–compete stops someone from becoming your competitor for some amount of time&#44; depending on what you are restricting and what industry you are in.', 'Noncompete', 4, 'Continue,,,', '', 0),
(2539, 77, 'MB', 'Do you hire people that produce creative or inventive work for you&#44; such as developers and designers?', '', 5, 'Yes,IP,,|No,,,', '', 0),
(2540, 77, 'EX', '<b>IP Assignment</b><br/><br/>You might need an Intellectual Property Assignment. When an employee or contractor produces work&#44; he or she holds the intellectual property rights to the work. However&#44; an IP Agreement transfers those rights to the company&#44; thereby allowing the company to use the work in whichever way it pleases.', 'IP', 6, 'Continue,,,', '', 0),
(2542, 78, 'MC', 'Are you an employee or independent contractor?', '', 1, 'Employee,,,|Independent Contractor,Unclear,,|Unsure,ICEE,,', '', 0),
(2543, 79, 'MC', 'Who is your employer?', '', 2, 'Private Employer,Private,,|School,,,|Government,,,', '', 0),
(2544, 78, 'MC', 'Did you get injured or sick due to your job?', '', 2, 'Injured,Physical,,|Sick,Illness,,|Neither,Unclear,,', '', 0),
(2545, 78, 'MB', 'Did you get sick because of your job?', 'Illness', 3, 'Yes,Probably,,|No,Worse,,', '', 0),
(2546, 78, 'MB', 'Did your sickness get worse because of your job?', 'Worse', 4, 'Yes,Maybe,,|No,Unclear,,', '', 0),
(2547, 78, 'MB', 'Were you injured while doing something work–related?', 'Physical', 5, 'Yes,Probably,,|No,Unclear,,|Not Sure,Doing,,', '', 0),
(2548, 78, 'MC', 'Which of the following best describes what you were doing?', 'Doing', 6, 'Lunch or coffee break,Lunch,,|Something your employer asked you to do,Probably,,|None of the above,Where,,', '', 0),
(2549, 78, 'MB', 'Were you on your employer&#39;s property during the break?', 'Lunch', 7, 'Yes,Probably,,|No,Unclear,,', '', 0),
(2550, 78, 'MC', 'Where were you when you got injured?', 'Where', 8, 'Work site,Horseplay,,|Not at work site,Travel,,|Company event,Maybe,,|I don&#39;t have a regular work site,Maybe,,', '', 0),
(2551, 78, 'MB', 'Were you fooling around?', 'Horseplay', 9, 'Yes,Times,,|No,Probably,,', '', 0),
(2552, 78, 'MB', 'Have you done this more than once?', 'Times', 10, 'Yes,Tell,,|No,Unclear,,', '', 0),
(2553, 78, 'MB', 'Did your employer ever tell you not to do this?', 'Tell', 11, 'Yes,Unclear,,|No,Know,,', '', 0),
(2554, 78, 'MB', 'Did you employer know that you would do this type of activity sometimes?', 'Know', 12, 'Yes,Probably,,|No,Unclear,,|Don&#39;t Know,Maybe,,', '', 0),
(2555, 78, 'MB', 'Were you injured while traveling?', 'Travel', 13, 'Yes,Paid,,|No,Benefit,,', '', 0),
(2556, 78, 'MB', 'Were you doing something for the benefit of your employer?', 'Benefit', 14, 'Yes,Maybe,,|No,Unclear,,', '', 0),
(2557, 78, 'MB', 'Are you paid for the time while you are traveling?', 'Paid', 15, 'Yes,Probably,,|No,Going,,', '', 0),
(2558, 78, 'MC', 'Where were you going?', 'Going', 16, 'To work or home,Unclear,,|To a lunch or coffee break,Unclear,,|On a business trip,Probably,,|None of the above,Unclear,,', '', 0),
(2559, 78, 'ZZ', 'You need to be considered an &quot;Employee&quot; in order to be eligible for workers&#39; compensation. If you are unsure whether or not you are an employee or independent contractor&#44; try our guide called &quot;Am I an Independent Contractors?&quot; An attorney can also help you figure our your status. ', 'ICEE', 17, '0,,,', '', 0),
(2560, 78, 'ZZ', 'Based on your answers&#44; it is unclear whether or not you are eligible for Workers&#39; Compensation. Generally&#44; in order to be eligible you must have suffered a work–related injury. However&#44; there are numerous exceptions and&#44; depending on the specific facts of your case&#44; you may be eligible. An attorney can help you figure this out. ', 'Unclear', 18, '0,,,', '', 0),
(2561, 78, 'ZZ', 'Based on your answers&#44; you might be eligible for workers&#39; compensation. However&#44; every case is different depending on the specific facts. Therefore&#44; it is helpful to speak with an attorney.', 'Maybe', 19, '0', '', 0),
(2562, 78, 'ZZ', 'Based on your answers&#44; you are probably eligible for workers&#39; compensation. An attorney can help you file the appropriate paperwork and get the compensation you deserve! ', 'Probably', 20, '0', '', 0),
(2563, 76, 'EX', '<b>Incorporation</b><br/><br/>If you business is planning to grant stock options or other equity compensation&#44; you may want to think about incorporating soon. It will be easier to grant these forms of compensation via a corporation.', 'Options', 2, 'Continue,,,', '', 0),
(2564, 76, 'EX', '<b>Incorporation</b><br/><br/>If you business is at a high risk of getting sued&#44; it&#39;s a good idea to incorporate soon. By forming a corporation you will be protected from personal liability. This means if you business gets sued&#44; you are not personally liable and none of your assets will be touched.', 'Sued', 4, 'Continue,,,', '', 0),
(2565, 76, 'EX', '<b>Incorporate</b><br/><br/>If you are seeking venture or seed funding&#44; it&#39;s a good idea to incorporate because you will need an entity to accept the investments. In fact&#44; most VCs will not fund you unless you are incorporated. ', 'Venture', 6, 'Continue,,,', '', 0),
(2566, 76, 'EX', '<b>Incorporate</b><br/><br/>If you have more than 1 founder&#44; it&#39;s a good idea to incorporate to solidify any promises and understanding on paper. During incorporation&#44; the obligations and rights of each founder will be outlined. More importantly&#44; the percentage of shares each person owns will be decided. It is easier to formalize these agreements in writing earlier than trying to clean up misunderstandings later. ', 'Founder', 8, 'Continue,,,', '', 0),
(2567, 76, 'EX', '<b>Incorporate</b><br/><br/>If you plan on hiring employees or contractors&#44; it&#39;s a good idea to incorporate so the corporate is liable to these workers and not you. Furthermore&#44; you want to make sure any work produced by them is transferred to the company&#44; thereby avoiding any intellectual property disputes. This is especially important if you plan on hiring designers or developers because you want to make sure the company owns all work or code that is produced.', 'Hiring', 10, 'Continue,,,', '', 0),
(2568, 76, 'ZZ', 'Generally&#44; it might be a good idea to incorporate if your business is at risk of getting sued&#44; other people are contributing their ip&#44; you have more than 1 founder&#44; or you plan on distibuting stock to employees or investors. If you do think it&#39;s time for your business to incorporate&#44; you might want to speak with a lawyer to help you file the paperwork. Alternatively&#44; an online legal document provider might be a good option if you incorporation is fairly straightforward and you&#39;re on a budget. ', '', 11, '0', '', 0),
(2569, 2, 'ZZ', 'Now that you&#39;ve learned more about LLCs and Corporations&#44; you might be ready to form an entity for your business. A lawyer can help you file the appropriate paper work. Alternatively&#44; you could use a online document service if your formation is fairly straightforward and you&#39;re on a budget. ', '', 12, '0,,,', '', 0),
(2570, 77, 'ZZ', 'Now you have a better idea of what documents your startup may need. A lawyer can help you write these contracts. Alternatively&#44; you could use online legal document providers if you need basic documents and you&#39;re on a budget. Lastly&#44; you can choose to write your own contract&#44; but as always&#44; it&#39;s best to at least have a lawyer review them for accuracy. ', '', 7, '0,,,', '', 0),
(2571, 79, 'MC', 'This year or last year&#44; has your employer had 50 or more employees for 20 or more weeks in the year?', 'Private', 3, 'Yes,,,|No,Not,,|Not Sure,Unsure,,', '', 0),
(2572, 79, 'MC', 'How long have you worked for this employer? (Does not have to be consecutive)', '', 4, 'Fewer than 12 months,Not,,|12 months or more,,,', '', 0),
(2573, 79, 'MC', 'In the 12 months prior to taking this leave&#44; how many hours did you work for this employer?', '', 5, 'Fewer than 1&#44;250 hours of service,Not,,|1&#44;250 hours of service or more,,,', '', 0),
(2574, 79, 'MC', 'How many employees work at the employer&#39;s work site&#44; or within 75 miles of it?', '', 6, '50 or more employees ,Covered,,|Fewer than 50 employees,Not,,', '', 0),
(2575, 79, 'ZZ', 'You are probably not eligible for FMLA. However&#44; every case is different depending on the situation. It will probably be helpful to speak with an attorney.', 'Not', 7, '0,,,', '', 0),
(2576, 79, 'ZZ', 'This information is necessary to determine whether or not you are eligible for FMLA. If in the last two years your employer has had fewer than 50 employees for at least 20 work weeks&#44; then your employer is not required to provide FMLA benefits. ', 'Unsure', 8, '0,,,', '', 0),
(2577, 79, 'ZZ', 'Based on your answers&#44; you are probably eligible for FMLA leave. To receive this benefit&#44; you must submit an FMLA form to your employer&#44; which usually also requires certification by a doctor or other health care provider. ', 'Covered', 9, '0,,,', '', 0),
(2578, 6, 'ZZ', 'Now you more about the rights you have and DWI penalties you may face. It&#39;s a good idea to hire a lawyer that can use these rights to help you minimize your penalties.', '', 26, '0,,,', '', 0),
(2579, 7, 'ZZ', 'Now you more about the rights you have and DUI penalties you may face. It&#39;s a good idea to hire a lawyer that can use these rights to help you minimize your penalties.', '', 30, '0', '', 0),
(2580, 8, 'ZZ', 'Now you more about the rights you have and DUI penalties you may face. It&#39;s a good idea to hire a lawyer that can use these rights to help you minimize your penalties.', '', 34, '0', '', 0),
(2581, 10, 'ZZ', 'Now you more about the rights you have and DUI penalties you may face. It&#39;s a good idea to hire a lawyer that can use these rights to help you minimize your penalties.', '', 31, '0', '', 0),
(2582, 79, 'MB', 'Find out if you&#39;re eligible for FMLA leave.', '', 1, 'Continue,,,', '', 0),
(2583, 63, 'ZZ', 'Now you know more about whether your work is an independent contractor or employee. A lawyer can help you stay compliant with these regulations to minimize the risk of law suits and fines. ', '', 66, '0', '', 0);
